INSERT INTO `movie` VALUES ('10432911', '流感', '　　一群东南亚偷渡客历经艰险来到韩国，但是整个集装箱内的偷渡客几乎全部死亡，只有一人拖着羸弱的身体侥幸逃入闹市之中。殊不知此人身上携带致命猪流感病毒，短短一天时间，病毒迅速蔓延城市的各个角落。许多人在不知不觉间被感染，进而将死亡的阴影引向周围所有的人。美丽的女医生金仁海（秀爱饰）是一位单身妈妈，她不久前遭遇一场车祸，幸被消防队救援人员姜智久（张赫饰）救出，却因丢失重要论文资料而备受上司苛责。值此期间，韩国蛇头的弟弟因流感送入仁海的医院治疗，经诊断终于发现流感的起因，死尸横陈的集装箱无疑成为查找病源的关键。', '/static/upload/movie/2020-3-10/p2029391129.jpg', ' 韩国', '2013-08-14(韩国)', 3.9, '2020-03-08 21:28:52.082981', '2020-03-08 21:28:52.082981');
INSERT INTO `movie` VALUES ('10437779', '新世界', '　　金门集团会长、暴力组织在虎派大佬石东出遭遇车祸身亡，该事件在黑白两道引起不小震荡。为了遏制金门集团进一步向合法领域渗透并持续壮大，警方及时提出“新世界计划”，旨在干预金门集团继任大佬的选举。而围绕会长头衔，金门旗下三号人物华侨出身的丁青（黄正民饰）和四号人物常务理事李仲久（朴圣雄饰）展开一连串明争暗斗。在危机四伏的当下，警方姜科长（崔岷植饰）命令卧底十年之久的李子成（李政宰饰）左右选举结果。子成六年前和丁青结识，并且得到对方的器重和信任。早已厌倦黑道生活的子成无奈受命，却无疑将自己投入了凶险非常的黑色漩涡之中。', '/static/upload/movie/2020-3-10/p1903379979.jpg', ' 韩国', '2013-02-21(韩国)', 9.1, '2020-03-08 21:28:49.807572', '2020-03-08 21:28:49.807572');
INSERT INTO `movie` VALUES ('10558422', '盘丝洞', '　　唐僧（薛梅康饰）想要只身一人下山化缘，遭到了孙悟空（吴文超饰）的阻拦。然而，唐僧却并没有听徒弟的警告，一意孤行，结果在化缘途中遇见了居住在盘丝洞里的蜘蛛精（殷明珠饰）。蜘蛛精将唐僧捉住盘丝洞，想要献给大王，孙悟空久久不见师父归来，出发寻找。', '/static/upload/movie/2020-3-10/p2555860942.jpg', ' 中国大陆', '1927-02-02(中国大陆)', 7.5, '2020-03-08 21:28:45.669762', '2020-03-08 21:28:45.669762');
INSERT INTO `movie` VALUES ('10574622', '人再囧途之泰囧', '　　商业成功人士徐朗（徐峥饰）用了五年时间发明了一种叫“油霸”的神奇产品——每次汽车加油只需加到三分之二，再滴入2滴“油霸”，油箱的汽油就会变成满满一箱。徐朗的同学，兼商业竞争对手高博（黄渤饰）想把这个发明一次性卖给法国人。但徐朗坚决不同意，他希望深入开发研究，把“油霸”发扬光大，得到更远的收益。两个人各抒己见，争论不休，一直无果。由于两人股份相同，唯有得到公司最大股东周扬的授权书，方可达到各自目的。当得知周扬在泰国后，徐朗立刻启程寻找。而高博获悉后将一枚跟踪器放在徐朗身上一起去了泰国。飞机上，徐朗遇到了王宝（王宝强饰），别有心机地想利用他来摆脱对手高博的追赶，可他不仅没甩掉王宝，还成了他的“贴身保姆”……', '/static/upload/movie/2020-3-10/p1793720172.jpg', ' 中国大陆', '2012-12-12(中国大陆)', 9.8, '2020-03-08 21:28:40.073006', '2020-03-08 21:28:40.073006');
INSERT INTO `movie` VALUES ('10741834', '复仇者联盟2：奥创纪元', '　　托尼·斯塔克（小罗伯特·唐尼RobertDowneyJr.饰）试图重启一个已经废弃的维和项目，不料该项目却成为危机导火索。世上最强大的超级英雄——钢铁侠、美国队长（克里斯·埃文斯ChrisEvans饰）、雷神（克里斯·海姆斯沃斯ChrisHemsworth饰）、绿巨人（马克·鲁弗洛MarkRuffalo饰）、黑寡妇（斯嘉丽·约翰逊ScarlettJohansson饰）和鹰眼（杰瑞米·雷纳JeremyRenner饰），不得不接受终极考验，拯救危在旦夕的地球。神秘反派奥创（詹姆斯·斯派德JamesSpader配音）逐渐崛起，超级英雄们必须重新集结，竭力阻止奥创实施人类灭绝计划。战斗中，复仇者联盟成员们还遇到了两个新人物——旺达·马克西莫夫（伊丽莎白·奥尔森ElizabethOlsen饰）和皮特罗·马克西莫...', '/static/upload/movie/2020-3-10/p2237747953.jpg', ' 美国', '2015-05-12(中国大陆);2015-05-01(美国)', 7.5, '2020-03-08 21:28:03.751863', '2020-03-08 21:28:03.751863');
INSERT INTO `movie` VALUES ('10777687', '7号房的礼物', '　　1997年，只有6岁儿童智商的智障男子李龙久（柳成龙饰）和可爱的女儿艺胜（葛素媛饰）相依为命，生活虽然简单清贫，却充满幸福。某天，执着为女儿买美少女战士书包的龙久意外卷入一起幼童诱拐奸杀案，而死者竟是警察局长的女儿。龙久懵懂无知，搞不清状况，昏头昏脑就被投入监狱。在7号牢房中，聚集着走私犯蘇杨浩（吴达洙饰）、诈骗犯崔春浩（朴元尚饰）、通奸犯姜万范（金正泰饰）、恐吓犯老徐（金基灿饰）和抢劫犯申奉植（郑万植饰）等五毒俱全的“社会渣滓”。龙久孩子般纯洁的心渐渐感动了这几个“大坏蛋”，他们甚至不惜冒险将艺胜带入牢房与父亲相会。', '/static/upload/movie/2020-3-10/p1816276065.jpg', ' 韩国', '2013-01-23(韩国)', 7.7, '2020-03-08 21:26:19.661884', '2020-03-08 21:26:19.661884');
INSERT INTO `movie` VALUES ('11026735', '超能陆战队', '　　未来世界的超级都市旧京山（SanFransokyo），热爱发明创造的天才少年小宏，在哥哥泰迪的鼓励下参加了罗伯特·卡拉汉教授主持的理工学院机器人专业的入学大赛。他凭借神奇的微型磁力机器人赢得观众、参赛者以及考官的一致好评，谁知突如其来的灾难却将小宏的梦想和人生毁于一旦。大火烧毁了展示会场，而哥哥为了救出受困的卡拉汉教授命丧火场。身心饱受创伤的小宏闭门不出，哥哥生前留下的治疗型机器人大白则成为安慰他的唯一伙伴。原以为微型机器人也毁于火灾，谁知小宏和大白竟意外发现有人在某座废弃工厂内大批量地生产他的发明。', '/static/upload/movie/2020-3-10/p2224568669.jpg', ' 美国', '2015-02-28(中国大陆);2014-10-23(东京电影节);2014-11-07(美国)', 9.9, '2020-03-08 21:27:32.935821', '2020-03-08 21:27:32.935821');
INSERT INTO `movie` VALUES ('11584016', '与神同行：罪与罚', '　　阴间有法，所有亡者在死后的49天内都要经过七次审判——分别在杀人狱、懒惰狱、欺骗狱、不义狱、背叛狱、暴力狱、天伦狱中进行，只有通过了七次审判宣告无罪的亡者，才有获得新生的机会。', '/static/upload/movie/2020-3-10/p2500130777.jpg', ' 韩国', '2017-12-20(韩国)', 1.9, '2020-03-08 21:28:47.608122', '2020-03-08 21:28:47.608122');
INSERT INTO `movie` VALUES ('11600140', '猎野人', '　　四个年轻人来到森林探险，女孩雀儿与伙伴走散，路上遇到了野人。', '/static/upload/movie/2020-3-10/p2335793434.jpg', ' 中国大陆', '2011', 9.4, '2020-03-08 21:28:12.676278', '2020-03-08 21:28:12.676278');
INSERT INTO `movie` VALUES ('1291543', '功夫', '　　1940年代的上海，自小受尽欺辱的街头混混阿星（周星驰）为了能出人头地，可谓窥见机会的缝隙就往里钻，今次他盯上行动日益猖獗的黑道势力“斧头帮”，想借之大名成就大业。', '/static/upload/movie/2020-3-10/p2219011938.jpg', ' 中国大陆 / 中国香港', '2004-12-23(中国大陆/中国香港);2015-01-15(中国大陆3D);2004-09-14(多伦多电影节)', 6, '2020-03-08 21:28:48.069006', '2020-03-08 21:28:48.069006');
INSERT INTO `movie` VALUES ('1291546', '霸王别姬', '　　段小楼（张丰毅）与程蝶衣（张国荣）是一对打小一起长大的师兄弟，两人一个演生，一个饰旦，一向配合天衣无缝，尤其一出《霸王别姬》，更是誉满京城，为此，两人约定合演一辈子《霸王别姬》。但两人对戏剧与人生关系的理解有本质不同，段小楼深知戏非人生，程蝶衣则是人戏不分。', '/static/upload/movie/2020-3-10/p2561716440.jpg', ' 中国大陆 / 中国香港', '1993-01-01(中国香港);1993-07-26(中国大陆)', 9.2, '2020-03-08 21:28:52.841520', '2020-03-08 21:28:52.841520');
INSERT INTO `movie` VALUES ('1291549', '放牛班的春天', '　　1949年的法国乡村，音乐家克莱门特（杰勒德•尊诺饰）到了一间外号叫“塘低”的男子寄宿学校当助理教师。学校里的学生大部分都是难缠的问题儿童，体罚在这里司空见惯，学校的校长（弗朗西斯•贝尔兰德饰）只顾自己的前途，残暴高压。', '/static/upload/movie/2020-3-10/p1910824951.jpg', ' 法国 / 瑞士 / 德国', '2004-10-16(中国大陆);2004-03-17(法国)', 1.5, '2020-03-08 21:26:47.852277', '2020-03-08 21:26:47.852277');
INSERT INTO `movie` VALUES ('1291560', '龙猫', '　　小月的母亲生病住院了，父亲带着她与四岁的妹妹小梅到乡间的居住。她们对那里的环境都感到十分新奇，也发现了很多有趣的事情。她们遇到了很多小精灵，她们来到属于她们的环境中，看到了她们世界中很多的奇怪事物，更与一只大大胖胖的龙猫成为了朋友。龙猫与小精灵们利用他们的神奇力量，为小月与妹妹带来了很多神奇的景观，令她们大开眼界。', '/static/upload/movie/2020-3-10/p2540924496.jpg', ' 日本', '2018-12-14(中国大陆);1988-04-16(日本)', 1.7, '2020-03-08 21:28:52.736069', '2020-03-08 21:28:52.736069');
INSERT INTO `movie` VALUES ('1291561', '千与千寻', '　　千寻和爸爸妈妈一同驱车前往新家，在郊外的小路上不慎进入了神秘的隧道——他们去到了另外一个诡异世界—一个中世纪的小镇。远处飘来食物的香味，爸爸妈妈大快朵颐，孰料之后变成了猪！这时小镇上渐渐来了许多样子古怪、半透明的人。', '/static/upload/movie/2020-3-10/p2557573348.jpg', ' 日本', '2019-06-21(中国大陆);2001-07-20(日本)', 9.5, '2020-03-08 21:28:53.336095', '2020-03-08 21:28:53.336095');
INSERT INTO `movie` VALUES ('1291583', '天空之城', '　　古老帝国拉比达是一座漂浮在空中的巨大的机器岛，传说那里已经无人居住，蕴藏着巨大的财富。因此，无论军方还是海盗，都在找寻着这座传说中的飞行岛。', '/static/upload/movie/2020-3-10/p1446261379.jpg', ' 日本', '1992-05-01(中国大陆);1986-08-02(日本)', 9.4, '2020-03-08 21:28:51.860313', '2020-03-08 21:28:51.860313');
INSERT INTO `movie` VALUES ('1291585', '风之谷', '　　工业文明的高度发展，却最终带来灾难，一场为期7天的虫族毁灭战争摧毁了人类文明。一千年后，工业文明遗留下来的症结仍在困扰这个星球。带有强烈毒性的植物组成了令人望而却步的“腐海”森林，随着时间的推移，腐海有条不紊地向四周蔓延，蚕食周边世界。在一片腐海森林的旁边，居住着一群御风而行的人类。女主角娜乌茜卡和族人依靠海风的力量抵御着有毒孢子的侵蚀，过着平静祥和的生活。', '/static/upload/movie/2020-3-10/p1917567652.jpg', ' 日本', '1992-05(中国大陆);1984-03-11(日本)', 6.8, '2020-03-08 21:28:48.640699', '2020-03-08 21:28:48.640699');
INSERT INTO `movie` VALUES ('1291838', '红猪', '　　罗森是一战中意大利空军的王牌飞行员，但却被施了魔法变了一头猪。虽然变了猪，但罗森还是继续他的老本行，成了一位赏金猎人，专门打击在亚地里亚海空域作恶的空中劫匪。红猪侠一时威名远扬，令劫匪们闻风丧胆。匪徒们为了对付罗森，请来了超级飞行员卡基斯。卡基斯在于罗森对决中趁他发动机故障将其击落。罗森把飞机送到老朋友比克罗处修理时，遇上了比克罗的孙女菲欧。菲欧帮罗森修好了飞机，两人一起再度翱翔蓝天对付空中劫匪。', '/static/upload/movie/2020-3-10/p1637195728.jpg', ' 日本', '1992-07-18(日本)', 8.4, '2020-03-08 21:28:36.280521', '2020-03-08 21:28:36.280521');
INSERT INTO `movie` VALUES ('1291879', '罗生门', '　　罗生门，日本京都的正南门。云游和尚、砍柴人和乞丐在城门底下避雨，三人闲聊，话题开始，故事的序幕拉开：一个武士和他妻子路过荒山，遭遇了不测。妻子被侮辱，而武士惨遭杀害。惨案如何酿成？凶手、妻子、借武士亡魂来做证的女巫，都各有说法。', '/static/upload/movie/2020-3-10/p2564689879.jpg', ' 日本', '1950-08-26(日本)', 5.5, '2020-03-08 21:28:44.470189', '2020-03-08 21:28:44.470189');
INSERT INTO `movie` VALUES ('1292001', '海上钢琴师', '　　本片讲述了一个钢琴天才传奇的一生。', '/static/upload/movie/2020-3-10/p2574551676.jpg', ' 意大利', '2019-11-15(中国大陆);1998-10-28(意大利)', 7.8, '2020-03-08 21:26:00.673649', '2020-03-08 21:26:00.673649');
INSERT INTO `movie` VALUES ('1292052', '肖申克的救赎', '　　20世纪40年代末，小有成就的青年银行家安迪（蒂姆·罗宾斯TimRobbins饰）因涉嫌杀害妻子及她的情人而锒铛入狱。在这座名为肖申克的监狱内，希望似乎虚无缥缈，终身监禁的惩罚无疑注定了安迪接下来灰暗绝望的人生。未过多久，安迪尝试接近囚犯中颇有声望的瑞德（摩根·弗里曼MorganFreeman饰），请求对方帮自己搞来小锤子。以此为契机，二人逐渐熟稔，安迪也仿佛在鱼龙混杂、罪恶横生、黑白混淆的牢狱中找到属于自己的求生之道。他利用自身的专业知识，帮助监狱管理层逃税、洗黑钱，同时凭借与瑞德的交往在犯人中间也渐渐受到礼遇。表面看来，他已如瑞德那样对那堵高墙从憎恨转变为处之泰然，但是对自由的渴望仍促使他朝着心中的希望和目标前进。而关于其罪行的真相，似乎更使这一切朝前推进了一步……', '/static/upload/movie/2020-3-10/p480747492.jpg', ' 美国', '1994-09-10(多伦多电影节);1994-10-14(美国)', 8.1, '2020-03-08 21:25:10.207540', '2020-03-08 21:25:10.207540');
INSERT INTO `movie` VALUES ('1292063', '美丽人生', '　　犹太青年圭多（罗伯托·贝尼尼）邂逅美丽的女教师多拉（尼可莱塔·布拉斯基），他彬彬有礼的向多拉鞠躬：“早安！公主！”。历经诸多令人啼笑皆非的周折后，天遂人愿，两人幸福美满的生活在一起。', '/static/upload/movie/2020-3-10/p2578474613.jpg', ' 意大利', '2020-01-03(中国大陆);1997-12-20(意大利)', 3.8, '2020-03-08 21:26:51.312825', '2020-03-08 21:26:51.312825');
INSERT INTO `movie` VALUES ('1292064', '楚门的世界', '　　楚门（金•凯瑞JimCarrey饰）是一个平凡得不能再平凡的人，除了一些有些稀奇的经历之外——初恋女友突然失踪、溺水身亡的父亲忽然似乎又出现在眼前，他和绝大多数30多岁的美国男人绝无异样。这令他倍感失落。他也曾试过离开自己生活了多年的地方，但总因种种理由而不能成行。', '/static/upload/movie/2020-3-10/p479682972.jpg', ' 美国', '1998-06-05(美国)', 3.8, '2020-03-08 21:26:24.259515', '2020-03-08 21:26:24.259515');
INSERT INTO `movie` VALUES ('1292213', '大话西游之大圣娶亲', '　　至尊宝（周星驰饰）被月光宝盒带回到五百年前，遇见紫霞仙子（朱茵饰），被对方打上烙印成为对方的人，并发觉自己已变成孙悟空。', '/static/upload/movie/2020-3-10/p2455050536.jpg', ' 中国香港 / 中国大陆', '1995-02-04(中国香港);2014-10-24(中国大陆);2017-04-13(中国大陆重映)', 4.2, '2020-03-08 21:28:52.275516', '2020-03-08 21:28:52.275516');
INSERT INTO `movie` VALUES ('1292220', '情书', '　　日本神户某个飘雪的冬日，渡边博子（中山美穗）在前未婚夫藤井树的三周年祭日上又一次悲痛到不能自已。正因为无法抑制住对已逝恋人的思念，渡边博子在其中学同学录里发现“藤井树”在小樽市读书时的地址时，依循着寄发了一封本以为是发往天国的情书。', '/static/upload/movie/2020-3-10/p449897379.jpg', ' 日本', '1999-03(中国大陆);1995-03-25(日本)', 7.5, '2020-03-08 21:28:52.045959', '2020-03-08 21:28:52.045959');
INSERT INTO `movie` VALUES ('1292286', '我的野蛮女友', '　　牵牛（车太贤饰）第一次与她（全智贤饰）邂逅，就毫无浪漫感可言。在地铁上她就语出惊人，喝的醉醺醺的她大声训斥不自觉给老人让座的人，吐完之后就软趴趴地倒了下来。善良的牵牛上前接住，于是就只好背着她到旅馆投宿了。但是好心不一定有好报，牵牛正在好好洗澡时就被冲进来的警察带走了。', '/static/upload/movie/2020-3-10/p489336497.jpg', ' 韩国', '2001-07-27', 5.6, '2020-03-08 21:28:49.629857', '2020-03-08 21:28:49.629857');
INSERT INTO `movie` VALUES ('1292337', '无人知晓', '　　新搬来的公寓这家人是母亲惠子（You饰）带着四个孩子：明（柳乐优弥饰）、京子、茂、雪。但母亲却得对周围的人们撒谎说丈夫去海外工作，自己与长子两个人在一起生活。事实是其它三名弟妹是“黑孩子”，因为四个孩子有着各自不同的父亲。他们一直呆在家中，没有去学校上学。', '/static/upload/movie/2020-3-10/p661160053.jpg', ' 日本', '2004-05-13(戛纳电影节);2004-08-07(日本)', 1, '2020-03-08 21:28:46.206014', '2020-03-08 21:28:46.206014');
INSERT INTO `movie` VALUES ('1292370', '剪刀手爱德华', '　　爱德华（约翰尼•戴普饰）是一个机器人，他拥有人的心智，却有一双剪刀手，孤独地生活在古堡里，闯入古堡的化妆品推销员佩格把他带回家，让他走进了人类的世界。单纯的爱德华爱上了佩格的女儿金（薇诺娜•瑞德饰），金也慢慢的被爱德华的善良所吸引。', '/static/upload/movie/2020-3-10/p480956937.jpg', ' 美国', '1990-12-06(美国)', 6.8, '2020-03-08 21:27:48.475125', '2020-03-08 21:27:48.475125');
INSERT INTO `movie` VALUES ('1292402', '西西里的美丽传说', '　　当我还只是十三岁时，1941年春末的那一天，我初次见到了她那一天，墨索里尼向英法宣战，而我，得到了生命里的第一辆脚踏车。', '/static/upload/movie/2020-3-10/p2441988159.jpg', ' 意大利 / 美国', '2000-10-27(意大利)', 3.3, '2020-03-08 21:28:35.835231', '2020-03-08 21:28:35.835231');
INSERT INTO `movie` VALUES ('1292720', '阿甘正传', '　　阿甘（汤姆·汉克斯饰）于二战结束后不久出生在美国南方阿拉巴马州一个闭塞的小镇，他先天弱智，智商只有75，然而他的妈妈是一个性格坚强的女性，她常常鼓励阿甘“傻人有傻福”，要他自强不息。', '/static/upload/movie/2020-3-10/p1484728154.jpg', ' 美国', '1994-06-23(洛杉矶首映);1994-07-06(美国)', 9.5, '2020-03-08 21:25:30.649718', '2020-03-08 21:25:30.649718');
INSERT INTO `movie` VALUES ('1292722', '泰坦尼克号', '　　1912年4月10日，号称“世界工业史上的奇迹”的豪华客轮泰坦尼克号开始了自己的处女航，从英国的南安普顿出发驶往美国纽约。富家少女罗丝（凯特•温丝莱特）与母亲及未婚夫卡尔坐上了头等舱；另一边，放荡不羁的少年画家杰克（莱昂纳多·迪卡普里奥）也在码头的一场赌博中赢得了下等舱的船票。', '/static/upload/movie/2020-3-10/p457760035.jpg', ' 美国', '1998-04-03(中国大陆);1997-11-01(东京电影节);1997-12-19(美国)', 7.3, '2020-03-08 21:25:30.358046', '2020-03-08 21:25:30.358046');
INSERT INTO `movie` VALUES ('1292963', '船长二世', '　　船长老比尔已多年未见自己的儿子了，可当儿子终于大学毕业出现在老比尔面前时，他矮小的身材却不禁让万分期待的老比尔颇感失望。与此同时，小比尔的女友也回乡拜访父亲，没想到却是老比尔的死对头金船长。两人的感情面临危机。一天，一场飓风突如其来，更让港口险象环生。', '/static/upload/movie/2020-3-10/p2454820922.jpg', ' 美国', '1928-05-12(美国)', 3.2, '2020-03-08 21:28:46.905749', '2020-03-08 21:28:46.905749');
INSERT INTO `movie` VALUES ('1293318', '萤火虫之墓', '　　美日战争爆发，14岁的清太带着年幼的妹妹到处逃命，当他们到达防空洞的时候，母亲已身受重伤，没过多久便不久人世。两兄妹自此过着相依为命的日子。他们只好投靠了母亲的姐妹，纵使他们把家里所有的家当都送给了阿姨，但当食物吃完，他们就越感到了寄人篱下的感觉，清太决定带着妹妹离开独自生活。火灾硝烟中的生活并不好过，清太为了妹妹四处偷取食物，但妹妹还是严重营养不良……', '/static/upload/movie/2020-3-10/p1157334208.jpg', ' 日本', '1988-04-16(日本)', 6.3, '2020-03-08 21:28:46.433742', '2020-03-08 21:28:46.433742');
INSERT INTO `movie` VALUES ('1293359', '菊次郎的夏天', '　　暑假到来，自幼丧父的小学三年级学生正男（关口雄介饰），如今和奶奶生活在一起，暑假特别无聊。他拿出母亲从外地寄回的信，准备自己一个人去爱知县丰桥市看望母亲。', '/static/upload/movie/2020-3-10/p751835224.jpg', ' 日本', '1999-05-20(戛纳电影节);1999-06-05(日本)', 2.9, '2020-03-08 21:28:50.301745', '2020-03-08 21:28:50.301745');
INSERT INTO `movie` VALUES ('1293839', '罗马假日', '　　欧洲某国的安妮公主（奥黛丽·赫本AudreyHepburn饰）到访罗马，国务烦身，但她又厌倦繁文缛节。一天晚上，身心俱疲的她偷偷来到民间欣赏夜景，巧遇报社记者乔（格里高利·派克GregoryPeck饰）。二人把手同游，相当快乐。公主更是到乔的家中作客并在那过夜。', '/static/upload/movie/2020-3-10/p2189265085.jpg', ' 美国', '1953-08-20(威尼斯电影节);1953-09-02(美国)', 3.2, '2020-03-08 21:28:20.389943', '2020-03-08 21:28:20.389943');
INSERT INTO `movie` VALUES ('1293942', '与墨索里尼喝茶', '　　二战期间，一群不同文化背景的妇女每天都要到英国驻意大利使馆同大使夫人喝茶，本片讲的就是她们的故事。', '/static/upload/movie/2020-3-10/p2404525608.jpg', ' 意大利 / 英国', '1999-03-26', 6.1, '2020-03-08 21:27:43.292698', '2020-03-08 21:27:43.292698');
INSERT INTO `movie` VALUES ('1295038', '哈利·波特与魔法石', '　　哈利波特是一个孤儿，从小寄养在姨妈家，受尽欺凌。但就在哈利11岁生日的时候，他意外收到了霍格沃茨学院的入学通知书。哈利从该学院派来接他的巨人海格口中得知，这是一间魔法学院，并得知了自己的身世，原来哈利的父母都是伟大的魔法师，在对付伏地魔的战斗中双双献身，唯有哈利幸免于难。', '/static/upload/movie/2020-3-10/p804947166.jpg', ' 美国 / 英国', '2002-01-26(中国大陆);2001-11-04(英国首映);2001-11-16(美国)', 3.6, '2020-03-08 21:27:14.264899', '2020-03-08 21:27:14.264899');
INSERT INTO `movie` VALUES ('1295124', '辛德勒的名单', '　　1939年，波兰在纳粹德国的统治下，党卫军对犹太人进行了隔离统治。德国商人奥斯卡·辛德勒（连姆·尼森LiamNeeson饰）来到德军统治下的克拉科夫，开设了一间搪瓷厂，生产军需用品。凭着出众的社交能力和大量的金钱，辛德勒和德军建立了良好的关系，他的工厂雇用犹太人工作，大发战争财。', '/static/upload/movie/2020-3-10/p492406163.jpg', ' 美国', '1993-11-30(华盛顿首映);1994-02-04(美国)', 7, '2020-03-08 21:27:27.968720', '2020-03-08 21:27:27.968720');
INSERT INTO `movie` VALUES ('1295644', '这个杀手不太冷', '　　里昂（让·雷诺饰）是名孤独的职业杀手，受人雇佣。一天，邻居家小姑娘马蒂尔达（纳塔丽·波特曼饰)敲开他的房门，要求在他那里暂避杀身之祸。原来邻居家的主人是警方缉毒组的眼线，只因贪污了一小包毒品而遭恶警（加里·奥德曼饰）杀害全家的惩罚。马蒂尔达得到里昂的留救，幸免于难，并留在里昂那里。里昂教小女孩使枪，她教里昂法文，两人关系日趋亲密，相处融洽。', '/static/upload/movie/2020-3-10/p511118051.jpg', ' 法国', '1994-09-14(法国)', 4.4, '2020-03-08 21:25:15.992412', '2020-03-08 21:25:15.992412');
INSERT INTO `movie` VALUES ('1295897', '直到世界尽头', '　　1999年世纪末，一颗印度的核子卫星即将坠地，地球上一片恐慌，视之为世界末日的到临。住在巴黎的女子克蕾儿（SolveigDommartin饰）在一次离开男友尤金（SamNeill饰）的浪游中，认识疑为工业间谍的崔佛（WilliamHurt饰），并且深深为之着迷。一次车祸意外中，克蕾儿认识二名抢匪，受托运送大批赃款，克蕾儿开始出发去寻找迷一样的人物崔佛。他们的足迹遍布四大洲：从尼斯、巴黎、柏林、里斯本、莫斯科、北京、东京、追逐到旧金山、雪梨，最后到达澳洲中部荒芜的库柏培地原住民生活区。过程中，克蕾儿终于知道崔佛的本名是山姆法柏。他不是工业间谍，而是一位科学家的儿子。许多私家侦探追逐他的原因是老法柏（MaxvonSydow饰）制造了一个可以让盲人看见的摄影机。为的是要让山姆目盲的母亲（JeanneMoreau饰）可以看见她的亲人。就在一群人...', '/static/upload/movie/2020-3-10/p2282549699.jpg', ' 德国 / 法国 / 澳大利亚', '1991-09-12', 1.2, '2020-03-08 21:26:00.708066', '2020-03-08 21:26:00.708066');
INSERT INTO `movie` VALUES ('1297052', '侧耳倾听', '　　正在读初三的月岛雯是一个喜欢看书的女孩，她每次都能在借书卡上看到一个叫天泽圣司名字，因此她对这个人充满了好奇。雯一直喜欢写诗，有一天她跟好友夕子在讨论写诗的事，夕子告诉雯自己收到了情书，但事实上夕子已有了喜欢的人。更没有想到的是，夕子喜欢的杉村喜欢的是雯，雯一时间感到十分困惑。雯无意中来到了一个小店，原来店主是圣司的爷爷。认识了圣司之后，听到了圣司对自己理想的追求之后，也激发了雯对自己理想的追求之念。当圣司离开了到意大利学习做小提琴时，雯决定要专心写作。当雯完成了作品之后，她发现原来自己高估了自己，就这样她选择继续考高中，这时她非常想念圣司。一天凌晨，她站到窗边，突然看到了一个熟悉的身影……', '/static/upload/movie/2020-3-10/p456692072.jpg', ' 日本', '1995-07-15(日本)', 4.2, '2020-03-08 21:28:47.847612', '2020-03-08 21:28:47.847612');
INSERT INTO `movie` VALUES ('1297359', '幽灵公主', '　　为了拯救危难中的村民，阿斯达卡的右手中了凶煞神的诅咒。达卡只好离开亲人往西方流浪以寻找解除诅咒的方法。旅途中他遇到了由幻姬大人带领的穷苦村民在麒麟兽的森林里开采铁矿，提炼矿石。白狼神莫娜和她养大的人类女孩“幽灵公主”桑对幻姬恨之入骨，因为她们觉得幻姬带领众人破坏了森林。想帮助人类的阿斯达卡被桑深深吸引，他理解她，但为了帮助穷人又不得不和她作战。一次战斗中，阿斯达卡被麒麟兽所救，他的立场更加摇摆不定。这时，以疙瘩和尚为首的一群人来杀麒麟兽，幻姬以火枪击毙了麒麟，麒麟的头被疙瘩和尚抢走。愤怒的麒麟的灵魂为夺回自己的头，大肆破坏着森林。阿斯达卡和桑联手决定帮麒麟夺回头颅。', '/static/upload/movie/2020-3-10/p1613191025.jpg', ' 日本', '1997-07-12(日本)', 8.9, '2020-03-08 21:28:51.195178', '2020-03-08 21:28:51.195178');
INSERT INTO `movie` VALUES ('1297447', '倩女幽魂', '　　书生宁采臣（张国荣饰）收账不成，无处可归，遂夜宿鬼寺兰若寺，遇上侠士燕赤霞（午马饰），二人成为邻居。一日偶遇艳女小倩（王祖贤饰），二人两情相悦，但小倩乃是被树妖姥姥控制的鬼魂，专门迷惑精壮男子代姥姥吸取阳气。小倩见宁采臣心地善良不忍加害，并与他感情逐渐加深。宁采臣欲救小倩脱离姥姥魔掌，但苦于姥姥功力深厚，小倩无法脱离其魔掌。二人遂向燕赤霞求救......', '/static/upload/movie/2020-3-10/p2414157745.jpg', ' 中国香港', '1987-07-18(中国香港);2011-04-30(中国大陆)', 9.3, '2020-03-08 21:28:41.261342', '2020-03-08 21:28:41.261342');
INSERT INTO `movie` VALUES ('1298070', '加勒比海盗', '　　故事发生在17世纪，传说中海盗最为活跃的加勒比海。风趣迷人的杰克·斯伯洛（约翰尼·德普JohnnyDepp饰），是活跃在加勒比海上的海盗，拥有属于自己的“黑珍珠”号海盗船。对他来说，最惬意的生活就是驾驶着“黑珍珠”号在加勒比海上游荡，自由自在的打劫过往船只。但不幸的是，他的仇敌，老谋深算的巴尔巴罗萨船长(杰弗里·拉什GeoffreyRush饰)偷走了他的“黑珍珠”号。巴伯萨是一个无恶不作的坏蛋，他抢劫了杰克的\"黑珍珠号\"后，更加猖狂，在加勒比海上横行霸道，一时成为整个加勒比海的霸主。', '/static/upload/movie/2020-3-10/p1596085504.jpg', ' 美国', '2003-11-21(中国大陆);2003-07-09(美国)', 1, '2020-03-08 21:28:17.424007', '2020-03-08 21:28:17.424007');
INSERT INTO `movie` VALUES ('1299257', '战火', '　　本片以第二次世界大战末期，在意大利登陆的美军攻破德军防线为背景，导演以令人感动的场面把美军从南部攻到北部期间所引发的一些意大利民间故事编成一部有连贯性的社会写实的电影，画面上的真实感，给予人们非常大的冲击，创下了意大利电影的新潮流……', '/static/upload/movie/2020-3-10/p2187325162.jpg', ' 意大利', '1946-12-10(意大利)', 5.8, '2020-03-08 21:28:39.817322', '2020-03-08 21:28:39.817322');
INSERT INTO `movie` VALUES ('1299398', '大话西游之月光宝盒', '　　孙悟空（周星驰）护送唐三藏（罗家英）去西天取经路上，与牛魔王合谋欲杀害唐三藏，并偷走了月光宝盒，此举使观音萌生将其铲除心思，经唐三藏请求，孙悟空被判五百年后重新投胎做人赎其罪孽。', '/static/upload/movie/2020-3-10/p2561721372.jpg', ' 中国香港 / 中国大陆', '1995-01-21(中国香港);2014-10-24(中国大陆)', 2.4, '2020-03-08 21:28:50.524716', '2020-03-08 21:28:50.524716');
INSERT INTO `movie` VALUES ('1300299', '杀人回忆', '　　1986年，韩国京畿道华城郡，热得发昏的夏天，在田野边发现一具女尸，早已发臭。小镇警察朴探员（宋康昊饰）和汉城来的苏探员（金相庆饰）接手案件，唯一可证实的是这具女尸生前被强奸过。线索的严重缺乏让毫无经验的朴探员和搭档曹探员（金罗河饰）只凭粗暴逼供和第六感推断，几次将犯罪嫌疑人屈打成招。而苏探员客观冷静，据理分析，几次排除嫌疑，警察内部为了证明与推翻矛盾不断，然而无辜女子还是接二连三被残忍杀害，他们只好达成共识一起合作。此时，一个极其符合作案特征的小青年（朴海日饰）成为最大嫌疑人，警方神经绷紧地锁定住他，同时DNA检测报告也被送往美国，然而案件并未在此处停止。', '/static/upload/movie/2020-3-10/p2326071698.jpg', ' 韩国', '2003-05-02(韩国)', 2.7, '2020-03-08 21:26:14.773052', '2020-03-08 21:26:14.773052');
INSERT INTO `movie` VALUES ('1301866', '土地与自由', '　　1939年，失业的英国青年大卫，如同许多来自世界各地的社会主义青年，一起加入一国际组织游击队，为争取民主自由而投入西班牙内战，对抗佛朗哥的独裁暴政。大卫因负伤来到巴塞隆纳，战时血泊中悲惨呼喊的声音，成了他挥之不去的恶梦呓语。他发现自己摇摆于对社会主义的忠诚与新认识的爱人之间，心中的改革梦想却不因远离战场而稍减，最后选择回到前线战友身旁……', '/static/upload/movie/2020-3-10/p2460477834.jpg', ' 德国 / 意大利 / 西班牙 / 英国', '1995-04-07', 1.1, '2020-03-08 21:28:23.754072', '2020-03-08 21:28:23.754072');
INSERT INTO `movie` VALUES ('1302425', '喜剧之王', '　　尹天仇（周星驰饰）一直醉心戏剧，想成为一名演员，平时除了做跑龙套以外，还会在街坊福利会里开设演员训练班。此时舞小姐柳飘飘在妈妈桑的带领下来到这里要求学做戏，原来柳飘飘有一段非常不愉快的经历，在尹天仇对她指导的过程中，柳飘飘对尹天仇渐生情愫，同时她也成为了夜总会里当红的小姐。尹天仇受到了极多白眼之后，终于得到了大明星鹃姐（莫文蔚饰）的赏识，提携他担演新戏中的男主角，但没想到突然把他的角色换掉了，令他失望不已。在片场当场务的卧底警员（吴孟达饰）身份被识穿，尹天仇阴差阳错的帮忙破了案。之后尹天仇继续活跃在街坊福利会的演员训练班里。', '/static/upload/movie/2020-3-10/p2579932167.jpg', ' 中国香港', '1999-02-13(中国香港)', 9.3, '2020-03-08 21:28:46.549154', '2020-03-08 21:28:46.549154');
INSERT INTO `movie` VALUES ('1303533', '船续前行', '　　第一次世界大战爆发前夕，一群欧洲的贵族和艺术家为了护送刚逝世知名歌剧女伶的骨灰回到她出生的小岛，展开了一次航行。不料在途中遇到大战爆发，船上涌进一批难民，在封闭的空间中形成了鲜明的阶级对比。费里尼化身为弗莱迪．琼斯饰演的热心记者，为观众介绍船上形形色色的人生百态，其中犹有些锐利的人性观察，暴露了艺术家伪善的面孔。', '/static/upload/movie/2020-3-10/p2205142402.jpg', ' 意大利 / 法国', '1983-10-07(意大利)', 5.1, '2020-03-08 21:28:38.675452', '2020-03-08 21:28:38.675452');
INSERT INTO `movie` VALUES ('1303553', '仆人', '　　刚刚搬到伦敦的托尼（詹姆斯·福克斯JamesFox饰）雇佣了名为巴雷特（德克·博加德DirkBogarde饰）的男子作为家中的仆人，将家里上下大大小小的一切事物交给他打理，聪明肯干的巴雷特没有让托尼失望，很快便获得了主人的信任。', '/static/upload/movie/2020-3-10/p2197045856.jpg', ' 英国', '1963-09', 1.9, '2020-03-08 21:28:30.561940', '2020-03-08 21:28:30.561940');
INSERT INTO `movie` VALUES ('1304073', '假如爱有天意', '　　2003年的大学生梓希（孙艺珍饰）一天收拾房间，无意中发现一个神秘的箱子，里面满载着母亲珠喜（孙艺珍饰）留下的情书，在阅读中她重温着母亲的初恋回忆。1968年的珠喜，是一个清纯可爱的少女，与穷学生俊河（曹承佑饰）一见钟情，由于珠喜显赫的家世，令两人的恋爱陷入俗套的门不当户不对的痛苦纠结中。2003年的梓希爱情同样坎坷，她暗恋着戏剧学会的尚民（赵寅成饰），却一直难以表白自己的爱意。', '/static/upload/movie/2020-3-10/p479746811.jpg', ' 韩国', '2003-01-30', 5.3, '2020-03-08 21:27:05.937245', '2020-03-08 21:27:05.937245');
INSERT INTO `movie` VALUES ('1306249', '唐伯虎点秋香', '　　唐伯虎（周星驰饰）身为江南四大才子之首，却有道不尽的心酸。宁王想唐伯虎帮忙图谋作反，唐伯虎只好用内功改变脉象，令众人都相信他命不久矣。母亲埋怨他不应该把功夫暴露，因为他们家族一直被当年的仇人追杀。唐伯虎在与朋友出游时，遇到了貌若天仙的秋香并对她一见钟情，决心要到华府当家丁以追求秋香，唐伯虎被取名华安。期间华太师遇到了宁王上门刁难，幸好有唐伯虎出面相助，并暴露了自己是唐伯虎的身份。秋香才知道华安是自己欣赏的唐伯虎。华夫人跟唐家有怨，因此二人便开始斗法。怎料宁王跟夺面书生再次上门，华夫人不是对手，幸得唐伯虎出手，华夫人也答应把秋香许配给唐伯虎。', '/static/upload/movie/2020-3-10/p1946455272.jpg', ' 中国香港', '1993-07-01(中国香港)', 4.7, '2020-03-08 21:28:49.532854', '2020-03-08 21:28:49.532854');
INSERT INTO `movie` VALUES ('1307811', '魔女宅急便', '　　琪琪今年13岁了，按照魔法界的规矩，魔法少女年满13岁就要出外进行为期一年的修行。所以琪琪带着宠物黑猫吉吉踏上了修行之旅。然而，修行之旅开始得并不顺利，当琪琪来到海边一座大城市时，人们并没有欢迎她的到来，人人都不搭理她。幸亏琪琪有一颗善良的心，当她拾到了一件别人的失物时，热心的琪琪找到了失主。她的善良赢得了面包店老板娘的好感，琪琪就在面包店开始了她用飞行魔法为客人服务的快递业务。琪琪很快适应了新环境，一次，一个热衷于飞机制造的男孩邀请琪琪去参加飞行俱乐部的聚会，途中琪琪因为帮一位老大娘送东西而被雨淋了。从此，琪琪突然发现自己的魔法正在一天天变弱。', '/static/upload/movie/2020-3-10/p456676352.jpg', ' 日本', '1989-07-29(日本)', 8.7, '2020-03-08 21:28:51.306417', '2020-03-08 21:28:51.306417');
INSERT INTO `movie` VALUES ('1307914', '无间道', '　　1991年，香港黑帮三合会会员刘健明（刘德华）听从老大韩琛（曾志伟）的吩咐，加入警察部队成为黑帮卧底，韩琛许诺刘健明会帮其在七年后晋升为见习督察。1992年，警察训练学校优秀学员陈永仁（梁朝伟）被上级要求深入到三合会做卧底，终极目标是成为韩琛身边的红人。2002年，两人都不负重望，也都身背重压，刘健明渐想成为一个真正的好人，陈永仁则盼着尽快回归警察身份。', '/static/upload/movie/2020-3-10/p2564556863.jpg', ' 中国香港', '2002-12-12(中国香港);2003-09-05(中国大陆)', 8.4, '2020-03-08 21:28:48.800065', '2020-03-08 21:28:48.800065');
INSERT INTO `movie` VALUES ('1308092', '三心两性', '　　胜裕与直也是一对同性恋的恋人。一天，一位名叫朝子的女子闯进他们的生活，朝子想要一个孩子，并希望与胜裕与直也和她一起组织一个家。直也反对这个提议，对于胜裕隐瞒自己是同性恋者一事感到很愤怒。就在这时，胜裕的哥哥与嫂嫂前来，他们极力反对胜裕与朝子的决定。直也、胜裕、朝子，开始思索家庭的真正意义，并朝着自己的生活方式去追求……', '/static/upload/movie/2020-3-10/p1984360362.jpg', ' 日本', '2001-05(戛纳电影节);2002-04-27(日本)', 7.4, '2020-03-08 21:27:58.220405', '2020-03-08 21:27:58.220405');
INSERT INTO `movie` VALUES ('1308804', '我脑中的橡皮擦', '　　秀真（孙艺珍饰）是一个富家女，跟男友出走却被抛弃，在便利店内与在建筑公司当工人的哲洙（郑宇成饰）相遇。未来的日子里，他们一次又一次相遇，最终彼此相爱了。', '/static/upload/movie/2020-3-10/p465680286.jpg', ' 韩国', '2004-11-05(韩国)', 6.5, '2020-03-08 21:27:43.330818', '2020-03-08 21:27:43.330818');
INSERT INTO `movie` VALUES ('1308807', '哈尔的移动城堡', '　　继母因无力负担生活，将苏菲和她的两个妹妹都送到了制帽店去当学徒。两个妹妹很快先后就离开了制帽店去追寻各自的梦想，只有苏菲坚持了下来。一天，小镇旁边来了一座移动堡垒，传说堡垒的主人哈尔专吸取年青姑娘的灵魂，所以小镇的姑娘都不敢靠近。', '/static/upload/movie/2020-3-10/p2174346180.jpg', ' 日本', '2004-09-05(威尼斯电影节);2004-11-20(日本)', 7, '2020-03-08 21:28:52.003062', '2020-03-08 21:28:52.003062');
INSERT INTO `movie` VALUES ('1308865', '老男孩', '　　女儿生日那天，中年男子吴大修（崔岷植饰）在醉酒回家路上，突遭不明身份的人绑架失踪。就此，他毫无理由地被囚禁在一个神秘的私人监狱中。寻死未果的吴大修，每天看电视，三餐吃煎饺。通过电视，他得知妻子已遭杀害，女儿下落不明，自己更被怀疑为凶手。就此，吴大修开始锻炼身体，决心复仇，并在牢中度过漫长的15年。', '/static/upload/movie/2020-3-10/p2166892850.jpg', ' 韩国', '2003-11-21(韩国)', 6.1, '2020-03-08 21:27:52.042312', '2020-03-08 21:27:52.042312');
INSERT INTO `movie` VALUES ('1309046', 'V字仇杀队', '　　未来的英国社会处于极权统治的高压下，不能容许同性恋者、异教徒等社会角色的存在，人民在黑暗政权下苟延残喘。', '/static/upload/movie/2020-3-10/p1465235231.jpg', ' 美国 / 英国 / 德国', '2005-12-11(BNAT电影节);2006-03-17(美国)', 7.3, '2020-03-08 21:28:27.644176', '2020-03-08 21:28:27.644176');
INSERT INTO `movie` VALUES ('1395091', '未麻的部屋', '　　当红三人少女偶像团体CharmingBird面临解散，核心成员雾越未麻在事务所的安排下不得不退出团体，转型成为一名电视剧演员。万事开头难，对于偶像歌手转型而来的未麻尤其如此，她在工作中承受着压力，闷闷不乐。与此同时，各种恐吓信不断、经纪人田所先生遇袭以及以自己的口吻在网站上写日记的神秘人都让未麻焦虑不已，恍惚间她甚至看到另一个自己。', '/static/upload/movie/2020-3-10/p1351050722.jpg', ' 日本', '1997-07(加拿大奇幻电影节);1998-02-28(日本)', 8.7, '2020-03-08 21:28:43.665607', '2020-03-08 21:28:43.665607');
INSERT INTO `movie` VALUES ('1401240', '搬家', '　　与父母一起生活的莲克一直是一个幸福快乐的女孩，但这种幸福的日子开始出现了裂痕。妈妈和爸爸互相伤害对方，不断的争吵，最终决定要分手。自从来了转学生，她的学校生活也有了变化，周围的一切使她无法承受。随着熟悉亲切的一切发生了变化，少女的内心世界也开始有了改变。', '/static/upload/movie/2020-3-10/p1867099944.jpg', ' 日本', '1993-03-20(日本)', 3.3, '2020-03-08 21:28:30.494902', '2020-03-08 21:28:30.494902');
INSERT INTO `movie` VALUES ('1417250', '恶魔的孩子', '　　一对随时在逃跑的兄妹，哥哥机智灵敏，妹妹患有心智方面的疾病。他们不停地从孤儿院，儿童医院，监狱等等一些福利机构中出逃。因为所有的人要把哥哥和妹妹分开，这是哥哥不能忍受的。当他们的妈妈来到孤儿院，哥哥以为他们终于可以回家了，而妈妈却告诉哥哥这个不是他的妹妹。哥哥彻底的崩溃了，带着妹妹疯狂地逃出孤儿院。从此，两个人开始了一段灰暗艰难的生活……', '/static/upload/movie/2020-3-10/p846673167.jpg', ' 法国 / 西班牙', '2002-09-11(法国)', 5.7, '2020-03-08 21:28:42.581282', '2020-03-08 21:28:42.581282');
INSERT INTO `movie` VALUES ('1422193', '穿制服的女孩', '　　该片位列“最伟大的一百部德国电影”第44位，为世界首部女同性恋电影。故事背景是一所女校，里面的学生都是军官的女儿，恋情发生在学生玛努薇拉和冯•伯恩伯格夫人之间。玛努薇拉刚刚死了母亲，她像所有的同学一样崇拜女教师伯恩伯格，因为后者是所有教师中唯一不相信棍棒教育的人。但不久她们彼此便感到异样的吸引，虽然老师不愿承认这一点。一次，在学校的戏剧节上，玛努薇拉领衔主演了席勒的《唐•卡洛斯》并大获成功。在其后的庆祝会上，当所有的女孩都喝得有点醉时，玛努薇拉向老师表白了她的爱情。但是不巧校长听到了炽烈的尾声，遂把玛努薇拉送进了医务室。但玛努薇拉却在校长和伯恩伯格夫人谈话时，从医务室逃出来，爬到了学校楼梯井顶端，打算跳下去……', '/static/upload/movie/2020-3-10/p2510886844.jpg', ' 德国', '1931-11-27', 2.6, '2020-03-08 21:28:42.672324', '2020-03-08 21:28:42.672324');
INSERT INTO `movie` VALUES ('1432146', '钢铁侠', '　　斯塔克军火公司是美军在全球范围内第一大军火供应商，其新任掌门人托尼•斯塔克（小罗伯特·唐尼RobertDowneyJr.饰）风流倜傥，天资聪颖。他与公司元老俄巴迪亚•斯坦（杰夫·布里吉斯JeffBridges饰）合作无间，共同将斯塔克公司的业务推向顶峰。现实生活中的托尼热衷收集名贵跑车，搞点儿发明创造，当然露水姻缘更不可少。所幸他身边有维吉尼亚•波茨（格温妮斯·帕特洛GwynethPaltrow饰）这样的好助手细心打理一切，才让他能自由自在过着贵公子的生活。', '/static/upload/movie/2020-3-10/p725871968.jpg', ' 美国', '2008-04-30(中国大陆);2008-04-14(悉尼首映);2008-05-02(美国)', 5, '2020-03-08 21:27:38.565529', '2020-03-08 21:27:38.565529');
INSERT INTO `movie` VALUES ('1433360', '雏菊', '　　阿姆斯特丹，两个男人爱上了同一个女人，注定了一段纠缠的故事。惠瑛（全智贤饰）是画家，每天到广场帮路人画肖像，而像她一样风雨不改的，还有某人送来的一盘雏菊。每天雏菊总是准时送到，让她心里悸动而好奇。', '/static/upload/movie/2020-3-10/p2200540002.jpg', ' 韩国 / 中国香港', '2006-04-30(中国大陆);2006-03-09(韩国)', 4.2, '2020-03-08 21:28:23.918824', '2020-03-08 21:28:23.918824');
INSERT INTO `movie` VALUES ('1479945', '寻爱之旅', '　　熱愛射飛鏢的柯林看店為業，為了贏回紅杏出牆的妻子芳心，他跳脫常軌，離開熟悉的故鄉，橫越全國。當他經過美麗的高山地區，來到碎石嶙嶙的黑池時，連著遇到一些人和事，改變了他的新生活。是一部好笑又非常人性的影片。', '/static/upload/movie/2020-3-10/p2511849901.jpg', ' 英国 / 美国', '2003-04-27', 1.8, '2020-03-08 21:27:28.006604', '2020-03-08 21:27:28.006604');
INSERT INTO `movie` VALUES ('1652587', '阿凡达', '　　战斗中负伤而下身瘫痪的前海军战士杰克•萨利（萨姆•沃辛顿SamWorthington饰）决定替死去的同胞哥哥来到潘多拉星操纵格蕾丝博士（西格妮•韦弗SigourneyWeaver饰）用人类基因与当地纳美部族基因结合创造出的“阿凡达”混血生物。杰克的目的是打入纳美部落，外交说服他们自愿离开世代居住的家园，从而SecFor公司可砍伐殆尽该地区的原始森林，开采地下昂贵的“不可得”矿。在探索潘多拉星的过程中，杰克遇到了纳美部落的公主娜蒂瑞（佐伊•索尔达娜ZoeSaldana饰），向她学习了纳美人的生存技能与对待自然的态度。与此同时，SecFor公司的经理和军方代表上校迈尔斯（史蒂芬•朗StephenLang饰）逐渐丧失耐心，决定诉诸武力驱赶纳美人……', '/static/upload/movie/2020-3-10/p2180085848.jpg', ' 美国 / 英国', '2010-01-04(中国大陆);2009-12-18(美国)', 3.9, '2020-03-08 21:26:42.149814', '2020-03-08 21:26:42.149814');
INSERT INTO `movie` VALUES ('1758645', '等待戈多', '　　两个像瘪三一样的流浪汉自始自终在等待一个名叫戈多的人。他们穷愁潦倒，希望戈多的出现能使他们得救。然而戈多自始自终也没有出现。', '/static/upload/movie/2020-3-10/p2554162862.jpg', ' 爱尔兰', '2001-02-04(爱尔兰)', 4.1, '2020-03-08 21:28:20.420845', '2020-03-08 21:28:20.420845');
INSERT INTO `movie` VALUES ('1763134', '汉江怪物', '　　康斗（宋康昊饰）是一个平凡又有些糊涂的中年男人，他带着女儿玄舒（高雅成饰）与家人一起生活，在汉江边经营小店，过着安静祥和的生活。康斗父亲熙峰（边熙峰饰）是一个和蔼老人，弟弟南日（朴海日饰）是家里唯一的大学生，却失业没有工作。他时常牢骚并酗酒，对现实不满。妹妹南珠（裴斗娜饰）是个射箭运动员，却常在关键时刻掉链子。', '/static/upload/movie/2020-3-10/p2512336853.jpg', ' 韩国', '2006-07-27(韩国)', 5.9, '2020-03-08 21:28:48.016002', '2020-03-08 21:28:48.016002');
INSERT INTO `movie` VALUES ('1787291', '被嫌弃的松子的一生', '　　有一天父亲（香川照之饰）突然来找阿笙（瑛太饰），告诉他有个素未谋面的姑姑死了，叫他去收拾下姑姑的房子。在河边的破烂小屋里，阿笙渐渐开始了解父亲口中的姑姑，到底有着怎样的一生。', '/static/upload/movie/2020-3-10/p884763596.jpg', ' 日本', '2006-05-27(日本)', 3.7, '2020-03-08 21:28:51.408696', '2020-03-08 21:28:51.408696');
INSERT INTO `movie` VALUES ('1849031', '当幸福来敲门', '　　克里斯•加纳（威尔·史密斯WillSmith饰）用尽全部积蓄买下了高科技治疗仪，到处向医院推销，可是价格高昂，接受的人不多。就算他多努力都无法提供一个良好的生活环境给妻儿，妻子（桑迪·牛顿ThandieNewton饰）最终选择离开家。从此他带着儿子克里斯托夫（贾登·史密斯JadenSmith饰）相依为命。克里斯好不容易争取回来一个股票投资公司实习的机会，就算没有报酬，成功机会只有百分之五，他仍努力奋斗，儿子是他的力量。他看尽白眼，与儿子躲在地铁站里的公共厕所里，住在教堂的收容所里……他坚信，幸福明天就会来临。', '/static/upload/movie/2020-3-10/p1312700628.jpg', ' 美国', '2008-01-17(中国大陆);2006-12-15(美国)', 7.1, '2020-03-08 21:26:27.899608', '2020-03-08 21:26:27.899608');
INSERT INTO `movie` VALUES ('1851857', '蝙蝠侠：黑暗骑士', '　　从亲眼目睹父母被人杀死的阴影中走出来的“蝙蝠侠”，经历了成长之后，已经不再是那个桀骜不的孤单英雄了。在警官吉姆·戈登和检查官哈维·登特的通力帮助下，“蝙蝠侠”无后顾之忧地继续满世界的奔波，与日益增长起来的犯罪威胁做着永无休止的争斗，而他所在的高谭市，也是进展最为明显的地方，犯罪率以一种惊人的速度持续下降着，毕竟对方是能够上天入地的“蝙蝠侠”，不借两个胆子谁还敢造次呢？不过像高谭这种科技与污秽并存的城市，平静是不可能维持太久的，果不其然，新一轮的混乱很快就席卷了整个城市，人们再一被被恐慌所笼罩着，而声称愿意为这一切负责的，自然就是所有混乱的源头以及支配者--“小丑”了。', '/static/upload/movie/2020-3-10/p462657443.jpg', ' 美国 / 英国', '2008-07-14(纽约首映);2008-07-18(美国)', 6.9, '2020-03-08 21:28:07.103785', '2020-03-08 21:28:07.103785');
INSERT INTO `movie` VALUES ('1862151', '疯狂的石头', '　　重庆一间工艺品厂已经濒临倒闭，却不料在拆倒旧厂房的时候，发现了厕所里的一件宝物——一块价值连城的翡翠。厂里决定用这块翡翠举办一个展览，赚些钱发拖欠了几个月的工人工资。期间由工艺品厂保卫科长包世宏（郭涛饰）负责看守这件宝物。但是，国际大盗麦克与本地一帮小偷却让包世宏一筹莫展，他们各施其技接近翡翠，展览馆开始了一场明争暗斗的较量。黑色幽默也开始幕幕上演。翡翠的价值几何？最后谁是胜出者？事情远没有表面那么简单……', '/static/upload/movie/2020-3-10/p712241453.jpg', ' 中国大陆 / 中国香港', '2006-06-30(中国大陆);2006-08-10(中国香港)', 5.9, '2020-03-08 21:28:42.836135', '2020-03-08 21:28:42.836135');
INSERT INTO `movie` VALUES ('1865703', '红辣椒', '　　近未来，为了治疗现代人类越来越多、越来越严重的精神疾病，位于东京的精神医疗综合研究所开发出一种可以反映他人梦境的机器。通过微型DC的帮助，梦境在显示器上呈现出来，更方便找到一个人焦虑的症结。', '/static/upload/movie/2020-3-10/p672363704.jpg', ' 日本', '2006-09-02(威尼斯电影节);2006-11-25(日本)', 8.5, '2020-03-08 21:28:46.022437', '2020-03-08 21:28:46.022437');
INSERT INTO `movie` VALUES ('1866479', '复仇者联盟', '　　一股突如其来的强大邪恶势力对地球造成致命威胁，没有任何一个超级英雄能够单独抵挡。长期致力于保护全球安危的神盾局（SHIELD）感到措手不及，其指挥官“独眼侠”尼克·弗瑞（塞缪尔·杰克逊SamuelL.Jackson饰）意识到他必须创建一个“史上最强”的联盟组织，云集各方超级英雄一起发威，才能拯救世界于水深火热，抵御黑暗势力的侵袭。于是由六大超级英雄——“钢铁侠”（小罗伯特·唐尼RobertDowneyJr.饰）、“雷神”（克里斯·海姆斯沃斯ChrisHemsworth饰）、“美国队长”（克里斯·埃文斯ChrisEvans饰）、“绿巨人”（马克·鲁弗洛MarkRuffalo饰）、“黑寡妇”（斯嘉丽·约翰逊ScarlettJohansson饰）和“鹰眼”（杰瑞米·雷纳JeremyRenner饰）组成的...', '/static/upload/movie/2020-3-10/p1524359776.jpg', ' 美国', '2012-05-05(中国大陆);2012-05-04(美国)', 6.9, '2020-03-08 21:27:22.436252', '2020-03-08 21:27:22.436252');
INSERT INTO `movie` VALUES ('1889243', '星际穿越', '　　近未来的地球黄沙遍野，小麦、秋葵等基础农作物相继因枯萎病灭绝，人类不再像从前那样仰望星空，放纵想象力和灵感的迸发，而是每日在沙尘暴的肆虐下倒数着所剩不多的光景。在家务农的前NASA宇航员库珀（马修·麦康纳MatthewMcConaughey饰）接连在女儿墨菲（麦肯吉·弗依MackenzieFoy饰）的书房发现奇怪的重力场现象，随即得知在某个未知区域内前NASA成员仍秘密进行一个拯救人类的计划。多年以前土星附近出现神秘虫洞，NASA借机将数名宇航员派遣到遥远的星系寻找适合居住的星球。在布兰德教授（迈克尔·凯恩MichaelCaine饰）的劝说下，库珀忍痛告别了女儿，和其他三名专家教授女儿艾米莉亚·布兰德（安妮·海瑟薇AnneHathaway饰）、罗米利（大卫·吉雅西DavidGyasi饰）、多伊尔（韦斯·本特利WesB...', '/static/upload/movie/2020-3-10/p2206088801.jpg', ' 美国 / 英国 / 加拿大 / 冰岛', '2014-11-12(中国大陆);2014-11-07(美国)', 2.3, '2020-03-08 21:26:32.814509', '2020-03-08 21:26:32.814509');
INSERT INTO `movie` VALUES ('1905779', '最后一搏', '　　故事的主人公是一个很有野心的政府官僚。某天他接受了一件棘手的任务：完成一份关于授予一个英雄以国家最高荣誉的报告。问题是，这个英雄的事迹是发生在四十年前，而且并不像通常的那样毫无瑕疵。在调查这起事件中，主人公的生活发生了难以预料的改变，同时也殃及了周围的人们', '/static/upload/movie/2020-3-10/p2575219133.jpg', ' 美国', '2020-01-24(美国)', 7.3, '2020-03-08 21:27:05.978556', '2020-03-08 21:27:05.978556');
INSERT INTO `movie` VALUES ('1929463', '少年派的奇幻漂流', '　　故事开始于蒙特娄，也结束于蒙特娄。一名在找寻灵感的作家（拉菲·斯波RafeSpall饰）无意间得知派·帕帖尔（伊尔凡·可汗IrrfanKhan饰）的传奇故事。派的父亲（阿迪勒·侯赛因AdilHussain饰）开了一家动物园。因这样特殊的生活环境，少年派（苏拉·沙玛SurajSharma饰）对信仰与人的本性自有一套看法。在派17岁那一年，他的父母决定举家移民加拿大以追求更好的生活，而他也必须离开他的初恋情人。在前往加拿大的船上，他们遇见一位残忍成性的法国厨师（杰拉尔·德帕迪约GérardDepardieu饰）。当天深夜在茫茫大海中，原本令派感到刺激无比的暴风雨一瞬间就成了吞噬货船的大灾难。派却奇迹般地活了下来，搭着救生船在太平洋上漂流，而且有一名最令人意想不到的同伴——理查德·帕克，一只孟加拉老虎。神奇的冒险旅程就这样意...', '/static/upload/movie/2020-3-10/p1784592701.jpg', ' 美国 / 中国台湾 / 英国 / 加拿大', '2012-11-22(中国大陆);2012-09-28(纽约电影节);2012-11-21(美国)', 6.3, '2020-03-08 21:27:00.570799', '2020-03-08 21:27:00.570799');
INSERT INTO `movie` VALUES ('1937946', '穿越时空的少女', '　　17岁少女绀野真琴是一个活泼跳脱的少女。在一次普通值日工作中，真琴不小心摔倒了，自此她发现自己拥有了穿越时空的能力。她兴奋不已，掌握了穿越时空的方法后，她经常用这个方法去解决生活中许多令她困扰十分的事。', '/static/upload/movie/2020-3-10/p2079334286.jpg', ' 日本', '2006-07-15(日本)', 3.4, '2020-03-08 21:28:45.501812', '2020-03-08 21:28:45.501812');
INSERT INTO `movie` VALUES ('1937998', '阿弥陀堂讯息', '　　畅销小说家孝夫和在最先进的医疗机关工作的美智子夫妻，因为妻子得了焦虑症，离开东京，搬到丈夫的故乡，信州的一个山村。在那里，他们遇到了丈夫的患了癌症的恩师，因为疾病而不能说话的小姑娘小百合，还有在阿弥陀堂生活的96岁高龄的老婆婆等人，通过和这些人温情的交流，夫妻俩又找到了活着的喜悦...。', '/static/upload/movie/2020-3-10/p2393018482.jpg', ' 日本', '2002-10-05', 5.8, '2020-03-08 21:25:51.486554', '2020-03-08 21:25:51.486554');
INSERT INTO `movie` VALUES ('1959195', '忠犬八公物语', '　　1923年，日本秋田县大馆市天降大雪，近藤家纯种秋田犬产仔，赠与县土木科长间濑。后者将其中一犬转赠东京帝国大学教授上野秀次郎（仲代达矢TatsuyaNakadai饰）驯养。上野的独生女千鹤子对此欢欣鼓舞，而上野夫妇却面露难色。后来，千鹤子（石野真子MakoIshino饰）谈恋爱，竟怀了男友的孩子。男友专程登门造访。上野与之对谈，后者诚惶诚恐，坦言要对其女儿负责，事不宜迟，即日便举行婚礼，上野闻听此言，转怒为喜。千鹤子出嫁后，上野旋即把全部的心血与爱都投注在幼犬身上，并取名为阿八。每日上下班，阿八必在涩谷车站等候，一年四季，风雨无阻，令路人叹为观止，成为地方一道风景，主仆之情感动天地……', '/static/upload/movie/2020-3-10/p1576418852.jpg', ' 日本', '1987-08-01(日本)', 8, '2020-03-08 21:28:47.405370', '2020-03-08 21:28:47.405370');
INSERT INTO `movie` VALUES ('1959877', '悬崖上的金鱼姬', '　　金鱼姬是一条活泼好动的小鱼，一次偶然的机会，它在涨潮时被冲进了玻璃瓶中无法脱身。此时，刚好来海边度假的男孩宗介路过，帮它解困，从此人鱼相识。宗介把金鱼抱回家里喂养，一起玩耍，感情甚笃。由于海员父亲终日出航，宗介只得跟母亲相依为命，这让他的性格孤僻自闭，甚至对长辈也不理不睬。但是，遇到金鱼姬后，宗介逐渐改变了对生活的冷漠态度，这也让他慢慢修复了性格中的缺陷。一次意外的海啸中，宗介撞伤了身体，金鱼姬沾染到了人类的血，飘回了大海之中。原来海洋中还有另外一个世界，那里有个操控水文环境的古怪男子藤本，因为发现了人类污染环境的丑陋，所以自造了另一个水中世界。他发现金鱼姬沾染了人气，正准备用魔法将它打回原形，却事与愿违……', '/static/upload/movie/2020-3-10/p454118602.jpg', ' 日本', '2008-07-19(日本)', 2.8, '2020-03-08 21:28:50.434768', '2020-03-08 21:28:50.434768');
INSERT INTO `movie` VALUES ('19944106', '美人鱼', '　　白手起家的富豪刘轩（邓超饰）新拍下了一块地皮，并联合了女强人李若兰（张雨绮饰）使用恐怖的声纳技术驱赶鱼类，用于填海造地。人鱼一族长期居住在附近区域的海里，为了继续生存，带头大哥章鱼八哥（罗志祥饰）派出了美人鱼珊珊（林允饰）“色诱”刘轩，准备刺杀。没想到珊珊在卧底过程中与刘轩暗生情愫，一次次破坏暗杀计划，而李若兰却在准备一个更丧心病狂的邪恶计划……', '/static/upload/movie/2020-3-10/p2316177058.jpg', ' 中国大陆 / 中国香港', '2016-02-08(中国大陆/中国香港)', 4.4, '2020-03-08 21:27:58.438406', '2020-03-08 21:27:58.438406');
INSERT INTO `movie` VALUES ('2043546', '秒速5厘米', '　　如果，樱花掉落的速度是每秒5厘米，那么两颗心需要多久才能靠近？', '/static/upload/movie/2020-3-10/p982896012.jpg', ' 日本', '2007-03-03(日本)', 8.3, '2020-03-08 21:28:49.478689', '2020-03-08 21:28:49.478689');
INSERT INTO `movie` VALUES ('20470074', '言叶之庭', '　　年方15岁的高中生秋月孝雄（入野自由配音），专心学业的过程中不得不为了生计打工赚钱。母亲离家出走，他与哥哥过着看不到前方的生活。入梅之日，孝雄逃课来到日本庭园。在一座安静的小亭子里，27岁的职场女性雪野百香里（花泽香菜配音）边吃巧克力边饮啤酒的样子引起了孝雄的注意。似曾相识的二人，仿佛约定好了一般，每到落雨之日便从世俗的烦恼中逃脱出来，相会于这座钢筋铁骨都市丛林中宛若世外桃源的幽静角落。在梅雨季节的日子里，他们的心渐渐向彼此靠拢。志愿成为手工鞋匠的秋月，决心以雪野为模特做一双鞋。', '/static/upload/movie/2020-3-10/p1958733032.jpg', ' 日本', '2013-05-31(日本)', 1.1, '2020-03-08 21:28:44.883390', '2020-03-08 21:28:44.883390');
INSERT INTO `movie` VALUES ('20495023', '寻梦环游记', '　　热爱音乐的米格尔（安东尼·冈萨雷兹AnthonyGonzalez配音）不幸地出生在一个视音乐为洪水猛兽的大家庭之中，一家人只盼着米格尔快快长大，好继承家里传承了数代的制鞋产业。一年一度的亡灵节即将来临，每逢这一天，去世的亲人们的魂魄便可凭借着摆在祭坛上的照片返回现世和生者团圆。', '/static/upload/movie/2020-3-10/p2503997609.jpg', ' 美国', '2017-11-24(中国大陆);2017-10-20(莫雷利亚电影节);2017-11-22(美国)', 2.8, '2020-03-08 21:25:38.516512', '2020-03-08 21:25:38.516512');
INSERT INTO `movie` VALUES ('2082176', '我的妹妹小桃子', '　　●一個溫馨感人的故事，道盡兄妹情誼生命的喜悅', '/static/upload/movie/2020-3-10/p2282600972.jpg', ' 日本', '2003-07-23', 5.2, '2020-03-08 21:26:11.359590', '2020-03-08 21:26:11.359590');
INSERT INTO `movie` VALUES ('2129039', '飞屋环游记', '　　小男孩卡尔（CarlFredricksen）怀揣着对于冒险的热爱偶遇假小子艾丽（Ellie），而艾丽把整个屋子当成一艘大飞船游戏居然使他对这个女孩子有些着迷，相同的爱好最终使两个人成为了一生的爱侣。', '/static/upload/movie/2020-3-10/p485887754.jpg', ' 美国', '2009-08-04(中国大陆);2009-05-13(戛纳电影节);2009-05-29(美国)', 5.2, '2020-03-08 21:26:55.570878', '2020-03-08 21:26:55.570878');
INSERT INTO `movie` VALUES ('2131459', '机器人总动员', '　　公元2805年，人类文明高度发展，却因污染和生活垃圾大量增加使得地球不再适于人类居住。地球人被迫乘坐飞船离开故乡，进行一次漫长无边的宇宙之旅。临行前他们委托Buynlarge的公司对地球垃圾进行清理，该公司开发了名为WALL·E（WasteAllocationLoadLifters–Earth地球废品分装员）的机器人担当此重任。', '/static/upload/movie/2020-3-10/p1461851991.jpg', ' 美国', '2008-06-27(美国)', 5.3, '2020-03-08 21:27:10.621352', '2020-03-08 21:27:10.621352');
INSERT INTO `movie` VALUES ('21349769', '第零军团', '　　热爱科学的小女主角（麦肯纳·格蕾丝饰演）将领导一群格格不入的孩子们参加女子童子军大赛，赢得才艺表演秀后录制美国太空总署的金唱片，一群小朋友也从过程中培养出长达一辈子的深刻友谊。', '/static/upload/movie/2020-3-10/p2576575698.jpg', ' 美国', '2019-02-01(圣丹斯电影节首映);2020-01-17(美国)', 9.9, '2020-03-08 21:28:42.813831', '2020-03-08 21:28:42.813831');
INSERT INTO `movie` VALUES ('21360417', '恐怖直播', '　　韩国首尔某个平凡的早上，广播电台DailyTopic节目的主持人尹英华（河正宇饰）正就税率改革与听众进行连线，这时一个自称住在首尔昌信洞的普通工人朴鲁圭打入电话，大肆抱怨超高的电费和相关部门对他的威胁。尹英华颇不耐烦，以偏离主题为由强行切断电话。谁知连线无法单方面由电台方面中断，愤怒的朴鲁圭继续抱怨，并扬言炸掉汉江大桥。尹英华不以为然，进而怂恿对方想做就做，谁知话音刚落，窗外的麻浦大桥便炸作废墟。大惊失色的尹英华很快冷静下来，他决定利用这次难得的机会打一次事业的翻身仗。', '/static/upload/movie/2020-3-10/p2016930906.jpg', ' 韩国', '2013-07-31(韩国)', 2.5, '2020-03-08 21:26:27.969070', '2020-03-08 21:26:27.969070');
INSERT INTO `movie` VALUES ('2149806', '入殓师', '　　买了昂贵的大提琴，想要成就一番事业的小林大悟（本木雅弘饰），经历了4个月的管弦乐演奏，得到的却是“乐团解散”的噩耗与购买乐器的高昂债务。迫不得已，大悟与妻子美香（广末凉子饰）搬到老屋，过着清贫的日子。某日，一则广告吸引了大悟的注意：NK代理公司，帮助旅行，高薪短工时。大悟来到NK代理公司面试，社长佐佐木生荣（山崎努饰）二话不说就决定聘用大悟，但却对工作内容避而不谈。在大悟的再三追问下，佐佐木社长终于道明：是入殓（日语NouKan）工作！', '/static/upload/movie/2020-3-10/p594972928.jpg', ' 日本', '2008-09-13(日本)', 7, '2020-03-08 21:28:46.597527', '2020-03-08 21:28:46.597527');
INSERT INTO `movie` VALUES ('21937438', '蒙太奇', '　　15年前，名叫西珍的小女孩遭人绑架杀害，重案组警官吴青浩（金相庆饰）虽答应西珍母亲（严正花饰）一定将凶手绳之以法，无奈经过漫长的追查却始终一无所获。眼看追诉期将近，吴警官孤注一掷，结果与嫌疑人对面错过。在此之后，吴警官抱着遗憾离开警队，过起破罐破摔的颓废生活。而西珍妈妈始终不曾放弃追凶的信念，她凭借柔弱女子之躯展开独立调查，终于发现罪犯留下的蛛丝马迹。未过多久，又有一名小女孩在光天化日之下遭人绑架，其作案手法与西珍案件如出一辙，警方旋即布下天罗地网，与之展开周旋。而面对狡猾多端的嫌犯，警方只得再次请出闲赋家中的吴青浩。', '/static/upload/movie/2020-3-10/p1951590607.jpg', ' 韩国', '2013-05-16(韩国)', 5.4, '2020-03-08 21:28:40.983950', '2020-03-08 21:28:40.983950');
INSERT INTO `movie` VALUES ('21937445', '辩护人', '　　1978年，只有高中学历的宋佑硕（宋康昊饰）通过多年的艰苦努力，终于通过司法考试，并在成为法官后很快转行成为一名律师。他敏锐地从最新政策中嗅到商机，以不动产代书业务起家。虽然被同行讥讽为随时随地派发名片的夜店小弟，但佑硕不以为忤，一步一步朝着心中的目标迈进。他依靠赚来的钱让妻儿过上富足的生活，也还了七年前在饭店大婶那里欠下的良心债。进入20世纪80年代，韩国民主化斗争愈演愈烈。佑硕全然不管窗外事，关起门来继续赚钱。然而社会的巨变已经不容他置身事外，饭店大婶的儿子朴镇宇因从属的釜山读书联合会被控为左翼社团而遭到逮捕，更受到残酷的虐待和不公的指控。', '/static/upload/movie/2020-3-10/p2158166535.jpg', ' 韩国', '2013-12-18(韩国)', 1.3, '2020-03-08 21:26:24.306532', '2020-03-08 21:26:24.306532');
INSERT INTO `movie` VALUES ('21937452', '素媛', '　　她（李来饰）是一个美丽平凡的小女孩，和爸爸妈妈生活在位于街角的家中。家里经营着以她的名字素媛命名的杂货店，母亲（严智媛饰）作为老板娘日夜忙碌不得闲暇，父亲则在工厂干着繁重的工作。在那个飘雨的早上，素媛打着雨伞独自上学。在离学校近在咫尺的地方，她遭遇一个相貌猥琐、酒气冲天的大叔，由此开启了她的悲剧之旅。柔嫩的小花遭到暴风雨无情摧残，受伤的岂止枝枝叶叶，更是那迎着阳光无忧成长的心。无良媒体铺天盖地大肆渲染，作为受害者的素媛一家仿佛成了周身污秽的耻辱之人，被四周诧异好奇的目光所包围。', '/static/upload/movie/2020-3-10/p2118532944.jpg', ' 韩国', '2013-10-02(韩国)', 2.7, '2020-03-08 21:28:52.802053', '2020-03-08 21:28:52.802053');
INSERT INTO `movie` VALUES ('2222996', '步履不停', '　　“人生路上步履不停，为何总是慢一拍”。', '/static/upload/movie/2020-3-10/p2561539680.jpg', ' 日本', '2008-06-28(日本)', 9, '2020-03-08 21:28:44.581169', '2020-03-08 21:28:44.581169');
INSERT INTO `movie` VALUES ('2286642', '名侦探柯南：贝克街的亡灵', '　　这日柯南、小兰一行人来到米花市市政大厅，一场有关最新游戏“茧”的发布会正在这里召开。由于迥异于以往任何一款游戏的“茧”可能一举改变全球游戏业界的价值观，发布会吸引了代表日本上流社会的政治、财经、演艺界人士，50名游戏体验者也多是他们的后代，新一的父亲、推理小说大师工藤优作由于参与故事编写，也来到现场。这边热热闹闹，游戏的研发者兼负责人坚村却被杀于地下室。坚村死前留在键盘J、T、R上的血迹令柯南想到答案可能在游戏中，他利用优作的关系加入了体验者队伍，小兰、灰原哀等人也拿到了体验入场券。', '/static/upload/movie/2020-3-10/p453731188.jpg', ' 日本', '2002-04-20(日本)', 7.2, '2020-03-08 21:28:41.165519', '2020-03-08 21:28:41.165519');
INSERT INTO `movie` VALUES ('2364059', '大捷', '　　抗日战争时期，有一支由三教九流人员组成的杂牌部队，号称新编第三团，团长为原县长段仁义（雷恪生饰）。为调教这群乌合之众，国民党方面派来两个职业军人，参谋长方向公（袁苑饰）和谭参谋（谭增卫饰），并配备报务员白洁芬（宫主饰）随队与上级联系。由于部队人员组成乌七八糟，各种违纪现象层出不穷，经肃纪整治稍有起色。大敌当前，国军主力撤退，命令新三团留守抵抗，后果可想而知。敌强我弱，方向公急电上峰求援，上峰找借口不予理会，新三团只好孤军奋战，伤亡惨重。段仁义安排上面派来的三人撤走，不料途中遭督战队截杀，仅白洁芬只身逃回。段仁义宣布解散部队，让大家各自逃生，却遭同党伐异......', '/static/upload/movie/2020-3-10/p2455595183.jpg', ' 中国大陆', '1995', 1.6, '2020-03-08 21:28:48.091747', '2020-03-08 21:28:48.091747');
INSERT INTO `movie` VALUES ('24696708', '神奇的费曼先生', '　　RichardFeynmanisoneofthemosticonic,influentialandinspiringscientistsofthe20thcentury.Hehelpeddesigntheatomicbomb,solvedthemysteryoftheChallengerShuttlecatastropheandwonaNobelPrize.Now,25yearsafterhisdeath-inhisownwordsandthoseofhisfriendsandfamily-thisisthestoryofthemostcaptivatingcommunicatorinthehistoryofscien...', '/static/upload/movie/2020-3-10/p1971528714.jpg', ' 英国', '2013-05-12', 7.1, '2020-03-08 21:28:34.707013', '2020-03-08 21:28:34.707013');
INSERT INTO `movie` VALUES ('24716039', '星际探索', '　　地球上接连出现神秘怪象，科学家发现某种失控的反物质反应正在威胁整个太阳系，人类生存极度堪忧……地球生死攸关之际，天才航天工程师罗伊（布拉德·皮特饰）被派往外太空，试图揭开谜团拯救人类。这是一场横跨地球、月球、火星、海王星，穿越整个太阳系的硬核冒险，一路危机重重险象环生，罗伊直面爆炸、陨石、月球飙车枪战、神秘生物等意想不到的考验，还找回了失联20年的父亲！当年罗伊的父亲（汤米·李·琼斯饰）离开地球探寻外星智慧生物，结果任务失败，消失在茫茫宇宙之中。如今父子重逢，罗伊在太空深处发现了不为人知的秘密，渐渐触达所有事件的终极真相……', '/static/upload/movie/2020-3-10/p2576088318.jpg', ' 美国 / 中国大陆', '2019-12-05(中国大陆);2019-08-29(威尼斯电影节);2019-09-20(美国)', 2.3, '2020-03-08 21:26:19.406157', '2020-03-08 21:26:19.406157');
INSERT INTO `movie` VALUES ('24751756', '老炮儿', '　　老炮儿在北京话中，专指提笼遛鸟，无所事事的老混混儿。', '/static/upload/movie/2020-3-10/p2292976849.jpg', ' 中国大陆', '2015-12-24(中国大陆);2015-09-09(威尼斯电影节)', 8.3, '2020-03-08 21:28:36.236629', '2020-03-08 21:28:36.236629');
INSERT INTO `movie` VALUES ('24753477', '蜘蛛侠：英雄归来', '　　彼得帕克（汤姆·赫兰德TomHolland饰）在内战后受到了钢铁侠托尼斯塔克（小罗伯特·唐尼RobertDowneyJr.饰）的赏识，表面上，彼得进入托尼的公司成为了一名实习生，实际上，他和复仇者联盟的成员们一起接受了各种各样的训练。托尼虽然欣赏彼得的勇敢和正直，却并不认为他目前已经拥有加入复联的实力，他派出了特工哈皮（乔恩·费儒JonFavreau饰）暗中观察，这让十分想证明自己的彼得感到万分焦躁。', '/static/upload/movie/2020-3-10/p2497756471.jpg', ' 美国', '2017-09-08(中国大陆);2017-06-28(洛杉矶首映);2017-07-07(美国)', 2.2, '2020-03-08 21:28:12.630039', '2020-03-08 21:28:12.630039');
INSERT INTO `movie` VALUES ('24754082', '我亲爱的甜橙树', '　　五岁的泽泽聪明而早熟，无师自通地学会了识字，他的伯伯甚至认为他会成为《圣经》中的“泽泽”那样的伟大人物。然而，由于家庭贫穷，爸爸失业，妈妈和姐姐不得不进了工厂，圣诞节是他的生日，但不仅没有礼物，连像样的食物都没有，再加上各种各样的恶作剧，他成为家里人的“出气筒”，经常挨打挨骂。他认为，圣诞节为他降生的不是圣婴，而是魔鬼。', '/static/upload/movie/2020-3-10/p2010287500.jpg', ' 巴西', '2013-04-19', 6.5, '2020-03-08 21:25:42.949665', '2020-03-08 21:25:42.949665');
INSERT INTO `movie` VALUES ('24773958', '复仇者联盟3：无限战争', '　　最先与灭霸军团遭遇的雷神索尔一行遭遇惨烈打击，洛基遇害，空间宝石落入灭霸之手。未几，灭霸的先锋部队杀至地球，一番缠斗后掳走奇异博士。为阻止时间宝石落入敌手，斯塔克和蜘蛛侠闯入了敌人的飞船。与此同时，拥有心灵宝石的幻视也遭到外星侵略者的袭击，为此美国队长、黑寡妇等人将其带到瓦坎达王国，向黑豹求助。幸免于难的索尔与星爵一行相逢，随后他们兵分两路。索尔与火箭、格鲁特踏上再铸雷神之锤的旅程，星爵则与卡魔拉等人试图阻止灭霸的恶行。而知晓灵魂宝石下落的卡魔拉，同样是其义父灭霸追踪的对象。', '/static/upload/movie/2020-3-10/p2517753454.jpg', ' 美国', '2018-05-11(中国大陆);2018-04-23(加州首映);2018-04-27(美国)', 7.6, '2020-03-08 21:26:11.314456', '2020-03-08 21:26:11.314456');
INSERT INTO `movie` VALUES ('25662329', '疯狂动物城', '　　故事发生在一个所有哺乳类动物和谐共存的美好世界中，兔子朱迪（金妮弗·古德温GinniferGoodwin配音）从小就梦想着能够成为一名惩恶扬善的刑警，凭借着智慧和努力，朱迪成功的从警校中毕业进入了疯狂动物城警察局，殊不知这里是大型肉食类动物的领地，作为第一只，也是唯一的小型食草类动物，朱迪会遇到怎样的故事呢？', '/static/upload/movie/2020-3-10/p2315672647.jpg', ' 美国', '2016-03-04(中国大陆/美国)', 8, '2020-03-08 21:25:23.766195', '2020-03-08 21:25:23.766195');
INSERT INTO `movie` VALUES ('25769362', '哆啦A梦：伴我同行', '　　生活在日本东京的野比大雄（大原惠美配音），是一个学习不上进、日常迷迷糊糊并且饱受同学欺负的男孩。他的性格不仅左右着自己的事业和婚姻，还对未来子孙产生莫大的影响。为此，大雄孙子的孙子世修（松本さち配音）带着猫型机器人哆啦A梦（水田山葵配音）乘坐时光机突然来访，期望彻底改变大雄及整个家族的命运。在哆啦A梦的帮助下，大雄不再受到胖虎（木村昴配音）和小夫（关智一配音）等人的欺负，他喜欢美丽的女孩源静香（嘉数由美配音）。为了实现和静香结婚的命运，他和哆啦A梦穿越时空，见证了决定人生的最关键的时刻和事件。当大雄慢慢开始变得幸福之际，哆啦A梦也到了必须返回22世纪的时候……', '/static/upload/movie/2020-3-10/p2244958975.jpg', ' 日本', '2015-05-28(中国大陆);2014-08-08(日本)', 1.2, '2020-03-08 21:28:45.544833', '2020-03-08 21:28:45.544833');
INSERT INTO `movie` VALUES ('25779217', '诛仙1', '　　草庙村被屠，少年张小凡双亲离世，被青云门大竹峰收留。机缘巧合之下，他习得佛门天音功法，又意外获得魔教法器烧火棍，踏上强者之路的同时，也让他陷入了巨大的危机。至魔法器的现世，与陆雪琪、碧瑶、田灵儿三个女生间命运的交错，都让他原本单纯的人生轨迹充满变数。一个勇者驳斥命运的传奇之旅就此展开......', '/static/upload/movie/2020-3-10/p2567346094.jpg', ' 中国大陆', '2019-09-13(中国大陆)', 3.3, '2020-03-08 21:25:30.275882', '2020-03-08 21:25:30.275882');
INSERT INTO `movie` VALUES ('25814705', '小森林 夏秋篇', '　　平凡女孩市子（桥本爱饰）自幼生长在位于日本东北地区的村庄小森。这里远离都市的喧嚣和浮躁，为青山绿水所环绕，俨然一个幽静怡然的世外桃源。村民们日出而作，日落而息，依靠一双勤劳的双手经营渺小却舒适的生活，与世无争。市子曾经前往东京闯荡，只不过她终究无法适应都市快节奏的步伐，最终回到了妈妈早已不在的老宅。童年时妈妈福子利用山川田野各种食材做出胡乱命名的美食，实心眼的市子在感叹受骗之余，也将美好的回忆留在了味蕾深处。仿佛遵循着母亲的步伐，她将对故乡的热爱融入了美食的烹制中。在朋友佑太（三浦贵大饰）和吉子（松冈茉优饰）的环绕下，享受着无忧无虑的人生……', '/static/upload/movie/2020-3-10/p2564498893.jpg', ' 日本', '2014-08-30(日本)', 9.7, '2020-03-08 21:28:48.827501', '2020-03-08 21:28:48.827501');
INSERT INTO `movie` VALUES ('25814707', '小森林 冬春篇', '　　于无法融入喧嚣吵闹的大城市，平凡女孩市子（桥本爱饰）选择回到自幼生长的老家——位于日本东北地区的小森村。这里没有过多时尚文明的色彩，当地人过着日出而作日落而息的传统生活，他们靠天吃饭，靠着双手经营人生。生活虽不富裕，心中则是满满的充实和欢喜。受妈妈（桐島かれん饰）影响，市子似乎对亲手制作各种美味而廉价的料理有着格外浓厚的兴趣。妈妈失踪已经很久，对料理的回忆与再现成为母女间别具特色的交流方式。更何况还有取自大自然的各种食材，又怎能暴殄天物浪费了大好的韶光？在好友纪子（松冈茉优饰）和裕太（三浦贵大饰）的陪伴下，市子静静地走过了春夏秋冬……', '/static/upload/movie/2020-3-10/p2258078370.jpg', ' 日本', '2015-02-14(日本)', 5.5, '2020-03-08 21:28:48.724865', '2020-03-08 21:28:48.724865');
INSERT INTO `movie` VALUES ('25815034', '湄公河行动', '　　金三角湄公河上，一处被称为“鬼门关”的河段，两艘来自中国的商船遭到不明身份之人的枪击袭击。未过多久，泰国军方召开新闻发布会，指责中国商船贩卖毒品。虽然发布会宣称船员全部逃亡，但是十三具遭受残忍杀害的中国船员尸体很快被人发现。这起胆大妄为的案件令中国警方大为震惊，云南省缉毒总队队长高刚（张涵予饰）受命带特别行动小组前往泰国，并与情报员方新武（彭于晏饰）合作接洽。根据现有资料显示，这件案子由盘踞在金三角的大毒枭糯卡所为。糯卡贪婪残忍，胆大包天，是湄公河流域上一颗惊扰运输安全的毒瘤。为了将这个恶棍绳之于法，中国、老挝、缅甸开展了三国联合巡逻，集中对糯卡的制毒窝点进行扫荡。而高刚等人也深入最危险境地，与丧失人性的贩毒分子进行惨烈对决……', '/static/upload/movie/2020-3-10/p2380677316.jpg', ' 中国大陆 / 中国香港', '2016-09-30(中国大陆)', 9.2, '2020-03-08 21:28:23.965171', '2020-03-08 21:28:23.965171');
INSERT INTO `movie` VALUES ('25820460', '美国队长3', '　　美国队长史蒂夫·罗杰斯（克里斯·埃文斯ChrisEvans饰）带领着全新组建的复仇者联盟，继续维护世界和平。然而，一次执行任务时联盟成员不小心造成大量平民伤亡，从而激发政治压力，政府决定通过一套监管系统来管理和领导复仇者联盟。联盟内部因此分裂为两派：一方由史蒂夫·罗杰斯领导，他主张维护成员自由，在免受政府干扰的情况下保护世界；另一方则追随托尼·斯塔克（小罗伯特·唐尼RobertDowneyJr.饰），他令人意外地决定支持政府的监管和责任制体系。神秘莫测的巴基（塞巴斯蒂安·斯坦SebastianStan饰）似乎成为内战的关键人物……', '/static/upload/movie/2020-3-10/p2332503406.jpg', ' 美国', '2016-05-06(中国大陆/美国);2016-04-12(加州首映)', 6.3, '2020-03-08 21:28:30.469997', '2020-03-08 21:28:30.469997');
INSERT INTO `movie` VALUES ('25823132', '暗杀', '　　故事发生在20世纪30年代，日本帝国主义的铁蹄响彻东亚诸国，风起云涌的时代下，一段段传奇接连上演。在中国，效力于韩国临时政府的局务局队长廉锡镇（李政宰饰）从监狱中释放了被判处死刑的独立军狙击手安沃允（全智贤饰），随后又找来了爆破专家黄德三（崔德文饰）、新兴武官学校毕业生“速射炮”秋尚沃（赵镇雄饰），密令三人暗杀朝鲜驻军司令官以及本国的卖国贼。危险的行动开始了，可是日本方面却很快收到刺杀任务的线报。在狂蛇乱舞的十里洋场，紧张刺激且充满阴谋的较量交替展开，而这也是有关民族命运的惊险对决……', '/static/upload/movie/2020-3-10/p2265025290.jpg', ' 韩国', '2015-09-17(中国大陆);2015-07-22(韩国)', 7.8, '2020-03-08 21:28:46.236183', '2020-03-08 21:28:46.236183');
INSERT INTO `movie` VALUES ('25823663', '较量', '　　影片前半场，一般幸福家庭生活叙述，与出场人物描述，主角是有线电视营运商，家中成员在一次意想不到的情况下，杀了警政署长的儿子。虽然没有飞天遁地、以一人对抗十人的英雄，但这些叙述都是在为后半场铺陈，缺一不可。请耐住热血，用心看完。', '/static/upload/movie/2020-3-10/p2217095034.jpg', ' 印度', '2013-12-19(印度)', 9.2, '2020-03-08 21:27:32.970197', '2020-03-08 21:27:32.970197');
INSERT INTO `movie` VALUES ('25827935', '七月与安生', '　　七月（马思纯饰）和安生（周冬雨饰）的第一次相识在十三岁，她们一个是特立独行飞扬跋扈的“野孩子”，一个是单纯温婉循规蹈矩的“乖乖女”，从那一年开始，七月和安生几乎形影不离，她是她的光，她是她的影子，直到某一天，一位名为苏家明（李程彬饰）的少年出现在了七月的身边，七月恋爱了。', '/static/upload/movie/2020-3-10/p2378140502.jpg', ' 中国大陆 / 中国香港', '2016-09-14(中国大陆);2016-10-27(中国香港)', 3, '2020-03-08 21:28:44.669760', '2020-03-08 21:28:44.669760');
INSERT INTO `movie` VALUES ('25842038', '理查德·朱维尔的哀歌', '　　影片改编自真实事件，理查德·朱维尔作为1996年亚特兰大奥运会爆炸案中发现炸弹装置的保安，而被全世界所熟知。当时他迅速采取行动，拯救了无数生命而成为英雄。但在几天之内，情况就急转直下，梦想成为执法者的他遭受媒体和公众的诽谤，竟成为联邦调查局的头号嫌疑犯，陷入了前所未有的困境。朱维尔向独立律师沃森·布莱恩特寻求帮助，坚定地宣称自己无罪。然而，在为朱维尔洗脱罪名的过程中，布莱恩特发现自己对抗的是联邦调查局、佐治亚州调查局和警方的联合阻力；与此同时，他也不断提醒理查德不要相信任何试图毁灭他的人……', '/static/upload/movie/2020-3-10/p2578705064.jpg', ' 美国', '2020-01-10(中国大陆);2019-11-20(AFI Fest);2019-12-13(美国)', 6.5, '2020-03-08 21:28:27.610495', '2020-03-08 21:28:27.610495');
INSERT INTO `movie` VALUES ('25850319', '鲁邦三世：次元大介的墓碑', '　　《鲁邦三世次元大介的墓碑》是该系列继2012年4月《鲁邦三世～名为峰不二子的女人～》之后推出的又一部外传，主角换成了孤高枪手次元大介，讲述他夺取目标、与强敌对决，以及如何成为鲁邦三世搭档的故事。', '/static/upload/movie/2020-3-10/p2178415896.jpg', ' 日本', '2014-06-21(日本)', 4.9, '2020-03-08 21:28:46.151129', '2020-03-08 21:28:46.151129');
INSERT INTO `movie` VALUES ('25887288', '冰雪奇缘2', '　　历经严酷考验，阿伦戴尔王国终于回归往日平静。艾莎女王（伊迪娜·门泽尔IdinaMenzel配音）、安娜公主（克里斯汀·贝尔KristenBell配音）以及他们的好友雪宝（乔什·加德JoshGad配音）、克里斯托弗（乔纳森·格罗夫JonathanGroff配音）、驯鹿斯文过着平静安逸的生活。可是最近一段时间，艾莎总会被一段神秘的吟唱所困扰，为了追寻真相，她义无反顾踏上了征途。担心姐姐的安全，安娜和雪宝、克里斯托弗他们紧紧跟随。在那座常年被浓雾所笼罩的森林里，不仅藏着神秘的自然力量，更隐藏着关于阿伦戴尔王国、艾莎的魔法来源以及两位公主父母丧生等一系列的秘密。', '/static/upload/movie/2020-3-10/p2572847101.jpg', ' 美国', '2019-11-22(美国/中国大陆)', 6.2, '2020-03-08 21:26:51.249529', '2020-03-08 21:26:51.249529');
INSERT INTO `movie` VALUES ('25892252', '帷幕：波洛的最后一案', '　　黑斯廷斯上尉应波洛之邀，在事隔多年后回到了现已是乡间旅馆的斯泰尔斯庄园——这对老朋友初次相遇并共同经历第一桩谋杀案件的地方。然而，令满心憧憬着与波洛及女儿朱迪斯相聚的上尉始料未及的是，比上次更加凶险的谋杀正等待着他的到来。原来，波洛追寻一个手法高超的谋杀犯来到此地，希望阻止罪行的发生。身体每况愈下的他要求黑斯廷斯的协助。但波洛拒绝透露凶手，只断定凶手就是旅馆中的某一个人……', '/static/upload/movie/2020-3-10/p2184353409.jpg', ' 英国', '2013-11-13(英国)', 6.8, '2020-03-08 21:26:14.557903', '2020-03-08 21:26:14.557903');
INSERT INTO `movie` VALUES ('25895901', '海街日记', '　　临海古都镰仓，顺山而成的小镇，不起眼的角落里生活着香田家四姐妹。她们的父亲早年和情人离家出走，母亲则干脆将女儿们抛给了外婆照顾。外婆去世后，外孙女们继承了这栋有着悠久历史的大房子。过早担负起家庭重任的大姐香田幸（绫濑遥饰），尽心尽力照顾着两个妹妹佳乃（长泽雅美饰）、千佳（夏帆饰）健康成长。这一天，父亲去世的消息传到姐妹手中。她们结伴而行参加了父亲的葬礼，并且结识了从未谋面的异母妹妹浅野铃（广濑丝丝饰）。许是血缘中的亲近之感，幸在临行前邀请铃搬来镰仓同住。未过多久，抱着对姐姐们的憧憬，铃迈入了父亲曾经生活过的房子。四季流转，姐妹们的故事悄然上演……', '/static/upload/movie/2020-3-10/p2232247487.jpg', ' 日本', '2015-05-14(戛纳电影节);2015-06-13(日本)', 6, '2020-03-08 21:28:46.997579', '2020-03-08 21:28:46.997579');
INSERT INTO `movie` VALUES ('25921812', '驴得水', '　　一群“品行不端”却怀揣教育梦想的大学教师，从大城市来到偏远乡村开办了一所小学校。学校待遇惨淡、生活艰苦，但老师们都自得其乐，每天嘻嘻哈哈打成一片。然而教育部特派员要来突击检查的消息打破了安宁，因为学校有一位“驴得水老师”隐藏着不可告人的秘密。就在所有人都担心丑事即将败露的时候，一个神奇天才的出现拯救了大家，然而谁能料到真正的麻烦才刚刚开始……', '/static/upload/movie/2020-3-10/p2393044761.jpg', ' 中国大陆', '2016-10-28(中国大陆)', 8.6, '2020-03-08 21:28:46.267676', '2020-03-08 21:28:46.267676');
INSERT INTO `movie` VALUES ('25964071', '夏洛特烦恼', '　　在学生时代的初恋秋雅（王智饰）的婚礼上，毕业后吃软饭靠老婆养的夏洛（沈腾饰）假充大款，出尽其丑，中间还被老婆马冬梅（马丽饰）戳穿暴捶。混乱之中，夏洛意外穿越时空，回到了1997年的学生时代的课堂里。他懵懵懂懂，以为是场真实感极强的梦，于是痛揍王老师，强吻秋雅，还尝试跳楼让自己醒来。当受伤的他从病床上苏醒时，他意识到自己真的穿越了时空。既然有机会重新来过，那不如好好折腾一回。他勇敢追求秋雅、奚落优等生袁华（尹正饰）、拒绝马冬梅的死缠烂打。后来夏洛凭借“创作”朴树、窦唯等人的成名曲而进入娱乐圈。', '/static/upload/movie/2020-3-10/p2264377763.jpg', ' 中国大陆', '2015-09-30(中国大陆)', 2.5, '2020-03-08 21:28:48.857528', '2020-03-08 21:28:48.857528');
INSERT INTO `movie` VALUES ('25964201', '理查三世', '　　本尼迪克特·康伯巴奇将在BBC电视电影中饰演理查德三世。影片由尼尔街公司制作，该公司去年成功推出广受好评剧集《空王冠》。这次电视电影系列可算作其续篇，除了理查德三世，还会制作亨利六世上下两部电视电影。', '/static/upload/movie/2020-3-10/p2407018702.jpg', ' 英国', '2016-05-21(英国)', 9.5, '2020-03-08 21:28:17.464344', '2020-03-08 21:28:17.464344');
INSERT INTO `movie` VALUES ('25977027', '小姐', '　　公爵（河正宇饰）为了得到日本贵族秀子小姐（金敏喜饰）的财产，意欲娶她为妻，而后以其患上精神疾病为由将秀子送入精神病院。为了实现自己的阴谋，公爵将出生于小偷世家的南淑熙（金泰璃饰）送到秀子的身边担任女佣，如此一来两人里应外合，深闺之中不谙世事的秀子和她的万贯家财根本就是他们的囊中之物。', '/static/upload/movie/2020-3-10/p2355555424.jpg', ' 韩国', '2016-05-14(戛纳电影节);2016-06-01(韩国)', 3.4, '2020-03-08 21:27:14.189077', '2020-03-08 21:27:14.189077');
INSERT INTO `movie` VALUES ('25986180', '釜山行', '　　证券公司基金管理人石宇（孔侑饰）光鲜精干，却也是个重利轻义之徒。妻子为此与之决裂，女儿秀安（金秀安饰）则对如此自私的父亲越来越失望，决定前往釜山和母亲生活。在秀安生日这天，石宇抽出时间陪伴女儿登上开往釜山的特快列车。而与此同时，城市四处出现了极为可疑的暴动事件。政府极力洗白无法掩盖丧尸肆虐的事实，即便懵然无知的列车乘客也因为不速之客的到来而堕入恐慌绝望的地狱中。开车的刹那，一名感染者冲入车厢，而她很快尸变并对目光所及之处的健康人展开血腥屠杀。未过多久，丧尸便呈几何数爆发性地增长。石宇被迫和幸存者的乘客们在逼仄的空间中奋力求生。', '/static/upload/movie/2020-3-10/p2360940399.jpg', ' 韩国', '2016-05-13(戛纳电影节);2016-07-20(韩国)', 6.6, '2020-03-08 21:25:42.966710', '2020-03-08 21:25:42.966710');
INSERT INTO `movie` VALUES ('25986662', '疯狂的外星人', '　　号称银河系最先进的外星文明试图和地球建交，谁知一连串的误会导致意外发生。外星使者的飞船坠入大气层，最终摔在了中国某市的世界公园中。靠耍猴戏为生的耿浩（黄渤饰）和酒贩子好友大飞（沈腾饰）把受伤的外星人错认为来自南美洲的猴子，在自家猴子受伤的情况下，耿浩开始训练起这个他口中的“刚果骚骚猴”来了。由于失去了超能力加成设备，外星人的本事无法施展，只能任由这两个傻乎乎的地球人打骂操练。尽管如此，他仍试图夺回自己的装备。另一方面，之前与外星人交流失败的超级大国根据外星人留下的信息，穿梭世界各地寻找外星使者。地球的命运朝着不可预测的方向发展……', '/static/upload/movie/2020-3-10/p2541901817.jpg', ' 中国大陆', '2019-02-05(中国大陆)', 9.8, '2020-03-08 21:28:48.878063', '2020-03-08 21:28:48.878063');
INSERT INTO `movie` VALUES ('26100958', '复仇者联盟4：终局之战', '　　一声响指，宇宙间半数生命灰飞烟灭。几近绝望的复仇者们在惊奇队长（布丽·拉尔森BrieLarson饰）的帮助下找到灭霸（乔什·布洛林JoshBrolin饰）归隐之处，却得知六颗无限宝石均被销毁，希望彻底破灭。如是过了五年，迷失在量子领域的蚁人（保罗·路德PaulRudd饰）意外回到现实世界，他的出现为幸存的复仇者们点燃了希望。与美国队长（克里斯·埃文斯ChrisEvans饰）冰释前嫌的托尼（小罗伯特·唐尼RobertDowneyJr.饰）找到了穿越时空的方法，星散各地的超级英雄再度集结，他们分别穿越不同的时代去搜集无限宝石。而在这一过程中，平行宇宙的灭霸察觉了他们的计划。', '/static/upload/movie/2020-3-10/p2552058346.jpg', ' 美国', '2019-04-24(中国大陆);2019-04-26(美国)', 1.2, '2020-03-08 21:25:51.447053', '2020-03-08 21:25:51.447053');
INSERT INTO `movie` VALUES ('26259677', '垫底辣妹', '　　长相甜美的高中女孩工藤沙耶加（有村架纯饰）在家并不受父亲待见，父亲一心要把弟弟培养成棒球手，而疏于对女儿们的呵护。沙耶加所在的高中有内部升学的制度，因此她终日和小姐妹们吃喝玩乐，学习掉到了全年级倒数第一也毫不为意。温柔勤苦的妈妈（吉田羊饰）经常被校方找去说教，她为女儿的未来焦虑万分，因此将沙耶加送到了坪田（伊藤淳史饰）所开办的补习班。经过水平测试，沙耶加实际只有小学四年级的水平，不过开朗自信的坪田不以为意，他以特有的方式打开女孩的心防，两人很快成为好朋友。在坪田的帮助下，沙耶加对学习的态度逐渐浓厚，后来更立下了考取庆应大学的宏愿。这是丑小鸭绝地逆袭的真实故事……', '/static/upload/movie/2020-3-10/p2329080834.jpg', ' 日本', '2016-04-14(中国大陆);2015-05-01(日本)', 2.5, '2020-03-08 21:28:48.908169', '2020-03-08 21:28:48.908169');
INSERT INTO `movie` VALUES ('26264454', '声之形', '　　西宫硝子（早见沙织饰）生来患有听觉障碍，要依靠助听器和外界交流，口语发音也因此格外的古怪。小学时，硝子转入了一所新的学校，特殊的生理缺陷让她成为了班上引人注目的独特存在，她因此收获了坚实的友情，却也遭到了以男生石田将也（入野自由配音）为首的小团体的孤立和排挤。随着时间的推移，无心或有意的恶作剧渐渐升级，最终演变成为了无法挽回的伤害，硝子永远的消失在了众人的眼前。', '/static/upload/movie/2020-3-10/p2497136132.jpg', ' 日本', '2017-09-08(中国大陆);2016-09-17(日本)', 7.8, '2020-03-08 21:28:40.030499', '2020-03-08 21:28:40.030499');
INSERT INTO `movie` VALUES ('26266893', '流浪地球', '　　近未来，科学家们发现太阳急速衰老膨胀，短时间内包括地球在内的整个太阳系都将被太阳所吞没。为了自救，人类提出一个名为“流浪地球”的大胆计划，即倾全球之力在地球表面建造上万座发动机和转向发动机，推动地球离开太阳系，用2500年的时间奔往另外一个栖息之地。中国航天员刘培强（吴京饰）在儿子刘启四岁那年前往国际空间站，和国际同侪肩负起领航者的重任。转眼刘启（屈楚萧饰）长大，他带着妹妹朵朵（赵今麦饰）偷偷跑到地表，偷开外公韩子昂（吴孟达饰）的运输车，结果不仅遭到逮捕，还遭遇了全球发动机停摆的事件。为了修好发动机，阻止地球坠入木星，全球开始展开饱和式营救，连刘启他们的车也被强征加入。在与时间赛跑的过程中，无数的人前仆后继，奋不顾身，只为延续百代子孙生存的希望……', '/static/upload/movie/2020-3-10/p2545472803.jpg', ' 中国大陆', '2019-02-05(中国大陆)', 7.9, '2020-03-08 21:28:53.566573', '2020-03-08 21:28:53.566573');
INSERT INTO `movie` VALUES ('26311973', '唐人街探案', '　　天赋异禀的结巴少年秦风（刘昊然饰）警校落榜，被姥姥遣送泰国找远房表舅——号称“唐人街第一神探”，实则猥琐的大叔唐仁（王宝强饰）散心。不想一夜花天酒地后，唐仁沦为离奇凶案嫌疑人，不得不和秦风亡命天涯……穷追不舍的警探黄兰登（陈赫饰）、无敌幸运的警察坤泰（肖央饰）、穷凶极恶的匪帮三人组、高深莫测的唐人街教父、美艳风骚的老板娘阿香（佟丽娅饰）等悉数登场！七天！唐仁、秦风必须取长补短、同仇敌忾！他们能否躲避警察追捕、匪帮追杀、黑帮围剿，在短短七天内，完成找到失落的黄金并查明真凶，为自己洗清罪名这些逆天的任务？', '/static/upload/movie/2020-3-10/p2302930556.jpg', ' 中国大陆', '2015-12-31(中国大陆)', 3.4, '2020-03-08 21:28:48.751641', '2020-03-08 21:28:48.751641');
INSERT INTO `movie` VALUES ('26331118', '美国女人', '　　影片讲述一位生活在美国蓝领聚集区的女性，在女儿意外失踪后，一边抚养尚在襁褓中的外孙，一边探寻事件真相。', '/static/upload/movie/2020-3-10/p2557364063.jpg', ' 英国 / 美国', '2018-09-09(多伦多国际电影节);2019-06-14(美国)', 6.6, '2020-03-08 21:28:41.193845', '2020-03-08 21:28:41.193845');
INSERT INTO `movie` VALUES ('26348103', '小妇人', '　　电影改编自世界名著《小妇人》，由奥斯卡提名最佳导演格雷塔.葛伟格执导，直击当代女性困惑。作为2020年颁奖季热门，影片聚齐两代神仙阵容“世纪大同框”——金球奖最佳女主“伯德小姐”西尔莎·罗南与屡获提名的超人气演员“甜茶”再度携手诠释错过的真爱，“赫敏”艾玛·沃森与“黑寡妇师妹”弗洛伦斯·皮尤联袂呈现手足情深，三获奥斯卡的老戏骨梅尔·斯特里普与四次金球奖得主劳拉·邓恩倾力加盟。导演葛伟格用细腻又颇具新意的叙事手法，为这部经典文学名作带来充满活力的现代风格。', '/static/upload/movie/2020-3-10/p2575325937.jpg', ' 美国', '2020(中国大陆);2019-12-25(美国)', 1.6, '2020-03-08 21:25:19.466702', '2020-03-08 21:25:19.466702');
INSERT INTO `movie` VALUES ('26363254', '战狼2', '　　由于一怒杀害了强拆牺牲战友房子的恶霸，屡立功勋的冷锋（吴京饰）受到军事法庭的判决。在押期间，亲密爱人龙小云壮烈牺牲。出狱后，冷锋辗转来到非洲，他辗转各地，只为寻找杀害小云的凶手。在此期间，冷锋逗留的国家发生叛乱，叛徒红巾军大开杀戒，血流成河。中国派出海军执行撤侨任务，期间冷锋得知有一位陈博士被困在五十五公里外的医院，而叛军则试图抓住这位博士。而从另一位华侨（于谦饰）口中得知，杀害小云的凶手正待在这个国家。', '/static/upload/movie/2020-3-10/p2494701965.jpg', ' 中国大陆', '2017-07-27(中国大陆)', 4.3, '2020-03-08 21:28:50.467183', '2020-03-08 21:28:50.467183');
INSERT INTO `movie` VALUES ('26366496', '邪不压正', '　　七七事变前夕，华裔青年小亨德勒（彭于晏饰）从美国远赴重洋，回到阔别十数年之久的北平从医。然而他真正的名字叫李天然，十三岁那年曾亲眼目睹师父一家遭师兄朱潜龙（廖凡饰）和日本人根本一郎（泽田谦也饰）灭门。侥幸逃生的天然被美国人亨德勒医生送往大洋彼岸，接受了极其严苛的训练，而今他怀着绝密的任务踏上故土。亨德勒父子租住神秘男子蓝青峰（姜文饰）的宅子，蓝是当年辛亥革命的参与者，他与现为警察局长的朱潜龙过从甚密，却又以杀死李天然为筹码，暗中怂恿朱除掉根本一郎。复仇心切的李天然寻找到了仇人，而亨德勒医生则全力阻止养子冒险。在这一过程中，交际花唐凤仪（许晴饰）与裁缝关巧红（周韵饰）也卷入了男人的勾心斗角的漩涡里。直到七七事变爆发，所有的矛盾迎来了决断的时刻……', '/static/upload/movie/2020-3-10/p2526297221.jpg', ' 中国大陆', '2018-07-13(中国大陆)', 1.3, '2020-03-08 21:28:45.294921', '2020-03-08 21:28:45.294921');
INSERT INTO `movie` VALUES ('26387939', '摔跤吧！爸爸', '　　马哈维亚（阿米尔·汗AamirKhan饰）曾经是一名前途无量的摔跤运动员，在放弃了职业生涯后，他最大的遗憾就是没有能够替国家赢得金牌。马哈维亚将这份希望寄托在了尚未出生的儿子身上，哪知道妻子接连给他生了两个女儿，取名吉塔（法缇玛·萨那·纱卡FatimaSanaShaikh饰）和巴比塔（桑亚·玛荷塔SanyaMalhotra饰）。让马哈维亚没有想到的是，两个姑娘展现出了杰出的摔跤天赋，让他幡然醒悟，就算是女孩，也能够昂首挺胸的站在比赛场上，为了国家和她们自己赢得荣誉。', '/static/upload/movie/2020-3-10/p2457983084.jpg', ' 印度', '2017-05-05(中国大陆);2016-12-23(印度)', 5.7, '2020-03-08 21:26:14.720169', '2020-03-08 21:26:14.720169');
INSERT INTO `movie` VALUES ('26410594', '隧道', '　　汽车销售员李正洙（河正宇饰）结束工作赶赴女儿生日派对时，行经刚开通的河图隧道，突然一阵天摇地动，让他经历此生最孤立无援的三十五天，而此刻的他唯一能做的就是拨打119求救。这则隧道崩塌消息引发各界关注，除了搜救大队，还吸引了大批抢新闻的嗜血媒体，以及逢场作秀只为增添政绩的官员。搜救队长金大庆（吴达洙饰）不仅要研拟救援计划，还需控制现场跟风记者、向作秀官员汇报，恶劣天气的搅局使得救援行动雪上加霜。好不容易终于进行开挖，准备救出受难者时，竟发现隧道是个豆腐渣工程。一连串的重击使得希望一一幻灭，更糟的是搜救行动中救难队组长意外身亡、国库的大量花费，促使舆论审判，迫使李正洙无助的老婆世贤（裴斗娜饰）签下放弃救援同意书。那一天崩塌的不只是隧道，更引爆现代社会形象丑闻。', '/static/upload/movie/2020-3-10/p2358109451.jpg', ' 韩国', '2016-08-10(韩国)', 7.4, '2020-03-08 21:27:33.018760', '2020-03-08 21:27:33.018760');
INSERT INTO `movie` VALUES ('26425063', '无双', '　　身陷囹圄的李问（郭富城饰）被引渡回港，他原本隶属于一个的跨国假钞制贩组织。该组织曾犯下过多宗恶性案件，而首脑“画家”不仅始终逍遥法外，连真面目都没人知道。为了逼迫李问吐露“画家”真实身份，警方不惜用足以判死刑的假罪证使其就范。就在此时，富有的遗孀阮文（张静初饰）申请保释李问，而警方提出的条件依然是“画家”的真面目。', '/static/upload/movie/2020-3-10/p2535260806.jpg', ' 中国大陆 / 中国香港', '2018-09-30(中国大陆);2018-10-04(中国香港)', 1.4, '2020-03-08 21:28:50.401101', '2020-03-08 21:28:50.401101');
INSERT INTO `movie` VALUES ('26575103', '捉妖记2', '　　上一集与胡巴分别后，天荫（井柏然饰）带着小岚（白百何饰）踏上寻父之路，在义薄云天的天师堂堂主云大哥（杨祐宁饰）的帮助下，二人得知天荫父亲宋戴天的护妖轨迹；而重回永宁村的胡巴再度被妖王追杀，颠沛流离逃亡时结识大赌徒屠四谷（梁朝伟饰）和一只妖怪，三人一起过着相依为命的生活，但又因屠四谷欠下的巨额赌债横生诸多波折。与此同时，江湖盛传小妖王胡巴的重金悬赏令，妖界大军、天师精英、绿林草莽闻风而动，多方势力为抢夺胡巴在清水镇掀起腥风血雨。千钧一发之际，念子心切的天荫和小岚通过天师堂找到胡巴并一起逃离险境。岂料，一场更大的惊天阴谋尾随而至，伺机而动……', '/static/upload/movie/2020-3-10/p2509643816.jpg', ' 中国大陆 / 中国香港', '2018-02-16(中国大陆)', 6.8, '2020-03-08 21:27:33.097089', '2020-03-08 21:27:33.097089');
INSERT INTO `movie` VALUES ('26580108', '所有明亮的地方', '　　影片根据詹妮弗·尼文2015年畅销小说改编，故事讲述维奥莱特·马基(范宁饰)和西奥多·芬奇(史密斯饰)这两个高中生和精神疾病不断作斗争，他们相遇并发现各自内心的世界。', '/static/upload/movie/2020-3-10/p2577021302.jpg', ' 美国', '2020-02-28(美国)', 5.8, '2020-03-08 21:25:19.504863', '2020-03-08 21:25:19.504863');
INSERT INTO `movie` VALUES ('26580232', '看不见的客人', '　　艾德里安（马里奥·卡萨斯MarioCasas饰）经营着一间科技公司，事业蒸蒸日上，家中有美丽贤惠的妻子和活泼可爱的女儿，事业家庭双丰收的他是旁人羡慕的对象。然而，野心勃勃的艾德里安并未珍惜眼前来之不易的生活，一直以来，他和一位名叫劳拉（芭芭拉·蓝妮BárbaraLennie饰）的女摄影师保持着肉体关系。', '/static/upload/movie/2020-3-10/p2498971355.jpg', ' 西班牙', '2017-09-15(中国大陆);2016-09-23(奇幻电影节);2017-01-06(西班牙)', 1.7, '2020-03-08 21:27:05.588783', '2020-03-08 21:27:05.588783');
INSERT INTO `movie` VALUES ('26602900', '魔女', '　　该电影讲述了10年前在一起奇怪的事故中独自生还的失忆少女子允，在一对老夫妇的抚养下长大。为了贴补家用，子允参加了某档电视节目，但让她没想到的是，就在节目播出后，开始有各种奇怪的人出现在她面前……', '/static/upload/movie/2020-3-10/p2524056711.jpg', ' 韩国', '2018-06-27(韩国)', 5.3, '2020-03-08 21:28:45.906048', '2020-03-08 21:28:45.906048');
INSERT INTO `movie` VALUES ('26612258', '霹雳娇娃', '　　讲述了新一代火辣美女天使克里斯汀·斯图尔特、娜奥米·斯科特、埃拉·巴林斯卡霸气组队强势打击危险势力的故事。本片由好莱坞实力派导演及演员伊丽莎白·班克斯执导，高空跳伞、狂野飙车、拳脚肉搏、激燃枪战等惊险动作场面接连不断，肾上腺素飙升。三大天使特工技能高超，大玩变身诱惑上演温柔杀机。', '/static/upload/movie/2020-3-10/p2572654905.jpg', ' 美国', '2019-11-15(美国/中国大陆)', 1.2, '2020-03-08 21:28:03.706403', '2020-03-08 21:28:03.706403');
INSERT INTO `movie` VALUES ('26636712', '蚁人2：黄蜂女现身', '　　由于在“内战”中站到了美国队长一方，蚁人斯科特·朗（保罗·路德PaulRudd饰）遭到了FBI的禁足惩罚。眼看离真正的自由还有几天功夫，偏偏麻烦找上门来。原来初代蚁人汉克·皮姆（迈克尔·道格拉斯MichaelDouglas饰）通过研究发现，他的妻子黄蜂女（米歇尔·菲佛MichellePfeiffer饰）一定还活在量子领域，而斯科特是能够将妻子带回现实世界的唯一希望。不由分说，汉克的女儿霍普（伊万杰琳·莉莉NicoleLilly饰）将斯科特带出房间。此后不久，他们不仅要躲避FBI的纠缠，更要提防来自神秘势力的袭击，而“幽灵”的出现更将斯科特等人带向前所未有的混乱当中。', '/static/upload/movie/2020-3-10/p2529389608.jpg', ' 美国', '2018-08-24(中国大陆);2018-07-06(美国)', 7.4, '2020-03-08 21:27:51.680133', '2020-03-08 21:27:51.680133');
INSERT INTO `movie` VALUES ('26655962', '吹响悠风号剧场版：欢迎来到北宇治高中吹奏乐部', '　　重制了2015年4月到6月播出的电视动画《吹响悠风号》而出的剧场版。', '/static/upload/movie/2020-3-10/p2366784417.jpg', ' 日本', '2016-04-23(日本)', 5.6, '2020-03-08 21:27:10.664387', '2020-03-08 21:27:10.664387');
INSERT INTO `movie` VALUES ('26682565', '在西伯利亚森林中', '　　Pourassouvirunbesoindeliberté,Teddydécidedepartirloindubruitdumonde,ets’installeseuldansunecabane,surlesrivesgeléesdulacBaïkal.', '/static/upload/movie/2020-3-10/p2358629857.jpg', ' 法国', '2016-06-15', 1.3, '2020-03-08 21:25:46.255127', '2020-03-08 21:25:46.255127');
INSERT INTO `movie` VALUES ('26683290', '你的名字。', '　　在远离大都会的小山村，住着巫女世家出身的高中女孩宫水三叶（上白石萌音配音）。校园和家庭的原因本就让她充满烦恼，而近一段时间发生的奇怪事件，又让三叶摸不清头脑。不知从何时起，三叶在梦中就会变成一个住在东京的高中男孩。那里有陌生的同学和朋友，有亲切的前辈和繁华的街道，一切都是如此诱人而真实。另一方面，住在东京的高中男孩立花泷（神木隆之介配音）则总在梦里来到陌生的小山村，以女孩子的身份过着全新的生活。许是受那颗神秘彗星的影响，立花和三叶在梦中交换了身份。他们以他者的角度体验着对方的人生，这期间有愤怒、有欢笑也有暖心。只是两人并不知道，身份交换的背后隐藏着重大而锥心的秘密……', '/static/upload/movie/2020-3-10/p2395733377.jpg', ' 日本', '2016-12-02(中国大陆);2016-08-26(日本)', 9, '2020-03-08 21:28:53.184339', '2020-03-08 21:28:53.184339');
INSERT INTO `movie` VALUES ('26683421', '特工', '　　1990年代中期，暗号「黑金星」的南韩「国家安全企划部」情报员，假扮成南韩商人跟北韩进行商业交易，藉此渗透北韩军事单位，打探核开发情报，他得在最危险的地方，赢得敌方的信任，没想到一心只想完成任务的他，却在不自觉中陷入南北韩权力高层间的恐怖阴谋。', '/static/upload/movie/2020-3-10/p2528281606.jpg', ' 韩国', '2018-05-11(戛纳电影节);2018-08-08(韩国)', 1.1, '2020-03-08 21:28:47.292905', '2020-03-08 21:28:47.292905');
INSERT INTO `movie` VALUES ('26694988', '比海更深', '　　邋遢潦倒的中年大叔筱田良多（阿部宽饰）是一名私家侦探，早年间他作为作家出道，然而自从处女作之后就再也没有令人称道的作品问世。他满腹牢骚，自视清高，绝不愿为了钱去创作没有“灵魂”的作品。现实生活中处处为钱发愁，拿到钱后又转瞬扔进赌场，全然没有指望。母亲淑子（树木希林饰）独自住在团地，在老人家的眼里，再差劲的儿子也有别人无可比拟的优点。良多原本拥有美满的家庭，只不过前妻白石响子（真木阳子饰）再也无法忍受他的作为，离婚后带着儿子真吾（吉泽太阳饰）另外过活。好不容易与儿子见上一面，良多父子以及随后赶到的响子在淑子家中团聚。台风袭来，他们被迫留在充满着往昔回忆的奶奶家过夜。', '/static/upload/movie/2020-3-10/p2454274023.jpg', ' 日本', '2016-05-18(戛纳电影节);2016-05-21(日本)', 8.6, '2020-03-08 21:28:43.915313', '2020-03-08 21:28:43.915313');
INSERT INTO `movie` VALUES ('26698897', '唐人街探案2', '　　唐仁（王宝强饰）为巨额奖金欺骗秦风（刘昊然饰）到纽约参加世界名侦探大赛，然而随着和世界各国侦探们啼笑皆非的较量，两人却发现了隐藏在这次挑战背后的更大秘密...', '/static/upload/movie/2020-3-10/p2512717519.jpg', ' 中国大陆', '2018-02-16(中国大陆)', 9.3, '2020-03-08 21:28:51.247318', '2020-03-08 21:28:51.247318');
INSERT INTO `movie` VALUES ('26709258', '罗小黑战记', '　　在熙攘的人类世界里，很多妖精隐匿其中，他们与人类相安无事地生活着。猫妖罗小黑因为家园被破坏，开始了它的流浪之旅。这场旅途中惺惺相惜的妖精同类与和谐包容的人类伙伴相继出现，让小黑陷入了两难抉择，究竟何处才是真正的归属？', '/static/upload/movie/2020-3-10/p2568288336.jpg', ' 中国大陆', '2019-09-07(中国大陆);2019-08-27(大规模点映)', 4.7, '2020-03-08 21:27:43.255164', '2020-03-08 21:27:43.255164');
INSERT INTO `movie` VALUES ('26742730', '浪矢解忧杂货店', '　　2012年的一个夜晚，自幼在某孤儿院长大的敦也（山田凉介饰）、翔太（村上虹郎饰）和幸平（宽一郎饰）对某女企业家实施了抢劫，由于汽车意外抛锚，他们仓皇逃到了一家早已关张的杂货店内躲藏。这家名为浪矢杂货店的铺子此前由风趣和善的老人浪矢雄治（西田敏行饰）经营，数十年前他出于玩笑帮小朋友们解答各种困扰，后来名气越来越大，以至于有人专程向他咨询人生中的难题。本来从1980年就该沉寂的店铺，却在三人闯进来后收到了烦恼咨询信。随后敦也等人发现，这些信件竟然来自遥远的过去。神秘的夜晚，迷途青年执笔为他人排忧解难，他们的命运和这家解忧杂货店紧紧联系在了一起……', '/static/upload/movie/2020-3-10/p2511434383.jpg', ' 日本', '2018-02-02(中国大陆);2017-09-23(日本)', 7, '2020-03-08 21:28:43.739114', '2020-03-08 21:28:43.739114');
INSERT INTO `movie` VALUES ('26746733', '世界边界', '　　加斯帕德·尤利尔将携手杰拉尔·德帕迪约，出演纪洛姆·尼克乐关注印度支那战争的《世界边界》(Lesconfinsdumonde，暂译)。尼克乐将与杰罗米·博若尔对艾万·贝尔戈撰写的《CommandoVandenberghe:LePirateduDelta》进行改编。这也是尼克乐与德帕迪约继《爱之谷》、《终点》后，连续第三次合作。影片将于明年4月越南开机。', '/static/upload/movie/2020-3-10/p2555556799.jpg', ' 法国', '2018-05-10(戛纳电影节);2018-12-05(法国)', 6.4, '2020-03-08 21:28:50.859912', '2020-03-08 21:28:50.859912');
INSERT INTO `movie` VALUES ('26752088', '我不是药神', '　　普通中年男子程勇（徐峥饰）经营着一家保健品店，失意又失婚。不速之客吕受益（王传君饰）的到来，让他开辟了一条去印度买药做“代购”的新事业，虽然困难重重，但他在这条“买药之路”上发现了商机，一发不可收拾地做起了治疗慢粒白血病的印度仿制药独家代理商。赚钱的同时，他也认识了几个病患及家属，为救女儿被迫做舞女的思慧（谭卓饰）、说一口流利“神父腔”英语的刘牧师（杨新鸣饰），以及脾气暴烈的“黄毛”（章宇饰），几个人合伙做起了生意，利润倍增的同时也危机四伏。程勇昔日的小舅子曹警官（周一围饰）奉命调查仿制药的源头，假药贩子张长林（王砚辉饰）和瑞士正牌医药代表（李乃文饰）也对其虎视眈眈，生意逐渐变成了一场关于救赎的拉锯战。', '/static/upload/movie/2020-3-10/p2561305376.jpg', ' 中国大陆', '2018-07-05(中国大陆);2018-06-30(大规模点映)', 4.4, '2020-03-08 21:25:19.547755', '2020-03-08 21:25:19.547755');
INSERT INTO `movie` VALUES ('26754101', '克罗地亚宪法', '　　弗耶科（内博伊沙·格洛戈瓦茨NebojsaGlogovac饰）是一名高校教授，专门研究克罗地亚历史。在一场意外中，弗耶科身受重伤无奈住院，负责照料他的是一位名叫玛雅（克塞尼娅·马林科维奇KsenijaMarinkovic饰）的护士。在玛雅的精心照料下，弗耶科的身体情况渐渐好转，除了照顾他，玛雅还照顾着弗耶科生活不能自理的父亲。', '/static/upload/movie/2020-3-10/p2493755634.jpg', ' 克罗地亚 / 捷克 / 斯洛文尼亚 / 马其顿', '2016-09-03(蒙特利尔电影节);2016-10-06(克罗地亚)', 1.1, '2020-03-08 21:26:51.352368', '2020-03-08 21:26:51.352368');
INSERT INTO `movie` VALUES ('26786669', '决战中途岛', '　　电影讲述的是第二次世界大战太平洋战争重要转折点——中途岛海战：经此一役，日本海军受到“降维打击”，美日海上实力反转，从而扭转了整个太平洋战场的局势。影片通过参战士兵和飞行员一个个鲜活的故事，带领观众逐步进入1942年6月初发生在太平洋中途岛附近那场令人难以置信的战争……', '/static/upload/movie/2020-3-10/p2573582192.jpg', ' 中国大陆 / 美国', '2019-11-08(美国/中国大陆)', 4.3, '2020-03-08 21:26:27.625048', '2020-03-08 21:26:27.625048');
INSERT INTO `movie` VALUES ('26794435', '哪吒之魔童降世', '　　天地灵气孕育出一颗能量巨大的混元珠，元始天尊将混元珠提炼成灵珠和魔丸，灵珠投胎为人，助周伐纣时可堪大用；而魔丸则会诞出魔王，为祸人间。元始天尊启动了天劫咒语，3年后天雷将会降临，摧毁魔丸。太乙受命将灵珠托生于陈塘关李靖家的儿子哪吒身上。然而阴差阳错，灵珠和魔丸竟然被掉包。本应是灵珠英雄的哪吒却成了混世大魔王。调皮捣蛋顽劣不堪的哪吒却徒有一颗做英雄的心。然而面对众人对魔丸的误解和即将来临的天雷的降临，哪吒是否命中注定会立地成魔？他将何去何从？', '/static/upload/movie/2020-3-10/p2563780504.jpg', ' 中国大陆', '2019-07-26(中国大陆);2019-07-13(大规模点映)', 8.8, '2020-03-08 21:25:26.420658', '2020-03-08 21:25:26.420658');
INSERT INTO `movie` VALUES ('26840354', '我离家了，但……', '　　电影讲述一名失踪一个星期的13岁男孩，他受到父亲死亡触发，渴望在大自然的环境下与死亡和睦共处，但他的母亲与师长完全无法理解他的行为。电影于2017年秋季开机，而于2018年4月开始第二波拍摄，于6月杀青。', '/static/upload/movie/2020-3-10/p2547821591.jpg', ' 德国', '2019-02-12(柏林电影节)', 7.8, '2020-03-08 21:25:46.315775', '2020-03-08 21:25:46.315775');
INSERT INTO `movie` VALUES ('26842702', '燃烧', '　　目标成为作家的青年李钟秀（刘亚仁饰），平日里靠兼职养活自己。经营畜牧业的父亲不谙人情，官司缠身，迫使钟秀又要为了搭救父亲而四处奔走。这一日，钟秀在某大型卖场重逢了当年的同学申惠美（全钟淑饰）。惠美计划近期前往非洲旅行，于是拜托钟秀照看爱猫Boil。不久后惠美回国，与之一同下飞机的还有名叫本（史蒂文·元饰）的男子。本驾驶保时捷，居住在高级公寓内，优哉游哉，不见工作，四处玩乐，和钟秀相比有如天上地下。不知为何，本走入平民钟秀和惠美的生活，更向新朋友讲述了他奇特的癖好。在钟秀家小聚的那个晚上过后，惠美仿佛人间蒸发了一般无影无踪……', '/static/upload/movie/2020-3-10/p2520095279.jpg', ' 韩国', '2018-05-16(戛纳电影节);2018-05-17(韩国)', 8, '2020-03-08 21:26:55.824499', '2020-03-08 21:26:55.824499');
INSERT INTO `movie` VALUES ('26861685', '红海行动', '　　中东国家伊维亚共和国发生政变，武装冲突不断升级。刚刚在索马里执行完解救人质任务的海军护卫舰临沂号，受命前往伊维亚执行撤侨任务。舰长高云（张涵予饰）派出杨锐（张译饰）率领的蛟龙突击队登陆战区，护送华侨安全撤离。谁知恐怖组织扎卡却将撤侨部队逼入交火区，一场激烈的战斗在所难免。与此同时，法籍华人记者夏楠（海清饰）正在伊维亚追查威廉·柏森博士贩卖核原料的事实，而扎卡则突袭柏森博士所在的公司，意图抢走核原料。混战中，一名隶属柏森博士公司的中国员工成为人质。为了解救该人质，八名蛟龙队员必须潜入有150名恐怖分子的聚集点，他们用自己的信念和鲜血铸成中国军人顽强不屈的丰碑！', '/static/upload/movie/2020-3-10/p2514119443.jpg', ' 中国大陆 / 中国香港', '2018-02-16(中国大陆)', 3.4, '2020-03-08 21:26:14.829969', '2020-03-08 21:26:14.829969');
INSERT INTO `movie` VALUES ('26862259', '乘风破浪', '　　赛车手阿浪（邓超饰）一直对父亲（彭于晏饰）反对自己的赛车事业耿耿于怀，在向父亲证明自己的过程中，阿浪却意外卷入了一场奇妙的冒险。他在这段经历中结识了一群兄弟好友，一同闯过许多奇幻的经历，也对自己的身世有了更多的了解。', '/static/upload/movie/2020-3-10/p2408407697.jpg', ' 中国大陆', '2017-01-28(中国大陆)', 5.8, '2020-03-08 21:28:42.765206', '2020-03-08 21:28:42.765206');
INSERT INTO `movie` VALUES ('26862829', '芳华', '　　故事发生在上世纪七十年代，寄人篱下的少女何小萍（苗苗饰）经过重重试炼终于加入了梦寐以求的文工团，哪知道这里和她曾经待过的那些地方并无不同，她依然得忍受遭人唾弃和欺侮的生活。唯一给过她温暖的，是刘峰（黄轩饰），不仅仅是对何小萍，被称为“活雷锋”的刘峰把自己的爱情和温暖无私的奉献给每一个人。', '/static/upload/movie/2020-3-10/p2507227732.jpg', ' 中国大陆', '2017-12-15(中国大陆);2017-09-07(多伦多电影节)', 8.6, '2020-03-08 21:27:22.702388', '2020-03-08 21:27:22.702388');
INSERT INTO `movie` VALUES ('26863778', '铁雨', '　　原朝鲜侦察总局特工严铁雨(郑雨盛饰)受到征召前去位于朝韩边境的开城工业园区刺杀意图政变的朝鲜高官，不料却在开城遇袭，迫使他带着重伤昏迷的朝鲜最高领导人逃往韩国，局势突变，朝鲜半岛站在了核战争的边缘，中美日皆卷入乱局，他只能与韩国外交安全首席秘书郭哲宇(郭度沅饰)合作，将半岛从核战边缘拉回', '/static/upload/movie/2020-3-10/p2505050710.jpg', ' 韩国', '2017-12-14(韩国)', 8.3, '2020-03-08 21:28:42.696195', '2020-03-08 21:28:42.696195');
INSERT INTO `movie` VALUES ('26885074', '叶问4：完结篇', '　　因故来到美国唐人街的叶问，意外卷入一场当地军方势力与华人武馆的纠纷，面对日益猖狂的民族歧视与压迫，叶问挺身而出，在美国海军陆战队军营拼死一战，以正宗咏春，向世界证明了中国功夫。', '/static/upload/movie/2020-3-10/p2577437186.jpg', ' 中国香港', '2019-12-20(中国大陆)', 8.5, '2020-03-08 21:26:27.855371', '2020-03-08 21:26:27.855371');
INSERT INTO `movie` VALUES ('26885427', '伊凡王子与百变公主', '　　每天晚上，一个女孩、一个男孩和一个老电影放映员都会在一个小电影院碰头，这个小电影院看似被废弃了，可实际上却十分奇妙。三个朋友一起创作、绘图、变装，成为了神奇的故事中的主角。地球深处、东方边境，他们极尽想象之能事，扮演了各种公主和勇士：怪物之主、水手与猫、见习巫师和伊凡王子与百变公主。', '/static/upload/movie/2020-3-10/p2386783741.jpg', ' 法国', '2016-09-28(法国)', 1.3, '2020-03-08 21:26:55.777810', '2020-03-08 21:26:55.777810');
INSERT INTO `movie` VALUES ('26916229', '镰仓物语', '　　祖辈相传的民俗作家一色正和（堺雅人饰）与仰慕他的青年编辑亚纪子（高畑充希饰）结为夫妇，新婚燕尔，夫妇俩亲昵无间，携手返回一色的出生地镰仓。回到镰仓不久，单纯的亚纪子就被眼前走过的河童小人吓了一跳。原来镰仓自古是妖气很重的一座城市，妖怪、幽灵毫无忌惮，随意现身；而当地人也见怪不怪，与异类和平相处，分外融洽。开朗的亚纪子很快就适应了这种新生活，她接纳着丈夫的怪癖，见证着幽灵和人类的牵绊，甚至还把一尊贫穷之神接纳家中。', '/static/upload/movie/2020-3-10/p2532008868.jpg', ' 日本', '2018-09-14(中国大陆);2017-12-09(日本)', 3.8, '2020-03-08 21:28:43.689520', '2020-03-08 21:28:43.689520');
INSERT INTO `movie` VALUES ('26920178', '少女与战车 最终章 第1话', '　　在赌上学校存续的大学选拔队战役中胜利後，大洗女子学园战车道成员终於能好好享受和平悠闲的冬季。迎接三年级生毕业典礼的到来，包含学生会改选与新执行部门的动作，学校开始发生些微的变化。有一天，一场骚动来访少女们。为了下一波难题与困难，战车道成员们再次挺身而出迎接挑战。', '/static/upload/movie/2020-3-10/p2448043712.jpg', ' 日本', '2017-12-09(日本)', 8, '2020-03-08 21:27:51.715572', '2020-03-08 21:27:51.715572');
INSERT INTO `movie` VALUES ('26925317', '动物世界', '　　在游戏机厅做着兼职“小丑”的郑开司（李易峰饰），幼时父亲突然失踪，母亲重病住院，使得郑开司的生活非常拮据。发小“大虾米”（曹炳琨饰）借口买房骗下了郑开司父亲留下的房产，还给他带来了巨额的欠债。神秘人物（迈克尔·道格拉斯MichaelDouglas饰）出现，告诉郑开司，只要参加“命运号”游轮上的神秘游戏，就有机会偿还完所有欠款，一无所有的郑开司为了给青梅竹马的护士刘青（周冬雨饰）和母亲更好的生活，只得登上游轮，开始了生存游戏，一场以“剪刀、石头、布”展开的生死较量即将登场……', '/static/upload/movie/2020-3-10/p2525528688.jpg', ' 中国大陆', '2018-06-29(中国大陆)', 7.7, '2020-03-08 21:28:17.829125', '2020-03-08 21:28:17.829125');
INSERT INTO `movie` VALUES ('26931786', '蜘蛛侠：英雄远征', '　　在与灭霸史诗般的战争结束后，地球似乎暂时回归和平。皮特（汤姆·赫兰德TomHolland饰）回到了校园生活之中，他和好友相谈甚欢，并且有了心仪的女孩，然而内心最深处依然放不下对钢铁侠的追悼缅怀。去往欧洲游学的路上，皮特试图找机会和个性女孩米歇尔（赞达亚Zendaya饰）表白，谁知接连出现的元素怪兽打乱了他的表白计划。在这一过程中，与神盾局合作的神秘客（杰克·吉伦哈尔JakeGyllenhaal饰）挺身而出，击退怪兽。自感不堪大任的皮特谢绝了尼克·弗瑞（塞缪尔·杰克逊SamuelL.Jackson饰），情愿将钢铁侠继承者的重任交到神秘客手中。', '/static/upload/movie/2020-3-10/p2558293106.jpg', ' 美国', '2019-06-28(中国大陆);2019-07-02(美国)', 3.5, '2020-03-08 21:27:58.192745', '2020-03-08 21:27:58.192745');
INSERT INTO `movie` VALUES ('26945085', '昆池岩', '　　原名南营神经精神医院的昆池岩精神病院，最早建立于20世纪60年代。在特殊的时代它曾经历了无比的辉煌，然而更为人熟知的则是该医院身上所发生的各类恐怖事件。现如今，早已废弃的昆池岩医院被CNN票选为全球七大恐怖之地之一，更由此吸引无数寻求刺激的青年男女来此探险。三个月前，两名青少年来此探险，结果在直播中遭遇诡异事件，下落不明。此后，《恐怖世代》剧组在魏河俊的召集下，网罗了吴雅妍、朴智贤、夏洛特（文艺媛饰）、李丞旭、朴成勋、刘帝允等人前往昆池岩，更试图打开备受诅咒的402室。', '/static/upload/movie/2020-3-10/p2513360824.jpg', ' 韩国', '2018-03-28(韩国)', 6.9, '2020-03-08 21:28:39.835414', '2020-03-08 21:28:39.835414');
INSERT INTO `movie` VALUES ('26985127', '一出好戏', '　　马进欠下债务，与远房表弟小兴在底层社会摸爬滚打，习惯性的买彩票，企图一夜暴富，并迎娶自己的同事姗姗。一日，公司全体员工出海团建，途中，马进收到了彩票中头奖的信息，六千万！就在马进狂喜自己翻身的日子终于到来之际，一场突如其来的滔天巨浪打破了一切。苏醒过来的众人发现身处荒岛，丧失了一切与外界的联系……', '/static/upload/movie/2020-3-10/p2529571873.jpg', ' 中国大陆', '2018-08-10(中国大陆)', 6, '2020-03-08 21:28:52.230185', '2020-03-08 21:28:52.230185');
INSERT INTO `movie` VALUES ('26994755', '吹响悠风号剧场版：想要传达的旋律', '　　将会在全国大赛上出场的，是我们北宇治高校吹奏乐部。', '/static/upload/movie/2020-3-10/p2499628260.jpg', ' 日本', '2017-09-30(日本)', 7.8, '2020-03-08 21:25:55.923792', '2020-03-08 21:25:55.923792');
INSERT INTO `movie` VALUES ('27000061', '我能说', '　　热血老奶奶罗玉粉（罗文姬饰）性格耿直，爱打抱不平，多年来专注于举报社区里发生的不法行为的，被周围的人叫做“鬼怪奶奶”。她的“对手”是信访办新来的基层公务员朴民载（李帝勋饰）。二人吵吵闹闹未分胜负。某天，罗奶奶忽然“死皮赖脸”要求朴民载成为自己的英语老师。因为她有一个弟弟生长在美国，一句韩语也不懂，罗奶奶只有学会了英语，才能跟他交流。在学习过程中，朴民载与罗奶奶的感情变得越来越融洽。但是，民载得知罗奶奶的弟弟其实根本不想和她通话。在一次冲突中，他不小心对奶奶说出了实情。然而，这时候，罗奶奶有了更迫切的学习英语的理由，她要到美国，向全世界讲述自己做慰安妇的经历，迫使日本政府为践踏人伦的行为道歉。', '/static/upload/movie/2020-3-10/p2498433749.jpg', ' 韩国', '2017-09-21(韩国)', 5.2, '2020-03-08 21:28:42.718533', '2020-03-08 21:28:42.718533');
INSERT INTO `movie` VALUES ('27000084', '变身特工', '　　兰斯与沃尔特，前者是超级炫酷又迷人的间谍，后者负责发明兰斯使用的各种炫酷小道具。危难当头，他们必须团结一致才能拯救世界。', '/static/upload/movie/2020-3-10/p2577340942.jpg', ' 美国', '2020-01-03(中国大陆);2019-12-04(加州首映);2019-12-25(美国)', 4.5, '2020-03-08 21:27:58.156258', '2020-03-08 21:27:58.156258');
INSERT INTO `movie` VALUES ('27003543', '与神同行2：因与缘', '　　故事接上集，为了完成阎罗王（李政宰饰）开出的条件，解怨脈（朱智勋饰）与德春（金香起饰）与凶悍的城主神（马东锡饰）展开决斗。江林（河正宇饰）也力劝一等兵（都暻秀饰）公开秀鸿意外死亡的真相，就在阴间使者们试图完成任务的同时，千年前，他们生前的悲剧也将被逐一揭开…', '/static/upload/movie/2020-3-10/p2527205786.jpg', ' 韩国', '2018-08-01(韩国)', 2.7, '2020-03-08 21:28:38.719815', '2020-03-08 21:28:38.719815');
INSERT INTO `movie` VALUES ('27010768', '寄生虫', '　　基宇（崔宇植饰）出生在一个贫穷的家庭之中，和妹妹基婷（朴素丹饰）以及父母在狭窄的地下室里过着相依为命的日子。一天，基宇的同学上门拜访，他告诉基宇，自己在一个有钱人家里给他们的女儿做家教，太太是一个头脑简单出手又阔绰的女人，因为自己要出国留学，所以将家教的职位暂时转交给基宇。', '/static/upload/movie/2020-3-10/p2561439800.jpg', ' 韩国', '2019-05-21(戛纳电影节);2019-05-30(韩国)', 2.4, '2020-03-08 21:25:23.217004', '2020-03-08 21:25:23.217004');
INSERT INTO `movie` VALUES ('27018285', '现在去见你', '　　本片根据市川拓司小说《相约在雨季》改编，苏志燮和孙艺珍主演，讲述男子(苏志燮饰)的妻子秀雅(孙艺珍饰)去世前告诉他，自己将在下一个雨季回来。果不其然，雨季来临之际，妻子如约而至。可奇怪的是，妻子似乎忘记了他和家庭。', '/static/upload/movie/2020-3-10/p2515516851.jpg', ' 韩国', '2018-03-14(韩国)', 7.3, '2020-03-08 21:28:44.249801', '2020-03-08 21:28:44.249801');
INSERT INTO `movie` VALUES ('27038183', '羞羞的铁拳', '　　堕落沉沦的MMA选手艾迪生（艾伦饰）依靠打假拳度日，早已忘记昔日的雄心壮志。某次他和假拳掮客马东（田雨饰）商议打假赛的时候，不慎被正义感爆棚的体育记者马小（马丽饰）听到并录音。在追赶马丽的过程中，艾迪生和对方一同跌入游泳池，并遭到雷电的电击。当他们从医院醒来后，发现两人居然互换了身体。在所有复原的办法都失败后，艾迪生只能请求马小代替他去和拳王吴良（薛皓文饰）——同时也是马小的未婚夫——去打比赛。然而，娘娘的艾迪生和汉子力爆表的马小却闹出了一连串的笑话。', '/static/upload/movie/2020-3-10/p2499793218.jpg', ' 中国大陆', '2017-09-30(中国大陆)', 4.5, '2020-03-08 21:28:47.243333', '2020-03-08 21:28:47.243333');
INSERT INTO `movie` VALUES ('27040737', '祈祷落幕时', '　　位于东京都葛饰区的一座公寓内，一具高度腐烂的尸体被人发现。经警方初步查明，死者是来自滋贺县的押谷道子，她的死亡实属他杀。警视厅搜查一课刑警松宫（沟端淳平饰）调查发现，押谷此次上都是为了拜访并观看学生时代的好友浅居博美（松岛菜菜子饰）的舞台剧的。虽然浅居有充分的不在场证明，不过她和加贺恭一郎（阿部宽饰）的合影依然引起松宫的注意。与此同时，在道子遇害公寓的附近，一具焚烧后的尸体被人发现。现场的一件遗物令加贺激动万分，因为这与他多年未曾谋面的母亲有着千丝万缕的关系。两起案件，以及失踪的人，将浅居和加贺再度连接在一起……', '/static/upload/movie/2020-3-10/p2552073598.jpg', ' 日本', '2019-04-12(中国大陆);2018-01-27(日本)', 2.2, '2020-03-08 21:28:43.550518', '2020-03-08 21:28:43.550518');
INSERT INTO `movie` VALUES ('27042748', '腰间持枪', '　　故事讲述迈尔斯把生命耗在了毫无前途的工作上，然而他的生活却因意外发现的黑暗网站而有所改变。', '/static/upload/movie/2020-3-10/p2581966170.jpg', ' 英国 / 德国 / 新西兰', '2019-09-09(多伦多国际电影节);2020-02-28(美国)', 4.6, '2020-03-08 21:25:09.358641', '2020-03-08 21:25:09.358641');
INSERT INTO `movie` VALUES ('27046748', '信不信由你', '　　[爱乐之城]制片弗雷德·伯杰将打造一部黑色惊悚片[信不信由你](StrangebutTrue，暂译)。主演艾米·莱安、格雷戈·金尼尔；导演罗恩·阿塞尔([不毛之地])。影片改编自约翰·瑟列斯同名小说。女主在男友离世五年后将自己怀上已死男友孩子的消息告知对方家人，一个令人惊惧的故事就此引发。', '/static/upload/movie/2020-3-10/p2565481111.jpg', ' 加拿大', '2019-06-22(爱丁堡国际电影节);2019-09-06(美国)', 9.4, '2020-03-08 21:28:44.292101', '2020-03-08 21:28:44.292101');
INSERT INTO `movie` VALUES ('27060077', '绿皮书', '　　托尼（维果·莫腾森ViggoMortensen饰）是一个吊儿郎当游手好闲的混混，在一家夜总会做侍者。这间夜总会因故要停业几个月，可托尼所要支付的房租和生活费不会因此取消，所以他的当务之急是去寻找另一份工作来填补这几个月的空缺。在这个节骨眼上，一位名叫唐雪莉（马赫沙拉·阿里MahershalaAli饰）的黑人钢琴家提出雇佣托尼。', '/static/upload/movie/2020-3-10/p2549177902.jpg', ' 美国', '2019-03-01(中国大陆);2018-09-11(多伦多电影节);2018-11-16(美国)', 6.6, '2020-03-08 21:25:35.514281', '2020-03-08 21:25:35.514281');
INSERT INTO `movie` VALUES ('27075136', '最漂亮的一对', '　　有些回忆，愈想忘记，偏愈记起。教师夫妇在异国海滩一夕缠绵，引来三名好色之徒尾随入屋殴打强奸。回德国后致力重新开始，两年过去，罪犯竟在眼前出现，揭破生活回复正常的假象。恐惧、压抑、内疚的阴魂埋在心底从未消散，伤口二度剖开血流泻地。妻子不欲过去伤痛缠绕现在生活，选择宽恕；丈夫无法挥去屈辱与愤怒，一心报复。左右殊途，恩爱夫妻必须抉择：埋藏本相，继续自欺欺人；抑或放下自我，拥抱爱情重生？', '/static/upload/movie/2020-3-10/p2532538390.jpg', ' 德国 / 法国', '2018-09-09(多伦多电影节);2019-05-02(德国)', 4.9, '2020-03-08 21:28:51.132545', '2020-03-08 21:28:51.132545');
INSERT INTO `movie` VALUES ('27087724', '好莱坞往事', '　　故事在1969年瞬息万变的洛杉矶展开，在那个风起云涌的变革时代，嬉皮文化盛行，好莱坞大制片厂制度瓦解，新的好莱坞明星纷纷崛起。电视明星里克·道尔顿（莱昂纳多·迪卡普里奥LeonardoDiCaprio饰）与他长期合作替身搭档克里夫·布斯（布拉德·皮特BradPitt饰）如何在逐渐陌生的娱乐圈里，找到自己的一席之地。他们正力图扬名电影圈，却发现这个行业早已不是他们想象的样子了……这是昆汀自编自导第9部影片，汇集星光闪闪的卡司与交错的情节，纪念好莱坞不再复返的黄金年代。', '/static/upload/movie/2020-3-10/p2551119672.jpg', ' 美国 / 英国 / 中国大陆', '2019(中国大陆);2019-05-21(戛纳电影节);2019-07-26(美国)', 9.2, '2020-03-08 21:26:47.580913', '2020-03-08 21:26:47.580913');
INSERT INTO `movie` VALUES ('27089612', '纽约的一个雨天', '　　情迷巴塞隆拿、巴黎、罗马过后，伍迪艾伦始终最锺情老家纽约，一沾雨露回春。年轻情侣来到曼克顿度周末，可惜声色时光遇上滂沱大雨天，刚萌芽的爱情被洒得七零八落。女方得见偶像导演，更与父辈男星陷入三角恋爱；男方为好友执导的黑色电影习作担任男主角，半真半假与女星来个法式湿吻意乱情迷。知识分子的知性浪漫蜕变为嫩男少艾的躁动神经质，念念不忘续为曼克顿献上不老的情书。', '/static/upload/movie/2020-3-10/p2556824333.jpg', ' 美国', '2019-07-26(波兰)', 3.5, '2020-03-08 21:27:14.227417', '2020-03-08 21:27:14.227417');
INSERT INTO `movie` VALUES ('27107140', '我想吃掉你的胰脏', '　　“没有名字的我，没有未来的她”', '/static/upload/movie/2020-3-10/p2545571306.jpg', ' 日本', '2019-01-18(中国大陆);2018-09-01(日本)', 5.7, '2020-03-08 21:28:43.641979', '2020-03-08 21:28:43.641979');
INSERT INTO `movie` VALUES ('27107624', '代号基亚斯：反叛的鲁路修2之叛道', '　　以面具反叛者ZERO之身份增强反布里塔尼亚势力·黑色骑士团的鲁路修，与被任命为第3皇女尤菲米娅之骑士的朱雀。各自增强实力的两人，迎来了命运的转机。身为11区副总督的尤菲米娅，宣布了行政特区“日本”的成立。行政特区日本的实现，意味着黑色骑士团存在意义的消失。为了打破这一状况，鲁路修尝试与尤菲米娅会面。为了所要守护之物而做好的觉悟。GEASS的代价。一缕希望与悠久野望一同遭到翻弄，使悲剧逐渐加速——', '/static/upload/movie/2020-3-10/p2506841097.jpg', ' 日本', '2018-02-10(日本)', 1.8, '2020-03-08 21:28:40.941249', '2020-03-08 21:28:40.941249');
INSERT INTO `movie` VALUES ('27107625', '代号基亚斯：反叛的鲁路修3之皇道', '　　总集篇剧情有改动承接明年2月复活新作', '/static/upload/movie/2020-3-10/p2517193540.jpg', ' 日本', '2018-05-26(日本)', 1.8, '2020-03-08 21:27:14.418280', '2020-03-08 21:27:14.418280');
INSERT INTO `movie` VALUES ('27107766', '维塔利娜·瓦雷拉', '　　薇塔莉娜经过漫长的等待，总算盼到一张从非洲维德角到里斯本的机票，然而迎接她的并非丈夫允诺的美好未来，而是天人永隔的哀伤，以及迷雾般的身后事。两人上次见面已经是多年前，期间渺无音讯，谣言说丈夫卷入了肮脏阴暗的利益纠纷，却没人知道他究竟发生了什么事。伤心的薇塔莉娜寡居在丈夫生前的幽窄小屋中，独自在暗夜的巷弄间徘徊，循着渺茫的线索踽踽前行，在梦回时分熬过那一个个痛苦孤绝的夜晚，探向晦暗未明阴影后的救赎。', '/static/upload/movie/2020-3-10/p2575370579.jpg', ' 葡萄牙', '2019-08-16(洛迦诺电影节)', 9, '2020-03-08 21:28:47.657248', '2020-03-08 21:28:47.657248');
INSERT INTO `movie` VALUES ('27110296', '无名之辈', '　　来自乡村的笨贼眼镜（章宇饰）和大头（潘斌龙饰）抢了一家手机店，慌乱之中逃进坐着轮椅的单身女子嘉旗（任素汐饰）的家中。嘉旗早已失去活着的欲望，她强横地要求俩笨贼杀死自己。另一边，某楼盘老板资金链断裂跑路，留下保安马先勇（陈建斌饰）与讨债者周旋。马曾经是立功无数的协警，可就在转正的关头因为一场车祸毁了原本看似美好的一切。不久前他挖到一把喷子，原本打算交给当初的警察好友立功，却发现喷子被换成了水枪。而成为了新闻的手机抢劫案，让马先勇意识到喷子正在劫匪的手上。', '/static/upload/movie/2020-3-10/p2539661066.jpg', ' 中国大陆', '2018-11-16(中国大陆)', 7.3, '2020-03-08 21:28:52.340690', '2020-03-08 21:28:52.340690');
INSERT INTO `movie` VALUES ('27110363', '名侦探柯南：零的执行人', '　　东京峰会召开在即，为了确保会议顺利进行，日本警方出动约两万名警力对位于东京湾的超大设施“海洋边缘”进行安保工作。可就在严密的防控下，此地已然发生了爆炸案。令柯南（高山南配音）等人始料未及的是，现场居然留下了对毛利小五郎（小山力也配音）极其不利的证据。在此之后，小五郎遭到逮捕。柯南则发现安室透曾出现在爆炸现场，并且负了伤。为了还毛利叔叔的清白，柯南和阿笠博士以及少年侦探团的小伙伴们联合起来勘察现场，搜集证据。随着调查的深入，柯南发现这起爆炸案隐藏着包括恐怖分子、公安在内多方的复杂关系，而真相更令所有人瞠目结舌……', '/static/upload/movie/2020-3-10/p2537694239.jpg', ' 日本', '2018-11-09(中国大陆);2018-04-13(日本)', 1.6, '2020-03-08 21:28:30.536596', '2020-03-08 21:28:30.536596');
INSERT INTO `movie` VALUES ('27119724', '小丑', '　　湿冷无望的哥谭市，卑微的亚瑟·弗兰克（华金·菲尼克斯JoaquinPhoenix饰）依靠扮演小丑赚取营生。与之相依为命的母亲患有精神疾病，而亚瑟深记母亲的教诲，无论遭受怎样的挫折都笑对人生，却因此让自己背负着莫大的压力，濒临崩溃。他梦想成为一名脱口秀演员，怎奈生活一次次将失望狠狠地砸在他的头上。不仅如此，他因意外丢掉了工作，偶然瞥见母亲的秘密，又使他心中燃起对那个与之地位悬殊却从未谋面的父亲的殷切渴望。命运习惯了事与愿违，空荡荡的地铁内，悲伤的小丑在无法自已的癫狂笑声中大开杀戒……', '/static/upload/movie/2020-3-10/p2567198874.jpg', ' 美国 / 加拿大', '2019-08-31(威尼斯电影节);2019-10-04(美国)', 4.5, '2020-03-08 21:25:38.797506', '2020-03-08 21:25:38.797506');
INSERT INTO `movie` VALUES ('27133303', '超时空同居', '　　生活在2018年的大龄女青年谷小焦（佟丽娅饰），梦想能够嫁一个能买得起她幼时豪宅的有钱人，却屡屡受挫，只能蜗居在一栋老居民楼里。生活在1999年的陆鸣（雷佳音饰）手握着自己设计的宏伟蓝图，却始终找不到投资人，同时也面临重大的事业危机。奇怪的时刻来临了，失意的两个人回到家中居然发生了惊人的一幕，同一扇门关上后居然是两个时空的交汇点，两个不同时空的人相遇了，为了拯救自己的未来，两人共商大计，开启了幻想一夜暴富的一系列措施，引发了啼笑皆非的连锁反应。而他们不知道的是，两个时空的重叠是人为的操控，他们每走一步都会引发不可预知的结果，更要命的事，本来只是视对方为赚钱拍档的两人引发了爱的火花……', '/static/upload/movie/2020-3-10/p2520331478.jpg', ' 中国大陆', '2018-05-18(中国大陆)', 6.7, '2020-03-08 21:28:44.528958', '2020-03-08 21:28:44.528958');
INSERT INTO `movie` VALUES ('27166442', '夏目友人帐', '　　在人与妖怪之间过着忙碌日子的夏目，偶然与以前的同学结城重逢，由此回忆起了被妖怪缠身的苦涩记忆。此时，夏目认识了在归还名字的妖怪记忆中出现的女性·津村容莉枝。和玲子相识的她，现在和独子椋雄一同过着平稳的生活。夏目通过与他们的交流，心境也变得平和。但这对母子居住的城镇，却似乎潜伏着神秘的妖怪。在调查此事归来后，寄生于猫咪老师身体的“妖之种”，在藤原家的庭院中，一夜之间就长成树结出果实。而吃掉了与自己形状相似果实的猫咪老师，竟然分裂成了3个——！？', '/static/upload/movie/2020-3-10/p2546745948.jpg', ' 日本', '2019-03-07(中国大陆);2018-09-29(日本)', 4.4, '2020-03-08 21:27:22.726242', '2020-03-08 21:27:22.726242');
INSERT INTO `movie` VALUES ('27179205', '女清洁工', '　　Asameanstodistractherselffromanaffair,alove-addictedwomanbefriendsacleaninglady,badlyscarredbyburns.Shesoonlearns,thesescarsrunmuchdeeperthanthesurface.', '/static/upload/movie/2020-3-10/p2530266524.jpg', ' 美国', '2018-08-24(恐怖电影节);2018-09-15(美国)', 8.1, '2020-03-08 21:28:40.047984', '2020-03-08 21:28:40.047984');
INSERT INTO `movie` VALUES ('27202818', '婚姻故事', '　　讲述了结婚多年并育有一子的戏剧导演查理和女演员妮可因工作分居而不得不走向离婚，在这场为了争夺抚养权的离婚拉锯战中，关于爱情、婚姻和家庭真实感人的细枝末节牵动人心。两人的关系又将何去何从？', '/static/upload/movie/2020-3-10/p2571760178.jpg', ' 英国 / 美国', '2020(中国大陆);2019-08-29(威尼斯电影节);2019-12-06(美国)', 1.1, '2020-03-08 21:26:06.496459', '2020-03-08 21:26:06.496459');
INSERT INTO `movie` VALUES ('27597250', '极限职业', '　　一支由5位掉漆警探组成的缉毒小组，因办事不力被长官钉得满头包，成天埋伏在毒贩巢穴对面的炸鸡店中监视，案情也毫无进展。既然每天都得待在炸鸡店，不如动手卖起炸鸡，看似无厘头的决定，竟让鲁蛇警探们意外找到事业第二春，卖到吓吓叫的神级美味炸鸡，让餐厅一夕爆红，订单电话接到手软！副业做太大的警探们有办法达成使命吗？对面的毒贩又是否会闻香而来呢？', '/static/upload/movie/2020-3-10/p2542216607.jpg', ' 韩国', '2019-01-23(韩国)', 8.8, '2020-03-08 21:28:47.114715', '2020-03-08 21:28:47.114715');
INSERT INTO `movie` VALUES ('27605696', 'Goodbye 以谎言开端的人生喜剧', '　　故事改编自太宰治未完成遗作小说，讲述了拥有好几个情妇的文艺杂志主编田岛周二为了和她们分手，希望贪恋钱财的永井キヌ子假扮他的妻子。这对“假夫妇”将上演什么样的故事呢~', '/static/upload/movie/2020-3-10/p2575439681.jpg', ' 日本', '2019-12-21(上海日本新片展);2020-02-14(日本)', 7.8, '2020-03-08 21:28:47.328220', '2020-03-08 21:28:47.328220');
INSERT INTO `movie` VALUES ('27605698', '西虹市首富', '　　西虹市丙级球队大翔队的守门员王多鱼（沈腾饰）因比赛失利被教练开除，一筹莫展之际王多鱼突然收到神秘人士金老板（张晨光饰）的邀请，被告知自己竟然是保险大亨王老太爷（李立群饰）的唯一继承人，遗产高达百亿！但是王老太爷给出了一个非常奇葩的条件，那就是要求王多鱼在一个月内花光十亿，还不能告诉身边人，否则失去继承权。王多鱼毫不犹豫签下了“军令状”，与好友庄强（张一鸣饰）以及财务夏竹（宋芸桦饰）一起开启了“挥金之旅”，即将成为西虹市首富的王多鱼，第一次感受到了做富人的快乐，同时也发现想要挥金如土实在没有那么简单！', '/static/upload/movie/2020-3-10/p2529206747.jpg', ' 中国大陆', '2018-07-27(中国大陆)', 7.7, '2020-03-08 21:28:52.950647', '2020-03-08 21:28:52.950647');
INSERT INTO `movie` VALUES ('27622447', '小偷家族', '　　东京的都市丛林中央，残存着一栋古旧寒酸的老房子，这里局促地生活着柴田一家五口人。在工地当临时工的男人阿治（LilyFranky饰）经常带着儿子祥太（城桧吏饰）到超市盗窃生活用品，这一天，他们回家路上遇到了独自待在户外的四岁女孩由里（佐佐木美结饰）。妻子信代（安藤樱饰）起初极力主张将女孩送回父母身边，但当看到女孩原生家庭的状况时又心生恻隐。原本柴田家就靠着老奶奶初枝（树木希林饰）的养老金度日，而今多了一口人，自然更艰辛了几分。包括信代的妹妹亚纪（松冈茉优饰）在内，虽然一家人游走在贫困和违法的边缘，但笃深的羁绊将他们紧紧联系在一起，使他们的心不会随着冰冷的都市而寒冷下去……', '/static/upload/movie/2020-3-10/p2530599636.jpg', ' 日本', '2018-08-03(中国大陆);2018-05-13(戛纳电影节);2018-06-08(日本)', 8.6, '2020-03-08 21:28:52.878572', '2020-03-08 21:28:52.878572');
INSERT INTO `movie` VALUES ('27668250', '南方车站的聚会', '　　南方某城市，重案队长刘队（廖凡饰）重金悬赏在逃罪犯周泽农（胡歌饰）。陪泳女刘爱爱（桂纶镁饰）、周泽农曾经的好友华华（奇道饰）、五年未见的妻子杨淑俊（万茜饰），各色人等各怀心事，相继被卷入这场罪与罚的追击旋涡。冒险与爱情，人性与救赎，这场特别的“聚会”该如何收场？善恶有道一念之间。', '/static/upload/movie/2020-3-10/p2574278284.jpg', ' 中国大陆 / 法国', '2019-12-06(中国大陆);2019-05-18(戛纳电影节)', 8.3, '2020-03-08 21:26:42.095276', '2020-03-08 21:26:42.095276');
INSERT INTO `movie` VALUES ('3006309', '追击者', '　　深夜的首尔街头，出租车上频频被插上写有电话的应召女郎的卡片。前刑警忠浩（金允石Yun-seokKim饰）手下就有着一批应召女郎，表面粗暴野蛮的他，对姐妹们貌似毫不讲理。最近忠浩手下的姐妹频频发生失踪事件，他认为是有人故意把她们拐卖。暴跳如雷的他猛翻登记簿寻找蛛丝马迹，最后确定了一个嫌疑电话尾数为4885。正好这个电话这时呼入需要应召女郎。忠浩让美珍（徐英姬Yeong-hieSeo饰）前去。', '/static/upload/movie/2020-3-10/p2496896804.jpg', ' 韩国', '2008-02-14(韩国)', 7.7, '2020-03-08 21:27:58.403972', '2020-03-08 21:27:58.403972');
INSERT INTO `movie` VALUES ('3011091', '忠犬八公的故事', '　　八公（Forest饰）是一条谜一样的犬，因为没有人知道它从哪里来。教授帕克（理查·基尔RichardGere饰）在小镇的火车站拣到一只走失的小狗，冥冥中似乎注定小狗和帕克教授有着某种缘分，帕克一抱起这只小狗就再也放不下来，最终，帕克对小狗八公的疼爱感化了起初极力反对养狗的妻子卡特（琼·艾伦JoanAllen饰）。八公在帕克的呵护下慢慢长大，帕克上班时八公会一直把他送到车站，下班时八公也会早早便爬在车站等候，八公的忠诚让小镇的人家对它更加疼爱。有一天，八公在帕克要上班时表现异常，居然玩起了以往从来不会的捡球游戏，八公的表现让帕克非常满意，可是就是在那天，帕克因病去世。帕克的妻子、女儿安迪（萨拉·罗默尔SarahRoemer饰）及女婿迈克尔（罗比·萨布莱特RobbieSublett饰）怀着无比沉痛的心情埋葬了帕克，可是不明就里的...', '/static/upload/movie/2020-3-10/p524964016.jpg', ' 美国 / 英国', '2009-06-13(西雅图电影节);2010-03-12(英国)', 3.8, '2020-03-08 21:26:06.689995', '2020-03-08 21:26:06.689995');
INSERT INTO `movie` VALUES ('30128985', '勇敢者游戏2：再战巅峰', '　　四名勇敢者再次穿越回到险象环生的游戏世界中，开启全新冒险。与上次不同的是，变身勇石博士(道恩·强森饰)的是斯潘瑟的外公，外公的好友则变身为语言学家(凯文·哈特饰)，高大威猛的弗里奇变成了中年发福地质学家(杰克·布莱克饰)，只有学霸玛莎依旧化身性感打女(凯伦·吉兰饰)，斯潘瑟和贝瑟尼却不知所踪。为营救消失的伙伴，四人必须进入全面失控的未知世界，面对难度爆表危险重重的致命关卡，强森领队挑战极限玩命闯关。山崩石裂的险境中命悬一线，与突如其来的凶猛野兽死战到底，他们唯有绷紧神经并肩作战，才能通过生死考验逃出生天。一场惊险刺激又充满惊喜的冒险之旅即将展开！', '/static/upload/movie/2020-3-10/p2575911093.jpg', ' 美国', '2019-12-06(中国大陆);2019-12-13(美国)', 9.5, '2020-03-08 21:27:00.503705', '2020-03-08 21:27:00.503705');
INSERT INTO `movie` VALUES ('30135942', '默片解说员', '　　本片讲述的是在约一百年前的大正时期，想要成为无声电影解说者的青年与渴望成为演员的女孩之间发生在小小电影院里的爱情故事。', '/static/upload/movie/2020-3-10/p2571079312.jpg', ' 日本', '2019-10-04(釜山电影节);2019-12-13(日本)', 2.6, '2020-03-08 21:26:37.441634', '2020-03-08 21:26:37.441634');
INSERT INTO `movie` VALUES ('30142414', '夜班服务员', '　　患有自闭症的酒店夜班服务员巴特(泰伊·谢里丹饰)为提高社交能力，他利用监控纪录客人一举一动。某天一名女客人被杀害后，警方开始怀疑他。然而杀手还在行动，他既要面对警方又要找到真凶。', '/static/upload/movie/2020-3-10/p2581003002.jpg', ' 美国', '2020-02-21(美国)', 8.5, '2020-03-08 21:27:22.676454', '2020-03-08 21:27:22.676454');
INSERT INTO `movie` VALUES ('30143333', '我的一级兄弟', '　　申河均、李光洙将加盟喜剧温情片[我的一级兄弟]，该片由陆相孝执导，讲述肢体残疾一级的男子(申河均饰)与精神障碍一级的男子(李光洙饰)相遇后发生的故事。影片计划5月初开拍。', '/static/upload/movie/2020-3-10/p2548467439.jpg', ' 韩国', '2019-05-01(韩国)', 9.5, '2020-03-08 21:28:30.513196', '2020-03-08 21:28:30.513196');
INSERT INTO `movie` VALUES ('30143761', '至寒竞赛', '　　在华沙，正在举办一场国际象棋大赛，JoshMansky这位前世界冠军被卷入了世界上最强的两股军事力量的冲突之中，而这场国际象棋大赛正在变得越发的重要。', '/static/upload/movie/2020-3-10/p2569119014.jpg', ' 波兰', '2019-11-08(波兰)', 3.6, '2020-03-08 21:28:44.751175', '2020-03-08 21:28:44.751175');
INSERT INTO `movie` VALUES ('30151984', '渔枪', '　　WhenhisgirlfriendSashaandbestfriendEliasgivehotheadRichardaharpoonforhisbirthday,hewantstotrythisnewtoyoutrightaway.Sothethreeofthemsetoutforadaytriponaboat,butsuspicionandjealousysoonstarttogettheupperhand.Beforelong,thetensionhasbecomeunbearable.Tomakemattersworse,theboat’senginefailsandthenitturnsoutthey...', '/static/upload/movie/2020-3-10/p2553723564.jpg', ' 加拿大', '2019-01-24(鹿特丹国际电影节)', 2.5, '2020-03-08 21:27:33.058349', '2020-03-08 21:27:33.058349');
INSERT INTO `movie` VALUES ('30152072', '安尼亚拉号', '　　阿尼亚拉是众多宇宙飞船中的一艘，用于将地球人口运送到他们的新家园火星。但就在安妮亚拉离开被毁坏的地球时，她与一颗小行星相撞，并被击落。安妮亚拉的乘客慢慢意识到，他们永远也回不去了；他们将永远在一个空旷寒冷的宇宙中继续前行。瑞典诺贝尔奖得主哈里·马丁森在1956年写了《安妮拉》。这部小说被翻译成多种语言，包括丹麦语、芬兰语、英语、俄语、捷克语、阿拉伯语、日语和最近的中文。它曾作为歌剧和几部戏剧作品上演，但从未被拍摄过。在安尼亚拉走向毁灭的无情旅程中，有一个警告是不够强调的。只有一个地球。我们只有一次生命。因此，我们必须对自己的行为负责，不断地保护我们的环境和人类。如果我们不这样做，地球很快就会变成。。。', '/static/upload/movie/2020-3-10/p2549882330.jpg', ' 瑞典 / 丹麦', '2018-09-07(多伦多电影节);2019-02-01(瑞典)', 5.4, '2020-03-08 21:27:14.474835', '2020-03-08 21:27:14.474835');
INSERT INTO `movie` VALUES ('30155101', '克莱拉', '　　本片讲述天文学家伊萨克深信宇宙是个寂静黑暗之地，除了外太空之外，对生活中其他事物缺乏热情。直到伊萨克遇到了艺术家克莱拉，克莱拉点燃了他的激情，他才发现人与人之间的探索也很迷人...', '/static/upload/movie/2020-3-10/p2529776297.jpg', ' 加拿大', '2018-09-10(多伦多电影节)', 7.7, '2020-03-08 21:28:41.124827', '2020-03-08 21:28:41.124827');
INSERT INTO `movie` VALUES ('30160393', '哈莉·奎因：猛禽小队', '　　你听过一个有关警察、歌手、神经病和黑手党公主的故事吗？《猛禽小队和哈莉·奎茵》是一个只有哈莉·奎茵本人才能讲出来的超乎寻常的奇妙传奇。哥谭市最为凶残自大的恶棍罗曼·赛恩尼斯和他狂热的手下萨斯为了寻找一个年轻女孩卡斯，将这座城市翻了个底朝天。哈莉、女猎手、黑金丝雀和蕾妮·蒙托亚不期而遇，看似违和的四人组不得不团结一致、携手作战，才有可能打败罗曼。', '/static/upload/movie/2020-3-10/p2575974437.jpg', ' 美国', '2020-02-07(美国)', 7.1, '2020-03-08 21:26:37.176330', '2020-03-08 21:26:37.176330');
INSERT INTO `movie` VALUES ('30163509', '飞驰人生', '　　曾经叱咤风云的拉力赛车手张驰（沈腾饰），五年前因私自赛车而被禁赛。从天堂跌落谷底，张驰饱尝生活的艰辛。他忍辱负重，洗心革面，终于争取到了解禁的判决。在此之后，他重新找到亲如兄弟的领航员孙宇强（尹正饰），决心共同冲击本年度的巴音布鲁克拉力赛。然而在此之前，张驰必须重考驾照，改装赛车，拉到赞助。每一步都充满艰难，他忍受着旁人的奚落嘲讽，忍受着现实的冰冷残酷，无论如何都不改变前进的目标。当他好不容易走到了赛场，还将面对禁赛这几年崛起的新秀林臻东（黄景瑜饰）的挑战。', '/static/upload/movie/2020-3-10/p2542973862.jpg', ' 中国大陆', '2019-02-05(中国大陆)', 5.8, '2020-03-08 21:28:52.385937', '2020-03-08 21:28:52.385937');
INSERT INTO `movie` VALUES ('30166972', '少年的你', '　　陈念（周冬雨饰）是一名即将参加高考的高三学生，同校女生胡晓蝶（张艺凡饰）的跳楼自杀让她的生活陷入了困顿之中。胡晓蝶死后，陈念遭到了以魏莱（周也饰）为首的三人组的霸凌，魏莱虽然表面上看来是乖巧的优等生，实际上却心思毒辣，胡晓蝶的死和她有着千丝万缕的联系。', '/static/upload/movie/2020-3-10/p2572166063.jpg', ' 中国大陆', '2019-10-25(中国大陆)', 1.4, '2020-03-08 21:28:53.025815', '2020-03-08 21:28:53.025815');
INSERT INTO `movie` VALUES ('30170448', '何以为家', '　　法庭上，十二岁的男孩赞恩向法官状告他的亲生父母，原因是，他们给了他生命。是什么样的经历让一个孩子做出如此不可思议的举动？故事中，赞恩的父母在无力抚养和教育的状况下依然不停生育，作为家中的长子赞恩，弱小的肩膀承担了无数生活的重压。当妹妹被强行卖给商贩为妻时，赞恩愤怒离家，之后遇到一对没有合法身份的母子，相互扶持勉强生活。然而生活并没有眷顾赞恩，重重磨难迫使他做出了令人震惊的举动……', '/static/upload/movie/2020-3-10/p2555295759.jpg', ' 黎巴嫩 / 法国 / 美国', '2019-04-29(中国大陆);2018-05-17(戛纳电影节);2018-09-20(黎巴嫩)', 9.2, '2020-03-08 21:27:52.003700', '2020-03-08 21:27:52.003700');
INSERT INTO `movie` VALUES ('30170546', '乔乔的异想世界', '　　二战时期，男孩乔乔(戴维斯)和母亲(斯嘉丽)生活在纳粹德国统治下，他不知道母亲在家中藏着一个犹太女孩(麦肯齐)，而母亲秘密为抵抗军工作。乔乔渴望加入希特勒青年团，他脑内出了一个颠覆版的希特勒，这个希特勒有魅力、傻傻的、天真可爱，是他的朋友，帮助他应付生活中的困境。', '/static/upload/movie/2020-3-10/p2567973073.jpg', ' 美国 / 捷克 / 新西兰', '2020(中国大陆);2019-09-08(多伦多电影节);2019-11-08(美国)', 3.9, '2020-03-08 21:25:35.444985', '2020-03-08 21:25:35.444985');
INSERT INTO `movie` VALUES ('30185523', '小戏骨黄飞鸿', '　　清朝末年，朝廷外忧内患，急需聚集民心，激发人们的爱国热情拥护朝廷。慈禧太后为了宣扬国威、鼓励习武之风，在李鸿章的提议下决定举办一场举世瞩目的狮王争霸赛。黄飞鸿携十三姨、徒弟梁宽进京与父亲黄麒英相叙，并协助开办“宝芝林药厂”事宜。在马家堡车站与黄飞鸿同行的十三姨遇见了老同学俄国人杜文奇，他表面在领事馆做翻译，实际上是一名间谍。后得知俄国人欲刺杀李鸿章，民族大义在前，毅然参加狮王大会，并成功救下李鸿章并说明治国策略的故事。', '/static/upload/movie/2020-3-10/p2574936935.jpg', ' 中国大陆', '2019-11-20(中国大陆)', 8.8, '2020-03-08 21:28:51.220026', '2020-03-08 21:28:51.220026');
INSERT INTO `movie` VALUES ('30188253', '珍品', '　　1895年，巴黎。皮埃尔是一个处于成名边缘的巴黎花花公子和诗人。他和他的诗人朋友亨利都疯狂地爱上了他们的导师、法国-古巴若瑟-马里亚·德·埃雷迪亚的女儿：玛丽。玛丽虽然爱皮埃尔，却嫁给亨利，以偿还她父亲的债务，并寻求一个更好的社会地位。于是皮埃尔决定逃到阿尔及利亚，在那里遇到了zohar，并在两年后和她一起回到巴黎。他再次找到了玛丽，展开了一场猫捉老鼠的游戏。', '/static/upload/movie/2020-3-10/p2550530631.jpg', ' 法国', '2019-04-03(法国)', 7.1, '2020-03-08 21:26:11.266106', '2020-03-08 21:26:11.266106');
INSERT INTO `movie` VALUES ('30196805', '两只老虎', '　　低配绑匪遇上了极品人质，威逼不成，反被人质利诱，替人质办了三件事的荒诞喜剧。', '/static/upload/movie/2020-3-10/p2574713609.jpg', ' 中国大陆', '2019-11-29(中国大陆)', 1.9, '2020-03-08 21:27:51.632856', '2020-03-08 21:27:51.632856');
INSERT INTO `movie` VALUES ('30207776', '女初中生A', '　　该片根据同名网络人气漫画改编，讲述了存在被排斥、家庭暴力、游戏中毒、厌女症等社会问题的中学生逐渐开始与社会接触，并学习如何与人相处的故事。', '/static/upload/movie/2020-3-10/p2521615081.jpg', ' 韩国', '2018-06-20(韩国)', 5.6, '2020-03-08 21:25:46.285083', '2020-03-08 21:25:46.285083');
INSERT INTO `movie` VALUES ('30208010', '名侦探柯南：绀青之拳', '　　“名侦探柯南系列”第23部动画剧场版，票房和口碑也屡破纪录。作为平成年代最后一部柯南电影，首次将案件发生地设立在海外，基德时隔四年后再度回归，与柯南合体展开行动。', '/static/upload/movie/2020-3-10/p2566225091.jpg', ' 日本', '2019-09-13(中国大陆);2019-04-12(日本)', 7.9, '2020-03-08 21:28:45.854983', '2020-03-08 21:28:45.854983');
INSERT INTO `movie` VALUES ('30209084', '对不起，我们错过了你', '　　英国巨匠肯·洛奇一生用镜头为底层呐喊，这位英国巨匠的新片《对不起，我们错过了你》依然关注底层生活，电影讲述一个潦倒的送货司机和他妻子，只能找一些零工或者午夜倒班的工作勉强度日，因为找不到稳定工作被逼到了崩溃的边缘。影片主要角色全部启用非职业演员，是今年最值得期待的现实主义电影之一。', '/static/upload/movie/2020-3-10/p2572138412.jpg', ' 英国 / 法国 / 比利时', '2019-05-16(戛纳电影节);2019-11-01(英国)', 4.7, '2020-03-08 21:27:05.544597', '2020-03-08 21:27:05.544597');
INSERT INTO `movie` VALUES ('30210691', '极限逃生', '　　电影<EXIT>讲述的是青年无业游民龙南(曹政奭饰)在母亲七十大寿宴会上偶遇大学时期社团学妹仪珠(林允儿饰)并和她和一起逃出被来源不明的有毒气体覆盖的都市的故事，是一部新型的灾难动作片。', '/static/upload/movie/2020-3-10/p2559890156.jpg', ' 韩国', '2019-07-31(韩国)', 6.6, '2020-03-08 21:28:47.683244', '2020-03-08 21:28:47.683244');
INSERT INTO `movie` VALUES ('30211551', '恶人传', '　　罪犯头目张东洙（DonLee）被一名神秘莫测的连环杀手暴力袭击之后幸存，与当地警探郑泰硕（KimMooYul）形成了一种奇妙的搭档关系，联手捕捉被称为“K”的虐待狂杀手”。', '/static/upload/movie/2020-3-10/p2555084871.jpg', ' 韩国', '2019-05-15(韩国)', 4.2, '2020-03-08 21:26:37.481017', '2020-03-08 21:26:37.481017');
INSERT INTO `movie` VALUES ('30225296', '柳烈的音乐专辑', '　　该片讲述IMF时期大学毕业那一代年轻人和当时人们的故事。', '/static/upload/movie/2020-3-10/p2561996109.jpg', ' 韩国', '2019-08-28(韩国)', 6, '2020-03-08 21:28:41.086163', '2020-03-08 21:28:41.086163');
INSERT INTO `movie` VALUES ('30230132', '小小恋歌', '　　在日本的南端的冲绳，一群生活在小镇上的高中生们，因为热爱音乐将他们紧紧凝聚在一起。原本有望被东京的音乐製作公司签下，正当迎接光明的未来时，因为一场飞来横祸而失去了方向。而让停下的时针再度往下走的，是一首未填词demo，与一位住在美军基地的少女。为将未了的『心意』传达到围栏的另一端，这群四分五裂的年轻人乐队，再度背起了乐器…', '/static/upload/movie/2020-3-10/p2551446468.jpg', ' 日本', '2019-05-24(日本)', 7.7, '2020-03-08 21:25:30.773094', '2020-03-08 21:25:30.773094');
INSERT INTO `movie` VALUES ('30234315', '摄影机不要停！', '　　郊外一座废弃的工厂内，一支摄制组正在拍摄一部粗糙简陋的僵尸片。导演日暮隆之（滨津隆之饰）不满女主角松本逢花（秋山ゆずき饰）的演技，因此暴跳如雷，大吼大叫。在工作人员晴美（しゅはまはるみ饰）的建议下，剧组暂时停止拍摄。休息间隙，晴美向松本以及饰演僵尸的男演员神谷和明（长屋和彰饰）讲述了这座工厂在二战期间的恐怖旧事。就在此时，不祥的巨响突然传来，未过多久，一名工作人员化作僵尸突然出现，对其他剧组成员展开疯狂啃咬。演职员们四散而逃，而疯狂的导演却举起摄像机，开始了他梦寐以求的电影的拍摄。', '/static/upload/movie/2020-3-10/p2541824676.jpg', ' 日本', '2017-11-04(东京首映);2018-06-23(日本)', 7.2, '2020-03-08 21:28:43.718629', '2020-03-08 21:28:43.718629');
INSERT INTO `movie` VALUES ('30234426', '来者何人', '　　讲述了发生在西北偏僻村落的一桩意外死亡案件，由此牵扯出一系列突如其来的杀人案和“嫌疑者”：村医刘新申、心理学高材生刘云、与刘新申再续前缘的妻子康晓燕、意外毙命乡野路头的陈全、与陈全素有积怨的村民等，到底谁是悬案凶手？主角、村医刘新申经历两次道德拷问的人生又将作出怎样的抉择？影片着眼人性的良知与私欲，探讨生命的意义与价值。', '/static/upload/movie/2020-3-10/p2534170479.jpg', ' 中国大陆', '2019-10-30(中国大陆)', 8.6, '2020-03-08 21:28:23.938974', '2020-03-08 21:28:23.938974');
INSERT INTO `movie` VALUES ('30241298', '南山的部长们', '　　电影\"南山的部长们\"以韩国中央情报部(KCIA)的部长们(副总理级)与他们所主导的政治阴谋为素材，原作为揭露韩国政治内幕的同名小说，以历代中央情报部的部长金载圭和金炯旭的故事为中心重新创作而成。1979年下半年，YH贸易女工笼城事件、新民党总裁金泳三的国会议员除名事件以及10月的釜马事件先后爆发，政局不定。中央情报部金载圭和强硬派总统警卫室室长发生摩擦，朴正熙对他逐渐反感和不信任。1979年10月26日，在汉城钟路区宫井洞中央情报部官邸中，朴正熙和总统警卫室室长在宴会酒席中被金载圭用手枪枪杀。', '/static/upload/movie/2020-3-10/p2581888792.jpg', ' 韩国', '2020-01-22(韩国)', 2.2, '2020-03-08 21:25:23.576724', '2020-03-08 21:25:23.576724');
INSERT INTO `movie` VALUES ('30241301', '衣橱', '　　自从妻子过世后，尚元（河正宇饰）和女儿的关系越来越疏远，于是他决定带着女儿搬到乡下，修复彼此的关系。但即使搬家后，尚元仍专注于自己的工作，不多关心女儿。女儿多了更多独处的时间，且开始表现出奇怪和令人不安的行为，而尚元也开始在家中遭遇离奇的现象。某天，女儿竟突然在衣橱前消失得无影无踪……', '/static/upload/movie/2020-3-10/p2580988442.jpg', ' 韩国', '2020-02-05(韩国)', 5, '2020-03-08 21:25:38.584250', '2020-03-08 21:25:38.584250');
INSERT INTO `movie` VALUES ('30252495', '1917', '　　1917年，第一次世界大战进入最激烈之际，两个年仅16岁的英国士兵接到的命令，需立即赶往死亡前线，向那里的将军传达一个“立刻停止进攻”讯息。时间只有八小时，武器弹药有限，无人知晓前方敌况：死亡寂静之地、布满尸体的铁丝网、突入其来的敌军、随时毙命的危险境况……这一次两个少年为救1600个人的性命，不完成，毋宁死！', '/static/upload/movie/2020-3-10/p2570243317.jpg', ' 英国 / 美国', '2020(中国大陆);2019-12-25(美国);2020-01-10(英国)', 9.7, '2020-03-08 21:25:04.034363', '2020-03-08 21:25:04.034363');
INSERT INTO `movie` VALUES ('3025375', '奇异博士', '　　斯特兰奇博士（本尼迪克特·康伯巴奇BenedictCumberbatch饰）是一名外科手术医生，他拥有着高超的智商和精湛的技艺，是医院乃至整个医学界的传奇人物。某一日，斯特兰奇博士遭遇了一场可怕的车祸，尽管保住了双手，但这双手伤痕累累不住颤抖，这也就意味着，他再也不能拿起手术刀，站在无影灯下了。', '/static/upload/movie/2020-3-10/p2388501883.jpg', ' 美国', '2016-11-04(中国大陆/美国);2016-10-25(英国)', 1.9, '2020-03-08 21:27:54.828583', '2020-03-08 21:27:54.828583');
INSERT INTO `movie` VALUES ('30257175', '燃烧女子的肖像', '　　1760年法国布列塔尼，才华洋溢的年轻女画家玛莉安（诺米·梅兰特饰）收到委托，需要在对方不知情的状况下，完成富家小姐艾洛伊兹（阿黛拉·哈内尔饰）出嫁前的肖像画。两人在孤岛相依为命，白天女画家悄悄观察小姐的一举一动，到了晚上才纵情下笔。两人在画与被画的亲密接触下，即便是在充满礼教束缚的时代，却也渐渐萌发了禁忌的暧昧情愫，随着大婚之日越来越近，她们的爱火却越烧越猛烈…', '/static/upload/movie/2020-3-10/p2568318727.jpg', ' 法国', '2019-05-19(戛纳电影节);2019-09-18(法国)', 1.7, '2020-03-08 21:25:51.409264', '2020-03-08 21:25:51.409264');
INSERT INTO `movie` VALUES ('30258072', '为美好的世界献上祝福！红传说', '　　本应由于交通事故（!?）导致人生轻易闭幕的游戏迷家里蹲·佐藤和真，事出偶然地带着女神·阿库娅转生到了异世界。“在如同RPG游戏一样的异世界，享受憧憬已久的冒险者生活！目标是勇者！”像这样兴奋了还没多久，转生而来的和真就尽是遇到倒霉的事情。麻烦制造机废柴女神·阿库娅，重度中二病魔法使·惠惠，妄想停不下来的女骑士·达克妮丝，和真与空有高超能力值却无比残念的这3人组队，欠下一屁股债，涉嫌颠覆国家罪而遭到审判，讨伐魔王军干部，偶尔还会死一死……', '/static/upload/movie/2020-3-10/p2551687590.jpg', ' 日本', '2019-08-30(日本)', 4.3, '2020-03-08 21:26:32.846857', '2020-03-08 21:26:32.846857');
INSERT INTO `movie` VALUES ('30258631', '斯宾塞的机密任务', '　　这是沃尔伯格和导演彼得·博格自《孤独的幸存者》《恐袭波士顿》《深海浩劫》《22英里》后第五度，合作基于罗伯特·B·派克所著同名小说，派克死后由AceAtkins接手创作，也是以男主角Spenser为中心的八本系列悬疑小说中的一本。Netflix已经和派克遗产方面达成协议，基于Spenser这一角色打造一系列电影。', '/static/upload/movie/2020-3-10/p2581570053.jpg', ' 美国', '2020-03-06(美国)', 5.3, '2020-03-08 21:25:26.486421', '2020-03-08 21:25:26.486421');
INSERT INTO `movie` VALUES ('30269016', '半个喜剧', '　　三个自由浪漫的年轻人，过着各怀心思的人生：有人急着摆脱单身，有人想在结婚前放荡一番，有人想在大城市站稳脚跟。因为一次情感出轨，三人扭结成了一团“嬉笑怒骂”的乱麻。当各种价值观碰撞在一起，当一个人需要平衡亲情友情与爱情......他们慌乱的生活，就像是半个喜剧。', '/static/upload/movie/2020-3-10/p2576482356.jpg', ' 中国大陆', '2019-12-20(中国大陆)', 6.3, '2020-03-08 21:27:48.433893', '2020-03-08 21:27:48.433893');
INSERT INTO `movie` VALUES ('30269400', '死尸无言', '　　Stênio(DanieldeOliveira)worksthenightshiftatamorgueinaverylarge,veryviolentcity.Onthejob,heseescadaversineveryconceivablestate,oftenthevictimsofhorrificgangwarfare.Whilemostwouldberatherunsettledbyitall,Stênioisnot.Forthedeadspeaktohim.Notinanymetaphoricalsensebutinaveryliteralway.Stêniowasbornwithanoccultgift...', '/static/upload/movie/2020-3-10/p2530862423.jpg', ' 巴西', '2018-07-17(加拿大国际奇幻电影节)', 1.3, '2020-03-08 21:28:07.474093', '2020-03-08 21:28:07.474093');
INSERT INTO `movie` VALUES ('30271841', '多哥', '　　聚焦1925年雪橇手和雪橇犬齐心协力为拯救阿拉斯加州诺姆市孩子的性命而奔波于血清接力路上的事件，被称为“GreatRaceofMercy”。本片将登陆迪士尼自家流媒体，2019年推出。', '/static/upload/movie/2020-3-10/p2575882765.jpg', ' 美国', '2019-12-20(美国)', 1.3, '2020-03-08 21:27:32.650682', '2020-03-08 21:27:32.650682');
INSERT INTO `movie` VALUES ('30275464', '女服务员', '　　墨西哥城高檔酒店內，年輕女傭自有心事。日復一日的漫長工作，總有打掃不盡的房間。她長途跋涉上班，無法照料年幼兒子，卻要幫客人看顧小孩。參加進修班，望能晉升到尊貴樓層。偶然拾獲紅裙，盼失物無人認領可據為己有。抹窗工人隔窗傳情，她其實更需要找到女性自我的聲音。來自劇場的阿維萊絲首拍長片即備受注目，以紀實眼光看打工女的生活與生存，發掘角色沉靜外表下的豐富情感，暗暗接通戴丹兄弟和艾方素卡朗的《羅馬》（2018）。', '/static/upload/movie/2020-3-10/p2532290323.jpg', ' 墨西哥', '2018-09(圣塞巴斯蒂安电影节)', 5.8, '2020-03-08 21:28:43.583043', '2020-03-08 21:28:43.583043');
INSERT INTO `movie` VALUES ('30282897', '丹尼尔不是真的', '　　阿诺·施瓦辛格之子帕特里克·施瓦辛格、萨莎·莱恩([美国甜心])、蒂姆·罗宾斯之子迈尔斯·罗宾斯、汉娜·马克斯(《全能侦探社》)将主演惊悚片[丹尼尔不是真实的](DanielIsn’tReal，暂译)，影片由亚当·埃及·莫蒂默(AdamEgyptMortimer)([复仇之灵])执导。故事根据布莱恩·德莱乌创作小说《我被这样拯救》(InThisWayIWasSaved)改编，德莱乌与莫蒂默共同操刀剧本。讲述一个遭受家庭暴力创伤的大学新生，再次构想了他童年想象中的朋友丹尼尔。丹尼尔能够帮助他应对一切。该片已在纽约开拍。', '/static/upload/movie/2020-3-10/p2550143180.jpg', ' 美国', '2019-03-09(美国西南偏南电影节);2019-12-06(美国)', 2, '2020-03-08 21:28:48.158899', '2020-03-08 21:28:48.158899');
INSERT INTO `movie` VALUES ('30289194', '爆炸新闻', '　　约翰·利特高(《王冠》)饰演福克斯新闻创始人之一、前董事长罗杰·艾尔斯，塞隆饰演前福克斯新闻主持人梅根·凯利，妮可饰演前主持人格雷琴·卡尔森，罗比饰演一个虚构角色、名叫KaylaPospisil的助理制片人，珍妮饰演艾尔斯的律师SusanEstrich，马尔科姆·麦克道威尔(《发条橙》《罗马帝国艳情史》)饰演鲁伯特·默多克，布里盖特·伦迪·佩恩(《非典型少年》《缩小人生》)饰演JuliaClarke，丽芙·休森(《小镇滋味》《忽然七日》)饰演梅根·凯利的助手Lily，霍尔姆饰演主持人MarthaMacCallum，是艾尔斯的捍卫者，加雷特饰演主持人SeanHannity，一直将艾尔斯视为第二个父亲，称其为“美国最伟大爱国战士”之一。', '/static/upload/movie/2020-3-10/p2571554907.jpg', ' 美国 / 加拿大', '2019-11-27(英国);2019-12-20(美国/加拿大)', 7.8, '2020-03-08 21:27:54.796750', '2020-03-08 21:27:54.796750');
INSERT INTO `movie` VALUES ('30292777', '阳光普照', '　　平凡的一家人阿文（陈以文饰）和琴姐（柯淑勤饰）育有两个儿子，叛逆的小儿子阿和（巫建和饰）与好友菜头（刘冠廷饰）砍伤人进了少年辅育院，但阿和的女友小玉（吴岱凌饰）却带着身孕来家里…琴姐不顾阿文反对，将小玉留下来照顾。此时，被砍伤者家属也来找阿文求取巨额赔偿，阿文受不了总是带来麻烦的小儿子，将所有希望都寄托在资优生大儿子阿豪（许光汉饰）身上，却不知道温暖善良的阿豪心中也藏着不为人知的秘密…', '/static/upload/movie/2020-3-10/p2570235120.jpg', ' 中国台湾', '2019-11-01(中国台湾);2019-09-06(多伦多电影节)', 7.4, '2020-03-08 21:25:35.585518', '2020-03-08 21:25:35.585518');
INSERT INTO `movie` VALUES ('30295905', '中国机长', '　　根据2018年5月14日四川航空3U8633航班机组成功处置特情真实事件改编。机组执行航班任务时，在万米高空突遇驾驶舱风挡玻璃爆裂脱落、座舱释压的极端罕见险情，生死关头，他们临危不乱、果断应对、正确处置，确保了机上全部人员的生命安全，创造了世界民航史上的奇迹。', '/static/upload/movie/2020-3-10/p2568258113.jpg', ' 中国大陆', '2019-09-30(中国大陆)', 2.7, '2020-03-08 21:28:50.330922', '2020-03-08 21:28:50.330922');
INSERT INTO `movie` VALUES ('30304015', '动物园先生', '　　讲述在即将迎来升迁的国家情报局ACE泰祖（李星民饰）出任保护中国特使大熊猫的警卫过程中，突然遭遇意外事故。这是一部讲述与动物进行沟通的喜剧片。（翻译by@韩影画外音）', '/static/upload/movie/2020-3-10/p2578351116.jpg', ' 韩国', '2020-01-22(韩国)', 8.2, '2020-03-08 21:27:58.421216', '2020-03-08 21:27:58.421216');
INSERT INTO `movie` VALUES ('30304469', '阿松 剧场版', '　　那六胞胎在完全新作剧场版中回来了！', '/static/upload/movie/2020-3-10/p2551357206.jpg', ' 日本', '2019-03-15(日本)', 7.9, '2020-03-08 21:26:19.637739', '2020-03-08 21:26:19.637739');
INSERT INTO `movie` VALUES ('30306570', '囧妈', '　　虽然有着诸多不舍，但是强势的老板徐伊万（徐峥饰）还是和合作伙伴兼妻子张璐（袁泉饰）结束了失败的婚姻。由于某种心理作祟，他试图阻挠前妻在海外重新创业。为了第一时间赶去美国，他回到母亲卢小花（黄梅莹饰）的住处取护照，结果阴差阳错和母亲坐上了开往俄罗斯的K3次列车。如同身边的老年人一样，卢小花对儿子有着无休止的过度关爱与碎碎念。漫长的旅途中，伊万饱受折磨，他一边遥控表弟郭贴（郭京飞饰）破坏张璐的生意，一边和母亲展开斗智斗勇的拉锯战。在这一过程中，母子二人冲突不断。伊万渐渐了解到母亲的爱情，同时他也开始反省自己的人生。', '/static/upload/movie/2020-3-10/p2581835383.jpg', ' 中国大陆', '2020-01-25(中国大陆网络)', 5, '2020-03-08 21:26:55.545308', '2020-03-08 21:26:55.545308');
INSERT INTO `movie` VALUES ('30306597', '黄金宝藏', '　　有「巨人」称号的策本是那达慕节的摔跤冠军，尽管已获得无数次的胜利，年迈的他却没有儿子能继承这份荣耀，就在得知妻子生下的第四胎也是女儿的当下，策本决定把么女太文视为男孩来抚养，面对被迫放弃女儿身的太文，内心依旧渴望换上美丽的衣服，当个漂亮的女孩。就在某次意外中，她的死对头杭艾发现这个惊人的真相，两人的关系也因此产生微妙的变化，究竟这个家族秘密能否永远守住？太文是否注定一生都得当个男孩子？', '/static/upload/movie/2020-3-10/p2531899722.jpg', ' 蒙古', '2016-03-05(蒙古)', 1.3, '2020-03-08 21:26:27.934068', '2020-03-08 21:26:27.934068');
INSERT INTO `movie` VALUES ('30318116', '利刃出鞘', '　　富豪小说家哈兰·斯隆比在自己85岁生日第二天，被发现在自家庄园离奇自杀，遗留了亿万遗产。久负盛名的大侦探布兰科（丹尼尔·克雷格饰）突然被匿名人士雇佣调查此案真相。同时，哈兰的孙子兰森（克里斯·埃文斯饰）也正在秘密调查此案。当布兰科和哈兰·斯隆比家族的其他人对谈时，他发现事情并没有想象中那么简单。', '/static/upload/movie/2020-3-10/p2574172427.jpg', ' 美国', '2019-11-29(中国大陆);2019-09-07(多伦多电影节);2019-11-27(美国)', 6.6, '2020-03-08 21:25:38.866925', '2020-03-08 21:25:38.866925');
INSERT INTO `movie` VALUES ('30327569', '男子啦啦队！！', '　　晴希從小就學習柔道，本來應該是要繼承父親的道場，但他覺得自己一點天賦也沒有，也不像他那所向無敵的姊姊，因為一次意外晴希受了傷，並離開了道場。就在此時，他的童年好友一馬和他說：「我們一起挑戰好玩的事吧！」於是，他們成立了一個前所未有的社團：男子啦啦隊！', '/static/upload/movie/2020-3-10/p2550457033.jpg', ' 日本', '2019-05-10(日本)', 8.2, '2020-03-08 21:27:43.598147', '2020-03-08 21:27:43.598147');
INSERT INTO `movie` VALUES ('30327842', '82年生的金智英', '　　表面看来，金智英（郑有美饰）是一个生活在幸福之中的家庭主妇，有一个收入不菲又温柔体贴的丈夫郑大贤（孔侑饰）和一个非常可爱的女儿，在波澜不惊的日子里享受着每一天的平淡和安稳。', '/static/upload/movie/2020-3-10/p2578045524.jpg', ' 韩国', '2019-11-07(中国香港);2019-10-23(韩国)', 3.8, '2020-03-08 21:25:46.162187', '2020-03-08 21:25:46.162187');
INSERT INTO `movie` VALUES ('30329892', '航海王：狂热行动', '　　《航海王：狂热行动》是“航海王系列”第14部剧场版，也是《航海王》动画二十周年纪念之作。', '/static/upload/movie/2020-3-10/p2570039912.jpg', ' 日本', '2019-10-18(中国大陆);2019-08-09(日本)', 1.5, '2020-03-08 21:28:42.791973', '2020-03-08 21:28:42.791973');
INSERT INTO `movie` VALUES ('30331149', '白蛇：缘起', '　　幽暗洞中，白蛇（张喆配音）苦苦修炼却不得其法，小青见此情景，将发髻上的碧玉簪子取下，令白蛇攥在手中。那一刻，五百年前的记忆瞬间苏醒。五百年前，晚唐君主昏聩庸碌，掌握邪术的国师只手遮天，命令天下百姓捕蛇修法。为了拯救族群，白蛇冒险行刺，结果却遭遇挫败，还失去了记忆。当她再度醒来，发现自己被一个专门捕蛇的村落所救下，而那个胆小却善良的青年许宣（杨天翔配音）则吸引了白蛇的注意。与此同时，国师派出爪牙四处追寻白蛇的下落，而蛇族更误解白蛇叛逃人类，接二连三派出杀手。', '/static/upload/movie/2020-3-10/p2544313786.jpg', ' 中国大陆 / 美国', '2019-01-11(中国大陆)', 2.1, '2020-03-08 21:27:43.640800', '2020-03-08 21:27:43.640800');
INSERT INTO `movie` VALUES ('30331959', '黑水', '　　基于NathanielRich在《纽约时报》上发表的文章《TheLawyerWhoBecameDuPont’sWorstNightmare》，围绕罗伯特·比洛特展开，他担任辩护律师长达8年之久，他对化工巨头杜邦公司提起了环境诉讼，这场官司揭露了几十年来杜邦公司化学污染的历史。', '/static/upload/movie/2020-3-10/p2569450232.jpg', ' 美国', '2019-11-22(美国点映);2019-12-06(美国)', 3.3, '2020-03-08 21:25:55.732507', '2020-03-08 21:25:55.732507');
INSERT INTO `movie` VALUES ('30334073', '调音师', '　　双目失明的钢琴家阿卡什（阿尤斯曼·库拉纳AyushmannKhurrana饰）为了参加国际大赛，平日里通过私人授课赚取经费。事实上他的眼睛完全正常，只不过希望通过这种方式感受不同的生活。因为一场意外，阿卡什结识了美丽的姑娘苏菲（拉迪卡·艾普特RadhikaApte饰）。凭借出色的演奏技巧，阿卡什在苏菲父亲经营的西餐馆谋得兼职。他的演奏不仅令食客们倾倒，更虏获了苏菲的心。某天，阿卡什接受过气的影星普拉默（安尔·德霍万AnilDhawan饰）的邀请，登门为对方的妻子西米（塔布Tabu饰）演奏庆生，谁知却亲眼目睹了倒在血泊中的普拉默的尸体。惊慌失措的阿卡什假装镇定，虽然暂时骗过了西米及其情夫，但是他的秘密还是慢慢被人戳穿……', '/static/upload/movie/2020-3-10/p2551995207.jpg', ' 印度', '2019-04-03(中国大陆);2018-10-05(印度)', 2.6, '2020-03-08 21:28:44.996367', '2020-03-08 21:28:44.996367');
INSERT INTO `movie` VALUES ('30359368', '葬礼的名人', '　　大阪府茨木市にある簡素な木造アパートで、息子と2人で暮らしている28歳・渡辺雪子。ある日、彼女のもとに高校時代の同級生の訃報が届く。卒業から10年の時を経て、通夜に集まった同級生たちが体験したのは、これまでに見たことも聞いたこともない奇想天外なお通夜だった――。', '/static/upload/movie/2020-3-10/p2581310242.jpg', ' 日本', '2019-06-15(上海国际电影节);2019-09-20(日本)', 2.2, '2020-03-08 21:28:52.672813', '2020-03-08 21:28:52.672813');
INSERT INTO `movie` VALUES ('30371818', '美好年代', '　　尼古拉斯·贝多斯([阿德尔曼夫妇])自编自导的新片[美好年代](LaBelleÉpoque，暂译)已于9月25日开机，将于本月28日完成拍摄。卡司包括丹尼尔·奥特伊、吉约姆·卡内、芬妮·阿尔丹、皮埃尔·阿迪提、德尼·波达利德斯。故事讲述60多岁的男主维克多面临婚姻危机，一个商人安东尼向他兜售称他的公司可以让维克多重返自己昔日岁月的某一时段，维克多选择了重返与初恋相遇的40年前。该片法国发行权、国际销售权归Pathé、OrangeStudio。', '/static/upload/movie/2020-3-10/p2555783219.jpg', ' 法国', '2019-05-20(戛纳电影节);2019-11-06(法国)', 3.5, '2020-03-08 21:27:22.620688', '2020-03-08 21:27:22.620688');
INSERT INTO `movie` VALUES ('30377785', '蜻蜓少年', '　　暑假，十二岁的双胞胎凯文凯武央求母亲给他们买新自行车。他们骑着新自行车带着同村小孩兴奋地在路上飞驰，结果遇上了邻村的康康，后者嘲笑他们虽买了新车，却连放双手骑都不会，丢人现眼。双胞胎受了刺激，为战胜康康，开始勤学苦练，但好静的凯文渐渐力不从心，放弃了练习。凯武刻苦训练并最终取得了胜利。这份对凯武独有的称赞让凯文难堪，他暗下决心也要学会放手骑车，但始终没有学会……', '/static/upload/movie/2020-3-10/p2543777013.jpg', ' 中国大陆', '2019-01-11(中国大陆)', 1, '2020-03-08 21:28:17.786324', '2020-03-08 21:28:17.786324');
INSERT INTO `movie` VALUES ('30394535', '被光抓走的人', '　　据说该片的创作灵感来源于董润年的一个脑洞：“如果有一道神秘的光把一部分人抓走，社会的平静与法则被打破，我们该怎么办？”在导演的脑洞中，光代表什么？为什么人会被光抓走？谁会被光抓走？留下来的人要怎么办？这一系列疑问未来都需要在片中得到解答。', '/static/upload/movie/2020-3-10/p2575887979.jpg', ' 中国大陆', '2019-12-13(中国大陆)', 7.3, '2020-03-08 21:27:18.374046', '2020-03-08 21:27:18.374046');
INSERT INTO `movie` VALUES ('30404238', '脚下的土地', '　　羅拉是醒目女，雄心勃勃，追名逐利不容有失。身為管理顧問，她負責協助不同公司進行架構重組，可是她自己的人生，又如何重組？總是忙於工作、到不同城市出差、跟客戶共晉晚餐、上健身室，事業型女性的亮麗外表下，是深深隱藏的秘密：姊姊罹患精神病，有自毀傾向及被害妄想。羅拉老是收到姊姊求助電話，井然有序的生活開始失控。瑪莉克魯澤把女強人故事混合心理懸疑及驚慄元素，揭示正常與失常的一線之隔。入選柏林影展競賽單元。', '/static/upload/movie/2020-3-10/p2563680158.jpg', ' 奥地利', '2019-02-09(柏林电影节);2019-03-22(奥地利)', 4.1, '2020-03-08 21:25:55.985328', '2020-03-08 21:25:55.985328');
INSERT INTO `movie` VALUES ('30414274', '龙藏深泉王隐林', '　　2018年12月24日，中国中央电视台电影频道与HBO亚洲携手，举办联合出品的功夫系列电视电影《龙藏深泉王隐林》发布会，并宣布这两部作品将于2019年初在各自平台首播。', '/static/upload/movie/2020-3-10/p2548650670.jpg', ' 中国大陆', '2019-02-20(中国大陆)', 1.1, '2020-03-08 21:28:50.560602', '2020-03-08 21:28:50.560602');
INSERT INTO `movie` VALUES ('30424207', '野王', '　　讲述一终日与大猩猩为伴的太行山上野人“山魁”，霸踞山林，人莫详知。偶然救下被仇人追杀误闯山林的小女孩“箜儿”。一场古代武侠族群间的争霸暗战也就此撕裂。人类野性中的“抵抗”，与山林野兽的“温情”，层叠出跨越血肉的救赎之勇。', '/static/upload/movie/2020-3-10/p2571448144.jpg', ' 中国大陆', '2019(中国大陆)', 2.9, '2020-03-08 21:28:49.574341', '2020-03-08 21:28:49.574341');
INSERT INTO `movie` VALUES ('30427631', '丹麦之子', '　　2025年，也就是哥本哈根遭遇重大炸弹袭击的一年后，丹麦全国各地的激进化运动加剧，种族关系高度紧张。下一届议会选举即将来临，而极端民族主义政治领袖马丁·诺达尔具有压倒性的优势。19岁的扎卡里亚参与了一个激进组织，在那里他认识了阿里。两个小伙子看不惯愈发排斥移民的社会现状，于是决定采取行动。然而，他们都只是掌权者手中的工具。在二人努力影响时局的过程中，他们的兄弟情谊会受到考验，而他们的行动也将波及他们的人生。', '/static/upload/movie/2020-3-10/p2545117777.jpg', ' 丹麦', '2019-01-24(鹿特丹电影节)', 7.4, '2020-03-08 21:26:06.784061', '2020-03-08 21:26:06.784061');
INSERT INTO `movie` VALUES ('30434174', '遗愿清单', '　　吉永小百合将与天海佑希共同主演日版[遗愿清单]！2007年的原版[遗愿清单]由杰克·尼科尔森、摩根·弗里曼共同主演，而此次日版的改编，两位主角则选择以女性角色来展现。影片将描绘家庭主妇（吉永小百合饰）与女社长（天海佑希饰）皆因病住院，时日无多，却发现自己的人生如此“空白”。两人便开始制作遗愿清单，展开人生的另一页。', '/static/upload/movie/2020-3-10/p2555841251.jpg', ' 日本', '2019-10-11(日本)', 4.4, '2020-03-08 21:28:46.818127', '2020-03-08 21:28:46.818127');
INSERT INTO `movie` VALUES ('30461660', '勇者斗恶龙 你的故事', '　　根据史克威尔的名作RPG《勇者斗恶龙》改编的CG动画电影《勇者斗恶龙：你的故事》', '/static/upload/movie/2020-3-10/p2560003941.jpg', ' 日本', '2019-08-02(日本)', 9.9, '2020-03-08 21:28:39.850004', '2020-03-08 21:28:39.850004');
INSERT INTO `movie` VALUES ('30481833', '少年泰坦出击大战少年泰坦', '　　abriefteasertrailer—purportingtobefromnextweek’sBlu-rayandDVDreleaseofGo!TotheMovies—leakedonline,allegingthatthetwoanimatedTitanteamswillclashinanewanimatedprojectcalled,ofcourse,TeenTitansGo!vs.TeenTitans', '/static/upload/movie/2020-3-10/p2564710731.jpg', ' 美国', '2019-09-24(美国)', 4.5, '2020-03-08 21:28:46.935775', '2020-03-08 21:28:46.935775');
INSERT INTO `movie` VALUES ('30483355', '通灵车教', '　　罗斯是一个可爱的小镇驾驶教练，她有超能力，也就是“天赋”，这意味着她可以和精神世界对话。在看到他们对她父亲文森特所做的事情后，罗斯对自己的能力又爱又恨，并试图忽视当地人不断的琐碎的精神需求——闹鬼的垃圾箱、拖拉机、儿童自行车、煎锅等等。然而，当她的帮助是请求莎拉，一个十几岁的父亲，马丁，是困扰他已故的唠叨妻子，她是非常诱惑…马丁似乎是个很好的人!与此同时，在城外的一座大城堡里，克里斯琴·温特，一个落魄的摇滚明星，有一个邪恶的计划，要出卖自己的灵魂来获得新的...', '/static/upload/movie/2020-3-10/p2562147653.jpg', ' 爱尔兰 / 比利时 / 芬兰 / 英国', '2019-03-10(西南偏南电影节)', 5.4, '2020-03-08 21:26:47.997853', '2020-03-08 21:26:47.997853');
INSERT INTO `movie` VALUES ('30486586', '2008年第29届北京奥运会', '　　第29届夏季奥林匹克运动会（GamesoftheXXIXOlympiad），又称2008年北京奥运会，2008年8月8日晚上8时整在中华人民共和国首都北京举办。', '/static/upload/movie/2020-3-10/p2550468385.jpg', ' 中国大陆', '2008-08-08(中国大陆)', 1.7, '2020-03-08 21:27:05.627719', '2020-03-08 21:27:05.627719');
INSERT INTO `movie` VALUES ('3071441', '雪国列车', '　　为了应对愈演愈烈的温室效应，世界各国在2014年发射了代号CW-7的冷冻剂，谁知却将地球推入了万劫不复的极寒深渊。大多数的人类死于寒冷与恐慌，只有为数不多的数千人登上了威尔福德工业开发的列车，成为永不停歇的流浪者。这列火车借助威尔福德（艾德·哈里斯EdHarris饰）开发的永动引擎，并且配备各种完备设施，在之后的十七年里构建了属于自己的独立生态系统，周而复始旋转在43.8万公里的漫长旅途中。生活在末尾车厢的底层人民一直饱受压迫，为了争取自由和权力，他们在过去发起过多次暴动，但无疑例外均以失败告终。这一次，拥有领袖气质的柯蒂斯（克里斯·埃文斯ChrisEvans饰）试图找到被囚禁的安保设计师南宫民秀（宋康昊饰），借助他之手打开通往首节车厢的重重大门，推翻威尔福德的统治。新年伊始，一场血腥革命正在进行……', '/static/upload/movie/2020-3-10/p2173648321.jpg', ' 韩国 / 捷克', '2014-03-17(中国大陆);2013-08-01(韩国);2014-06-27(美国)', 1.3, '2020-03-08 21:26:47.942292', '2020-03-08 21:26:47.942292');
INSERT INTO `movie` VALUES ('3168101', '毒液：致命守护者', '　　艾迪（汤姆·哈迪TomHardy饰）是一位深受观众喜爱的新闻记者，和女友安妮（米歇尔·威廉姆斯MichelleWilliams饰）相恋多年，彼此之间感情十分要好。安妮是一名律师，接手了生命基金会的案件，在女友的邮箱里，艾迪发现了基金会老板德雷克（里兹·阿迈德RizAhmed饰）不为人知的秘密。为此，艾迪不仅丢了工作，女友也离他而去。', '/static/upload/movie/2020-3-10/p2537158013.jpg', ' 美国 / 中国大陆', '2018-11-09(中国大陆);2018-10-05(美国)', 6.9, '2020-03-08 21:26:19.609666', '2020-03-08 21:26:19.609666');
INSERT INTO `movie` VALUES ('32659890', '我和我的祖国', '　　七位导演分别取材新中国成立70周年以来，祖国经历的无数个历史性经典瞬间。讲述普通人与国家之间息息相关密不可分的动人故事。聚焦大时代大事件下，小人物和国家之间，看似遥远实则密切的关联，唤醒全球华人共同回忆。', '/static/upload/movie/2020-3-10/p2567998580.jpg', ' 中国大陆', '2019-09-30(中国大陆)', 6.9, '2020-03-08 21:26:11.221828', '2020-03-08 21:26:11.221828');
INSERT INTO `movie` VALUES ('3287562', '神偷奶爸', '　　超级坏蛋格鲁（史蒂夫·卡瑞尔SteveCarell配音）在听说埃及金字塔被盗的新闻后不满市面上新贼辈出，决定在纳法利欧博士（拉塞尔·布兰德RussellBrand配音）的帮助下建造火箭升空盗取月亮。在向坏蛋银行贷款的过程中，格鲁盗取的收缩射线枪被新贼维克托（杰森·席格尔JasonSegel配音）抢走。为了夺回收缩射线枪，格鲁决定领养三位孤儿——玛戈（米兰达·卡斯格拉夫MirandaCosgrove配音）、伊迪丝（达娜·盖伊DanaGaier配音）和阿格蕾丝（埃尔希·费舍ElsieFisher配音），利用她们进入维克托的城堡兜售饼干的机会实施偷盗，计划成功后再偷偷处理掉三个小孩。然而在平凡的日常相处中，格鲁却发现自己越来越离不开这三个小鬼，但这样的感情用事却将严重影响周密的盗月计划……', '/static/upload/movie/2020-3-10/p792776858.jpg', ' 美国 / 法国', '2010-06-20(莫斯科电影节);2010-07-09(美国)', 1.3, '2020-03-08 21:27:18.419617', '2020-03-08 21:27:18.419617');
INSERT INTO `movie` VALUES ('3319755', '怦然心动', '　　布莱斯（卡兰•麦克奥利菲CallanMcAuliffe饰）全家搬到小镇，邻家女孩朱丽（玛德琳•卡罗尔MadelineCarroll饰）前来帮忙。她对他一见钟情，心愿是获得他的吻。两人是同班同学，她一直想方设法接近他，但是他避之不及。她喜欢爬在高高的梧桐树上看风景。但因为施工，树被要被砍掉，她誓死捍卫，希望他并肩作战，但是他退缩了。她的事迹上了报纸，外公对她颇有好感，令他十分困惑。她凭借鸡下蛋的项目获得了科技展第一名，成了全场焦点，令他黯然失色。她把自家鸡蛋送给他，他听家人怀疑她家鸡蛋不卫生，便偷偷把鸡蛋丢掉。她得知真相，很伤心，两人关系跌入冰点。她跟家人诉说，引发争吵。原来父亲一直攒钱照顾傻弟弟，所以生活拮据。她理解了父母，自己动手，还得到了他外公的鼎力相助。他向她道歉，但是并未解决问题。他开始关注她。鸡蛋风波未平，家庭晚宴与午餐男孩评选...', '/static/upload/movie/2020-3-10/p501177648.jpg', ' 美国', '2010-07-26(好莱坞首映);2010-09-10(美国)', 6.8, '2020-03-08 21:25:38.955004', '2020-03-08 21:25:38.955004');
INSERT INTO `movie` VALUES ('33393167', '鬼灭之刃 兄妹的羁绊', '　　舞台是大正日本。卖木炭的心地善良的少年炭治郎的日常生活因家人被魔鬼杀害而彻底改变。为了帮助唯一幸存下来的却变成凶恶鬼的妹妹隅豆子恢复如初，炭治郎踏上了为讨伐杀害家人的鬼的旅途……', '/static/upload/movie/2020-3-10/p2552453882.jpg', ' 日本', '2019-03-29(日本)', 6.4, '2020-03-08 21:25:11.165866', '2020-03-08 21:25:11.165866');
INSERT INTO `movie` VALUES ('33396232', '别岁', '　　下乡老知青周树达在返城大潮中，遗弃当地妻儿回到原籍，过上了高级知识分子生活。而在三十年后，周树达再次踏上了这片许久未见的土地试图弥补他曾经犯的过错。被他遗弃的儿子陈乐结束了八年的牢狱生活出狱后，遭遇妻子改嫁，并留给自己一个八岁患有自闭症的儿子。在好友帮助下，他找到一份修理厂的工作，并在出租屋里邂逅了性工作者雅茹。然而在儿子多次被学校拒绝上学后，陈乐做了一件再次摧毁命运的事情……', '/static/upload/movie/2020-3-10/p2558138041.jpg', ' 中国大陆', '2019-07-02(中国大陆)', 1.2, '2020-03-08 21:25:42.978431', '2020-03-08 21:25:42.978431');
INSERT INTO `movie` VALUES ('33400376', '平原上的夏洛克', '　　超英翻盖新房，占义、树河前来帮忙，没想到树河却因意外车祸入院，司机肇事逃逸，超英和占义化身“平原侦探”，踏上了一段令人啼笑皆非的荒诞追凶之旅。', '/static/upload/movie/2020-3-10/p2574198225.jpg', ' 中国大陆', '2019-11-29(中国大陆);2019-07-22(FIRST青年影展)', 1.5, '2020-03-08 21:27:38.520313', '2020-03-08 21:27:38.520313');
INSERT INTO `movie` VALUES ('33404726', '小委托人', '　　律师正烨（李东辉饰）一心只想着功成名就，对身边人和事不闻不问的他，却被多彬（崔明彬饰）和敏俊（李周元饰）小姐弟所牵绊。就在收到盼望已久的著名律师事务所录取通知的那一刻，10岁的多彬向正烨自白称杀害了自己7岁的弟弟，而这一切又与多彬的母亲智淑（柳善饰）有关。感到后悔和抱歉正烨，决定揭开多彬母亲隐藏的秘密……', '/static/upload/movie/2020-3-10/p2561250762.jpg', ' 韩国', '2019-05-22(韩国)', 5.2, '2020-03-08 21:28:17.374456', '2020-03-08 21:28:17.374456');
INSERT INTO `movie` VALUES ('33423926', '看不见的目击者', '　　女演员吉冈里帆久违3年将单独主演定于9.20日上映、森淳一导演的电影「看不见的目击者」，本片翻拍自2011年上映的韩国电影「盲证」，讲述了主人公在交通事故现场感觉到车内有被绑架的女高中生，为了解决案件而奔走的故事。', '/static/upload/movie/2020-3-10/p2563786305.jpg', ' 日本', '2019-09-20(日本)', 1.6, '2020-03-08 21:28:36.184909', '2020-03-08 21:28:36.184909');
INSERT INTO `movie` VALUES ('33436135', '只有芸知道', '　　改编自冯小刚挚友的真实爱情经历，讲述了隋东风和罗芸之间相濡以沫的动人爱情故事。但罗芸隐藏了一个只有她知道的秘密，秘密的背后却是她对隋东风刻骨铭心的爱……', '/static/upload/movie/2020-3-10/p2574861328.jpg', ' 中国大陆', '2019-12-20(中国大陆)', 1.3, '2020-03-08 21:28:30.254938', '2020-03-08 21:28:30.254938');
INSERT INTO `movie` VALUES ('33953344', '亲爱的拉蒙娜', '　　16岁的安德雷性格别扭，对充满魅力却态度冰冷的同学罗梦娜迷恋不已，直到他于度假时遇见美丽的饭店员工安娜梦娜，一切才出现变化', '/static/upload/movie/2020-3-10/p2558828171.jpg', ' 罗马尼亚', '2019-02-14(罗马尼亚)', 3.3, '2020-03-08 21:27:52.085143', '2020-03-08 21:27:52.085143');
INSERT INTO `movie` VALUES ('34786971', '陈情令之生魂', '　　靠近岐山，有一座曾被称作“小不夜天城”的扶风城。很久以前，此城花灯闪耀，夜如白昼。然而现在却被黑暗笼罩，流传着“点灯杀人”的传说。主人公温宁来到扶风城后，一入城，便发现了很多反常之处，整个城里都是老弱病残，一副萧条破败之景。黑夜来临，温宁刻意点灯，引来鬼影。正要将他擒获之时，一道蓝色剑光袭来，那黑影借机逃离。温宁抬眼一看，一道熟悉的身影从门外飞驰而入，正是他的旧相识，蓝氏子弟蓝思追。随后，温宁与蓝思追一起携手，经过不懈努力，二人最终解开谜团，擒住了幕后黑手，还百姓一个太平世间。', '/static/upload/movie/2020-3-10/p2572652962.jpg', ' 中国大陆', '2019-11-07(中国大陆)', 3, '2020-03-08 21:28:07.059063', '2020-03-08 21:28:07.059063');
INSERT INTO `movie` VALUES ('34887994', '关于哈利的那些事', '　　影片由派格执导，博尔利将饰演山姆，他是一位帅气、有趣、神经质、聪明的同性恋，他在高中时便出柜，在一个密苏里州的小镇，这需要很大的勇气。Terho饰演哈利，两人在情人节那天一起开车前往朋友的订婚派对，当山姆得知哈利已经出柜了，两人又被迫在路边的汽车旅馆过夜，这是否会激起火花？', '/static/upload/movie/2020-3-10/p2581161597.jpg', ' 美国', '2020-02-15(美国)', 5.9, '2020-03-08 21:28:49.602794', '2020-03-08 21:28:49.602794');
INSERT INTO `movie` VALUES ('34951277', '与爱同居之永恒的爱', '　　在系列事件发生之后，Tharn和Type已经约会了四年。他们仍然非常热恋，他们记得Type第一次将Tharn介绍给他的家人，但是Type的父亲可能不像他们希望的那样支持他。', '/static/upload/movie/2020-3-10/p2587583674.jpg', ' 泰国', '2020-01-29(泰国)', 2.1, '2020-03-08 21:25:26.348962', '2020-03-08 21:25:26.348962');
INSERT INTO `movie` VALUES ('34957970', '漫画威龙之大话特务', '　　特务变身网漫作家，史上最ㄎㄧㄤ斜槓人生？', '/static/upload/movie/2020-3-10/p2583254358.jpg', ' 韩国', '2020-01-22(韩国)', 9.7, '2020-03-08 21:25:16.033218', '2020-03-08 21:25:16.033218');
INSERT INTO `movie` VALUES ('34966418', '少林寺十八罗汉', '　　以悟觉和尚为首的少林十八棍僧接到皇上的御诏，奉旨南下抗倭。江浙前线，棍僧救下一队百姓，倭寇首领的亲弟弟被棍僧所杀。棍僧带领难民前往飞鱼隘口，寻求驻守明军的帮助。谁知飞鱼隘口的明军早已逃离，棍僧们只好先在此歇脚。浑然不知倭寇派出主力部队攻打飞鱼隘口，土城中仅存的百姓都是老弱妇孺，棍僧们决定留在土城帮助村民抵抗倭寇。生死存亡之际，十八棍僧共同抵挡了倭寇的进攻。但因师弟的冲动，几位师兄弟被倭寇杀害。倭寇首领得知土城中有少林的和尚，派出了忍者部队进行偷袭，以便发动最后的决战，誓要攻下飞鱼隘口，杀掉和尚为弟弟报仇。棍僧们为了掩护百姓们撤离，摆出了棍阵，以肉身阻止了倭寇的疯狂进攻，成功让百姓脱离危难。', '/static/upload/movie/2020-3-10/p2585912730.jpg', ' 中国大陆', '2020-02-20(中国大陆)', 8.9, '2020-03-08 21:28:50.104740', '2020-03-08 21:28:50.104740');
INSERT INTO `movie` VALUES ('3541415', '盗梦空间', '　　道姆·柯布（莱昂纳多·迪卡普里奥LeonardoDiCaprio饰）与同事阿瑟（约瑟夫·戈登-莱维特JosephGordon-Levitt饰）和纳什（卢卡斯·哈斯LukasHaas饰）在一次针对日本能源大亨齐藤（渡边谦饰）的盗梦行动中失败，反被齐藤利用。齐藤威逼利诱因遭通缉而流亡海外的柯布帮他拆分他竞争对手的公司，采取极端措施在其唯一继承人罗伯特·费希尔（希里安·墨菲CillianMurphy饰）的深层潜意识中种下放弃家族公司、自立门户的想法。为了重返美国，柯布偷偷求助于岳父迈尔斯（迈克尔·凯恩MichaelCaine饰），吸收了年轻的梦境设计师艾里阿德妮（艾伦·佩吉EllenPage饰）、梦境演员艾姆斯（汤姆·哈迪TomHardy饰）和药剂师约瑟夫（迪利普·劳DileepRao饰）加入行动。在一层层...', '/static/upload/movie/2020-3-10/p513344864.jpg', ' 美国 / 英国', '2010-09-01(中国大陆);2010-07-16(美国)', 4.5, '2020-03-08 21:25:46.220048', '2020-03-08 21:25:46.220048');
INSERT INTO `movie` VALUES ('3603819', '童年的收音机', '　　故事发生在六十年代末晋西南的一个小镇，围绕着以“小眼镜”，柱子、新刚等几个小伙伴制作矿石收音机的故事展开。', '/static/upload/movie/2020-3-10/p2478332722.jpg', ' 中国大陆', '2009-06-13', 2.7, '2020-03-08 21:26:24.277742', '2020-03-08 21:26:24.277742');
INSERT INTO `movie` VALUES ('3742360', '让子弹飞', '　　民国年间，花钱捐得县长的马邦德（葛优饰）携妻（刘嘉玲饰）及随从走马上任。途经南国某地，遭劫匪张麻子（姜文饰）一伙伏击，随从尽死，只夫妻二人侥幸活命。马为保命，谎称自己是县长的汤师爷。为汤师爷许下的财富所动，张麻子摇身一变化身县长，带着手下赶赴鹅城上任。有道是天高皇帝远，鹅城地处偏僻，一方霸主黄四郎（周润发饰）只手遮天，全然不将这个新来的县长放在眼里。张麻子痛打了黄的武教头（姜武饰），黄则设计害死张的义子小六（张默饰）。原本只想赚钱的马邦德，怎么也想不到竟会被卷入这场土匪和恶霸的角力之中。鹅城上空愁云密布，血雨腥风在所难免……', '/static/upload/movie/2020-3-10/p1512562287.jpg', ' 中国大陆 / 中国香港', '2010-12-16(中国大陆)', 8.2, '2020-03-08 21:28:51.332348', '2020-03-08 21:28:51.332348');
INSERT INTO `movie` VALUES ('3743114', '黄海', '　　为了能让妻子去韩国打工，出租车司机久南（河正宇Jeong-wooHa饰）不惜借6万块钱的巨款。妻子已经有六个月没有消息了，久南每日只能用酒精和赌博来麻醉自己的神经。一天，在债主的介绍下，久南认识了绵先生。绵先生不仅愿意帮助他偷渡到韩国寻找妻子，而且愿意为他还掉所有的债务，条件是让他在首尔杀一个人。几经波折，久南最终渡过茫茫黄海到达首尔，然而要杀死被严密保护的对象并不那么容易，久南一边开始周密的计划，一边开始到处打听妻子的下落。妻子就像从人间消失了一样音讯全无，而并没有杀人的久南却因出现在凶案现场而成为警方通缉的疑犯。此时，由于怕买凶杀人的事情暴露，从延边赶来的绵先生也极力致久南于死地，久南几乎陷入绝望的境地……', '/static/upload/movie/2020-3-10/p1075586949.jpg', ' 韩国 / 美国 / 中国香港', '2010-12-22(韩国)', 4.3, '2020-03-08 21:28:45.188307', '2020-03-08 21:28:45.188307');
INSERT INTO `movie` VALUES ('3750554', '彩虹照耀', '　　奥唐纳小姐是一个像彩虹一样罕见的有爱心的女人。她快乐、温暖、有爱心，收养了一个名叫托马斯的孤儿，并把他带到爱尔兰海岸外遥远的科里岛上的新家。Maire和Tomas分享了她在岛上的家的欢乐，并向他介绍了当地古怪的民间传说，包括海豹的秘密，并告诉他你需要的一切都在你的内心——如果你真的去看的话。但梅尔严厉的丈夫亚历克默默地不赞成托马斯的胆怯和结结巴巴的讲话。他无法掩饰自己的失望，因为托马斯不是他所希望的那种孩子，而他又不愿去了解这个男孩，这让他无法确定自己是否真正属于这个孩子。然而很快，托马斯也爱上了他的家，和当地的孩子们成为朋友，进入一个充满蝙蝠的秘密洞穴，并救了一只搁浅的小海豹。', '/static/upload/movie/2020-3-10/p2191681877.jpg', ' 加拿大 / 爱尔兰', '2009-06-13', 7.7, '2020-03-08 21:25:30.717894', '2020-03-08 21:25:30.717894');
INSERT INTO `movie` VALUES ('3793023', '三傻大闹宝莱坞', '　　本片根据印度畅销书作家奇坦·巴哈特（ChetanBhagat）的处女作小说《五点人》（FivePointSomeone）改编而成。法兰（马德哈万RMadhavan饰）、拉杜（沙曼·乔希SharmanJoshi饰）与兰乔（阿米尔·汗AamirKhan饰）是皇家工程学院的学生，三人共居一室，结为好友。在以严格著称的学院里，兰乔是个非常与众不同的学生，他不死记硬背，甚至还公然顶撞校长“病毒”（波曼·伊拉尼BomanIrani饰），质疑他的教学方法。他不仅鼓动法兰与拉杜去勇敢追寻理想，还劝说校长的二女儿碧雅（卡琳娜·卡普KareenaKapoor饰）离开满眼铜臭的未婚夫。兰乔的特立独行引起了模范学生“消音器”（奥米·维嘉OmiVaidya饰）的不满，他约定十年后再与兰乔一决高下，看哪种生活方式更能取得成功。', '/static/upload/movie/2020-3-10/p579729551.jpg', ' 印度', '2011-12-08(中国大陆);2009-12-25(印度)', 7.1, '2020-03-08 21:26:55.803627', '2020-03-08 21:26:55.803627');
INSERT INTO `movie` VALUES ('3878007', '海王', '　　许多年前，亚特兰蒂斯女王（妮可·基德曼NicoleKidman饰）和人类相知相恋，共同孕育了爱情的结晶——后来被陆地人称为海王的亚瑟·库瑞（杰森·莫玛JasonMomoa饰）。在成长的过程中，亚瑟接受海底导师维科（威廉·达福WillemDafoe饰）的严苛训练，时刻渴望去看望母亲，然而作为混血的私生子这却是奢望。与此同时，亚瑟的同母异父兄弟奥姆（帕特里克·威尔森PatrickWilson饰）成为亚特兰蒂斯的国王，他不满陆地人类对大海的荼毒与污染，遂谋划联合其他海底王国发动对陆地的全面战争。为了阻止他的野心，维科和奥姆的未婚妻湄拉（艾梅柏·希尔德AmberHeard饰）将亚瑟带到海底世界。', '/static/upload/movie/2020-3-10/p2541280047.jpg', ' 美国 / 澳大利亚', '2018-12-07(中国大陆);2018-12-21(美国)', 10, '2020-03-08 21:26:37.396496', '2020-03-08 21:26:37.396496');
INSERT INTO `movie` VALUES ('4030612', '伏罗希洛夫射手', '　　該片由俄羅斯國家杜馬的獨立議員斯·戈沃魯欣執導。', '/static/upload/movie/2020-3-10/p2192891959.jpg', ' 俄罗斯', '1999', 6, '2020-03-08 21:26:47.896228', '2020-03-08 21:26:47.896228');
INSERT INTO `movie` VALUES ('4136036', '晚秋', '　　《晚秋》根据李满熙导演1966年的同名电影改编而成，影片以美国西雅图为背景，讲述两名男女在异国他乡的爱情故事。本在监狱服刑的安娜（汤唯WeiTang饰）因母亲过世获得三天假期，七年来首次踏上归家之路，并于长途汽车上邂逅了勋（玄彬BinHyeon饰）。不够车钱的勋用手表做抵押借了安娜的钱，约定到西雅图再见。一个是弑夫假释的女犯，一个是专门“吃软饭”的情场骗子，两个互相隐瞒了身份的陌生人就这样在邂逅中渐生情愫，在短短三天内谈了一场浪漫恋爱。', '/static/upload/movie/2020-3-10/p1486436454.jpg', ' 韩国 / 美国 / 中国香港', '2012-03-23(中国大陆);2010-09-10(多伦多电影节);2011-02-17(韩国);2011-06-17(美国)', 4.4, '2020-03-08 21:28:43.512523', '2020-03-08 21:28:43.512523');
INSERT INTO `movie` VALUES ('4202302', '借东西的小人阿莉埃蒂', '　　虽然患有心脏方面的疾病，但是少年翔（神木隆之介配音）的父母依然对他疏于呵护。为了准备即将到来的手术，翔来到了位于偏远乡间的姨婆（竹下景子配音）家静养。姨婆家位于一片幽静的丛林中，这是一幢有着上百年历史的欧式别墅。这里除了生活着姨婆和女佣阿春（树木希林配音）外，还有一个奇特的三口之家，“借东西一族”——小人阿莉埃蒂（志田未来配音）和她的爸爸（三浦友和配音）妈妈（大竹忍配音），他们生活在别墅的地板下，只有几公分高，过着不为人类察觉的生活。遇到所需的日常用品时，便会在夜深人静之时偷偷潜入厨房借出来。翔无疑中瞥见阿莉埃蒂的身影，他有心接近这些传说中的小人，却不知不觉打扰了他们的生活……', '/static/upload/movie/2020-3-10/p617533616.jpg', ' 日本', '2010-07-17(日本)', 4, '2020-03-08 21:28:49.693096', '2020-03-08 21:28:49.693096');
INSERT INTO `movie` VALUES ('4249355', '孤胆特工', '　　住在小女孩小米（金赛纶饰）隔壁的当铺大叔（元斌饰）除过生意之外和邻居们从不来往，颓废的造型以及沉默的性格让人们对于他的身份有诸多怀疑。天真的小米从不理会这些传言，时常造访这位神秘邻居竟然使他俩慢慢的成为朋友。小米的妈妈牵连到黑帮的毒品抢夺之中，最终使自己和小米陷入危险之中。目睹小米和妈妈被人绑架的当铺大叔为了救出小米和妈妈，开始和黑道展开斗争。此时，警方也在着手调查这起案件，当铺大叔元泰锡的真正身份慢慢浮出水面。被摘除所有值钱器官的小米妈妈的尸体在一辆汽车的后备箱里被发现，但是，和她一起失踪的小米却依然下落不明……', '/static/upload/movie/2020-3-10/p1187020899.jpg', ' 韩国', '2011-09-16(中国大陆);2010-08-04(韩国)', 3.8, '2020-03-08 21:28:42.621762', '2020-03-08 21:28:42.621762');
INSERT INTO `movie` VALUES ('4268598', '告白', '　　一所平凡的中学，1年B组即将迎来春假。不知天高地厚的学生们肆意吵闹，殊不知一场绵亘数月的风暴正向他们袭来。级任教师森口悠子（松隆子饰）全然无视这片混乱，静静地向学生们做出最后的告白。这个单亲妈妈独自抚养着可爱的女儿（芦田爱菜饰），然而女儿最终在游泳池中溺水身亡。警察认定这是一起意外，森口则认定女儿死于班上两个学生之手。她不动声色地指责着犯人A和B，并宣布用自己的方式进行复仇。在此之后，森口辞去教师职务，1年B班的学生也心怀惴惴迎来了春假。新学期开始，残酷的风暴袭向了这群无知无畏的少男少女……', '/static/upload/movie/2020-3-10/p689520756.jpg', ' 日本', '2010-06-05(日本)', 8.3, '2020-03-08 21:28:47.563378', '2020-03-08 21:28:47.563378');
INSERT INTO `movie` VALUES ('4826419', '金福南杀人事件始末', '　　在首尔金融业独自打拼的单身女子郑海媛（池成媛饰）自然承受来自方方面面的巨大压力，她的情绪越来越紧张，最终不得不被迫休假。利用假期，海媛回到阔别已久的家乡无岛。这里风景秀美，民风粗犷甚至有些野蛮，男尊女卑的现象依然十分严重。海媛重逢了童年的玩伴金福南（徐英姬饰），这是一个温和开朗、任劳任怨的女人，但是她的丈夫和家人都视其为猪狗，任意欺负和凌辱。福南希望女儿小燕拥有更好的人生，只是在这个蛮荒所在，人的尊严被肆意践踏。巨大的压力下，逆来顺受的福南化身为悲剧的复仇女王……', '/static/upload/movie/2020-3-10/p596526266.jpg', ' 韩国', '2010-09-02(韩国)', 2.1, '2020-03-08 21:28:17.745535', '2020-03-08 21:28:17.745535');
INSERT INTO `movie` VALUES ('4848115', '你看起来好像很好吃', '　　哈特（山口胜平饰）是一只被草食性恐龙养大的霸王龙。其实，早在它破壳而出时，草食性恐龙的首领就曾命令哈特的母亲（原田知世饰）抛弃它，但母亲却最终还是偷偷把它养大。随着年龄的增长，每天只吃野果的哈特每天饥饿难耐，最终还是抵不住本能的驱使，开始了自己食肉的残暴生涯。然而，由于母亲的影响，在哈特的内心深处，始终涌动着一颗善良的心灵。一天，偶尔遇到一只破壳而出的食草恐龙宝宝，哈特阴差阳错的被恐龙宝宝误认为是“爸爸”，而且为小恐龙取名为“很美味”，自此开始了又一段奇异的恐龙父子情。然而，伴随着生存环境的恶化，恐龙们的生存遭受着前所未有的破坏，哈特和它的亲人最终能否经得起考验……', '/static/upload/movie/2020-3-10/p709670262.jpg', ' 日本', '2010-10-16(日本)', 7.4, '2020-03-08 21:28:44.154298', '2020-03-08 21:28:44.154298');
INSERT INTO `movie` VALUES ('4864908', '影', '　　战乱年代，群雄并起。割据一方的沛国安于现状，一任国主沛良（郑恺饰）慨歌太平。要冲之地境州早年为强邻炎国借去，而今据而不还。沛国都督子虞（邓超饰）前往讨伐，却中了对方大将杨苍（胡军饰）的拖刀，重伤不愈。心有不甘的子虞暗中派出替身境州（邓超饰）假扮自己，总理军政，内则使令夫人小艾（孙俪饰）襄助。真假子虞切磋战法，寻求破解杨苍刀法的绝技。而另一方面，沛良恼怒子虞私自约战杨苍，不惜将妹妹青萍（关晓彤饰）嫁于杨苍之子为妾媾和。淫雨霏霏，连日不开。境州上空，杀戮与机谋纠缠撕裂……', '/static/upload/movie/2020-3-10/p2530513100.jpg', ' 中国大陆 / 中国香港', '2018-09-30(中国大陆);2018-09-06(威尼斯电影节)', 4.6, '2020-03-08 21:28:42.741458', '2020-03-08 21:28:42.741458');
INSERT INTO `movie` VALUES ('4917726', '阳光姐妹淘', '　　25年前，高中生任娜美（沈恩京饰）一家从全罗道搬到汉城，娜美入读真德女子高中，因方言浓重怯于开口的娜美幸运的得到了同班大姐头夏春花（姜索拉饰）的维护，并与围绕在夏春花周围的执着于双眼皮的金玫瑰、满嘴脏话的黄珍熙、梦想成为作家的徐金玉、要成为韩国小姐的俞福姬以及沉默傲慢的美人郑秀智等五人结识。在一次和不良少女团对决之后，春花和娜美等七人组成了“Sunny”团体……', '/static/upload/movie/2020-3-10/p1374786017.jpg', ' 韩国', '2011-05-04(韩国)', 5.3, '2020-03-08 21:26:37.135774', '2020-03-08 21:26:37.135774');
INSERT INTO `movie` VALUES ('4920389', '头号玩家', '　　故事发生在2045年，虚拟现实技术已经渗透到了人类生活的每一个角落。詹姆斯哈利迪（马克·里朗斯MarkRylance饰）一手建造了名为“绿洲”的虚拟现实游戏世界，临终前，他宣布自己在游戏中设置了一个彩蛋，找到这枚彩蛋的人即可成为绿洲的继承人。要找到这枚彩蛋，必须先获得三把钥匙，而寻找钥匙的线索就隐藏在詹姆斯的过往之中。', '/static/upload/movie/2020-3-10/p2516578307.jpg', ' 美国', '2018-03-30(中国大陆);2018-03-11(西南偏南电影节);2018-03-29(美国)', 4.9, '2020-03-08 21:26:00.407954', '2020-03-08 21:26:00.407954');
INSERT INTO `movie` VALUES ('4920528', '那些年，我们一起追的女孩', '　　青春是一场大雨。即使感冒了，还盼望回头再淋它一次。人生就是不停的战斗，在还没有获得女神青睐时，左手永远都只是辅助！！！', '/static/upload/movie/2020-3-10/p1062824805.jpg', ' 中国台湾', '2011-08-19(中国台湾);2012-01-06(中国大陆)', 6.9, '2020-03-08 21:28:07.499402', '2020-03-08 21:28:07.499402');
INSERT INTO `movie` VALUES ('5350027', '妖猫传', '　　故事发生在盛唐时期的长安城，白乐天（黄轩饰）本是朝廷要官，却为了收集写诗的素材而甘愿被贬为起居郎。长安城内连连发生离奇的死亡事件，就连当今圣上也难逃厄运离奇身亡，这一切都和一只神出鬼没的妖猫有关。日本僧人空海（染谷将太饰）本为了替皇帝解咒远渡重洋而来，却和白乐天意气相投，两人决心携手调查案件真相。', '/static/upload/movie/2020-3-10/p2530249558.jpg', ' 中国大陆 / 日本', '2017-12-22(中国大陆);2018-02-24(日本)', 1.4, '2020-03-08 21:28:45.717062', '2020-03-08 21:28:45.717062');
INSERT INTO `movie` VALUES ('5502697', '夺宝联盟', '　　曾轰动全球且价值高达300亿的钻石太阳之泪惊现中国澳门，某神秘人物委托混迹赌场的盗贼澳门朴（金允石饰）组织人马侵入赌场金库，盗取钻石，事成之后报酬颇丰。在此之后，朴从韩国网罗了当年被他背叛的伙伴波派（李政宰饰）、藏帕诺（金秀贤饰）、耶妮可（全智贤饰）、嚼皮糖（金海淑饰）、佩希（金惠秀饰），以及中国方面的陈（任达华饰）、安德鲁（吴达庶饰）、朱莉（李心洁饰）、约翰尼（曾国祥饰）等人。这些人中包括偷盗、绳索、路线、演技等各方面高手，实可谓一次强强联合。', '/static/upload/movie/2020-3-10/p1761853840.jpg', ' 韩国', '2013-01-15(中国大陆);2012-07-25(韩国)', 9.8, '2020-03-08 21:28:36.141933', '2020-03-08 21:28:36.141933');
INSERT INTO `movie` VALUES ('5912992', '熔炉', '　　来自首尔的哑语美术老师仁浩（孔宥饰）来到雾津，应聘慈爱聋哑人学校。天降大雾，他意外撞车，维修时邂逅了人权组织成员柔珍（郑有美饰）。仁浩妻子早亡，8岁女儿天生哮喘由祖母照看，所以他不辞辛苦谋职养家。然而，双胞胎的校长与教导主任竟逼仁浩索贿5千万韩元。同时，仁浩逐渐发现学校笼罩着一种紧张压抑的气氛，令人窒息。有三个孩子引人关注：聪颖的金妍斗（金贤秀饰）、贪吃的陈宥利（郑仁絮饰）和弟弟自杀身亡的全民秀（白承焕饰），民秀总是满脸淤青。下课后，仁浩还听到女厕所中有呼喊与哭泣，在门卫的阻拦下他未深究。之后。他意外目睹了校长行贿警察，教导员毒打民秀，宿导溺罚妍斗的行径。一个惊天的隐秘被慢慢揭开，真相令韩国震惊……', '/static/upload/movie/2020-3-10/p1363250216.jpg', ' 韩国', '2011-09-22(韩国)', 2.7, '2020-03-08 21:25:55.957906', '2020-03-08 21:25:55.957906');
INSERT INTO `movie` VALUES ('5989818', '萤火之森', '　　某年夏天，6岁小女孩竹川萤来到爷爷家度假，她闯进了传说住满妖怪的山神森林。正当她因为迷路而焦急万分的时候，一个戴着狐狸面具的大男孩出现在她面前，并引领着萤找到回家的路。虽然萤分外感激，可是男孩却禁止她碰触自己的身体，原来这名叫银的男孩并非人类，他一旦被人类碰触就会烟消云散。在此后的日子里，萤和银成为好朋友，他们走遍了森林的每一个角落玩耍。日复一日，年复一年，每到夏天的时候萤就会如约来到森林和好朋友见面。她遵守着和银的约定，无论如何也不碰触银的身体。随着年龄的增长，萤和银对彼此的情感都悄悄发生了变化，他们共同期待相聚的日子，共同期待拥抱对方……', '/static/upload/movie/2020-3-10/p1675053073.jpg', ' 日本', '2011-09-17(日本)', 3, '2020-03-08 21:28:50.624888', '2020-03-08 21:28:50.624888');
INSERT INTO `movie` VALUES ('6057942', '隐秘而伟大', '　　两年前，朝鲜5446秘密特殊部队派出五星组组长元柳焕（金秀贤饰），潜入韩国某个村庄担当间谍。元化名方东久，以傻子的身份在一位吝啬的大妈家落脚，他清楚村中每一个人的身世和动向，同时为了不露马脚不得不经常做出一些傻里傻气令人啼笑皆非的事来。随着金正日离世，祖国方面似乎发生些许变化。当年与元互为竞争对手的黑龙组组长李海浪（朴基雄饰）以及视元为导师恩人的后辈李海真（李玹雨饰）相继出现在村中。孤独的东久在两位同志面前会稍稍作回自我，而在和“敌国”百姓的相处中，他心中的冰冷也慢慢地发生改变。', '/static/upload/movie/2020-3-10/p1947401961.jpg', ' 韩国', '2013-06-05(韩国)', 1.8, '2020-03-08 21:27:22.645374', '2020-03-08 21:27:22.645374');
INSERT INTO `movie` VALUES ('6538866', '极速车王', '　　基于真实故事，聚焦由汽车设计师卡罗尔·谢尔比带领的一队美国工程师、设计师，以及他旗下的英国车手肯·迈尔斯，亨利·福特二世要求谢尔比打造一辆全新的赛车，希望能在1966年的勒芒世界锦标赛上打败长期占主导地位的法拉利。最终福特GT40在勒芒24小时耐力赛中成功击败法拉利，并蝉联了1967和1968年的冠军。', '/static/upload/movie/2020-3-10/p2568792942.jpg', ' 美国 / 法国', '2019-08-30(特柳赖德电影节);2019-11-15(美国)', 8.9, '2020-03-08 21:26:32.752176', '2020-03-08 21:26:32.752176');
INSERT INTO `movie` VALUES ('6721655', '半碗村传奇', '　　半碗村很穷，书立家更穷，穷得连书立的作业本都买不起，但是这些丝毫没有磨灭书立与生俱来的数学天分。无意之中，徐老师(刘佩琦饰)发现了这个平日里淘气又不服管教的学生，有着不可思议的过人才智。这令他惊喜万分，他坚信书立会象一颗明星般闪耀，那将是半碗村人的骄傲，甚至是全中国人的骄傲。　　在徐老师的努力和资助下，书立不仅在数学竞赛上崭露头角，还顺利地考入北京的重点学校。求学之路充满艰辛，生活的压力更为沉重。书立几欲放弃，是身边的亲人、老师和同学给了他莫大的支持和鼓舞，让他坚定了必胜的信念。　　风雨相随、泪水相伴，书立幼小的心灵如同重负之弦愈发坚强。巨大的力量终于爆发，当书立自豪地站在世界奥林匹克数学竞赛的领奖台上时，他心中默念过无数次的话脱口而出：我很坚强，我是勇士！', '/static/upload/movie/2020-3-10/p2587517716.jpg', ' 中国大陆', '', 9.6, '2020-03-08 21:28:07.376437', '2020-03-08 21:28:07.376437');
INSERT INTO `movie` VALUES ('6786002', '触不可及', '　　因为一次跳伞事故，白人富翁菲利普Philippe（弗朗索瓦·克鲁塞FrançoisCluzet饰）瘫痪在床，欲招聘一名全职陪护。由于薪酬高，应聘者云集，个个舌灿莲花，却无法打动他的心。直到黑人德希斯Driss（奥玛·赛OmarSy饰）的出现才让他作出决定。德希斯刚从监狱出来，背负家庭重担，一心只想寻张辞退信以申领救济金，而且他明显对女助理的兴趣要远大于这份工作。但是菲利普还是一眼相中了这个小伙子。于是，德希斯开始了一个月的试用期。虽然舒适的豪宅环境让他倍感虚荣，但是他仍面临很多挑战：不仅要为菲利普作身体复健，还得给他洗浴、灌肠、拆信、穿丝袜等。起初，两人的思维方式与价值观大相径庭，但是，随着了解的不断深入，他们成为了朋友……', '/static/upload/movie/2020-3-10/p1454261925.jpg', ' 法国', '2011-11-02(法国)', 4.8, '2020-03-08 21:28:34.656634', '2020-03-08 21:28:34.656634');
INSERT INTO `movie` VALUES ('6791750', '起风了', '　　那是一个动荡的年代，战争、饥饿、疾病、天灾，死神的阴影笼罩全球，却无法遮挡心头闪现的梦想和希望的光芒。平凡的日本少年堀越二郎（庵野秀明配音）迷恋游弋长空的飞机，梦中他与意大利飞机设计师卡普罗尼（野村万斋配音）成为朋友，享受着飞行带来的乐趣。恐怖的关东大地震，二郎邂逅一生的挂念——里见菜穗子（泷本美织配音），短暂的相逢，无序的混乱中又失之交臂。在命运的指引下，被称为天才的二郎如愿成为飞机设计师，他和前辈同侪共同努力，绞尽脑汁提升飞机的性能。欧洲的先进设计让他们痛心疾首，另一方面又充满矛盾的打造着融合了梦想和杀人属性的机器。他追逐梦想，并与菜穗子重逢。动荡的昭和时代，风雪飘摇之中步伐从未停止……', '/static/upload/movie/2020-3-10/p1998028598.jpg', ' 日本', '2013-07-20(日本)', 8.8, '2020-03-08 21:27:43.705343', '2020-03-08 21:27:43.705343');
INSERT INTO `movie` VALUES ('6844868', '狼少年', '　　因为体弱多病的顺伊（朴宝英Bo-yeongPark饰）需要疗养的缘故，顺伊母女三人从首尔搬家到了乡下的一栋别墅生活。而收拾屋子的时候顺伊意外的在仓库发现了神秘的前户主朴博士在这里遗留下了的狼孩（宋仲基Joong-kiSong饰）。顺伊妈妈出于善心收留了这个狼性未泯的男孩，并给他起名叫哲秀，就这样四个人开始了同住一个屋檐下的生活。顺伊起初反感这个不会说话，吃饭狼吞虎咽的闯入者，然而朝夕相处让顺伊萌生了照顾训练哲秀的念头。她开始教给他吃饭，读书，认字，还弹奏吉他给狼孩听，而哲秀对顺伊温暖的关怀十分受用，认真的做着顺伊教授给自己的东西。孤独的顺伊因为哲秀渐渐融入到自己的世界中而开心起来，对他产生了别样的爱恋。但是这份美好却被对狼孩虎视眈眈的智泰（刘延锡Yeon-SeokYoo饰）打破，他一门心思的集结挑拨多方势力来捕杀哲秀。顺伊为了保护哲...', '/static/upload/movie/2020-3-10/p2159648145.jpg', ' 韩国', '2013-12-19(中国大陆);2012-10-31(韩国)', 6.4, '2020-03-08 21:27:14.445619', '2020-03-08 21:27:14.445619');
INSERT INTO `movie` VALUES ('6850547', '玩具总动员4', '　　胡迪深知自己在这个世界上的使命，就是照顾他的主人，无论是原来的安迪还是新主人邦妮。当邦妮将不情愿成为玩具的“叉叉”带回家时，胡迪又担起了教导叉叉接受自己新身份的责任。然而当邦妮将所有玩具带上房车家庭旅行时，胡迪与伙伴们将共同踏上全新的冒险之旅，领略房间外面的世界有多广阔，甚至偶遇老朋友牧羊女。在多年的独自闯荡中，牧羊女已经变得热爱冒险，不再只是一个精致的洋娃娃。正当胡迪和牧羊女发现彼此对玩具的使命的意义大相径庭时，他们很快意识到更大的威胁即将到来……', '/static/upload/movie/2020-3-10/p2557284230.jpg', ' 美国', '2019-06-21(美国/中国大陆)', 6.7, '2020-03-08 21:28:23.673809', '2020-03-08 21:28:23.673809');
INSERT INTO `movie` VALUES ('6874741', '无问西东', '　　如果提前了解了你所要面对的人生，你是否还会有勇气前来？吴岭澜、沈光耀、王敏佳、陈鹏、张果果，几个年轻人满怀诸多渴望，在四个非同凡响的时空中一路前行。', '/static/upload/movie/2020-3-10/p2507572275.jpg', ' 中国大陆', '2018-01-12(中国大陆)', 9.1, '2020-03-08 21:28:46.137517', '2020-03-08 21:28:46.137517');
INSERT INTO `movie` VALUES ('6981153', '爱尔兰人', '　　《爱尔兰人》为马丁·斯科塞斯执导的传奇巨制，罗伯特·德尼罗、阿尔·帕西诺和乔·佩西主演。通过二战老兵弗兰克·希兰的视角，讲述了战后美国有组织犯罪的故事。弗兰克·希兰是一名骗子和杀手，曾经在20世纪最恶名昭彰的人物身边工作。该电影跨越数十年，记录了美国历史上最大的悬案之一，即传奇工会领袖吉米·霍法失踪案，以宏大的故事之旅，展现有组织犯罪的隐秘通道：其内部运作、仇敌以及与主流政治的瓜葛。', '/static/upload/movie/2020-3-10/p2568902055.jpg', ' 美国', '2019-09-27(纽约电影节);2019-11-01(美国点映);2019-11-27(美国网络)', 1, '2020-03-08 21:26:00.626495', '2020-03-08 21:26:00.626495');
INSERT INTO `movie` VALUES ('7065154', '银河护卫队', '　　彼得·奎尔（克里斯·帕拉特ChrisPratt饰）是一名从小被劫持到外太空的地球人，在义父勇度（迈克尔·鲁克MichaelRooker饰）的培养下成了一个终极混混，自称“星爵”。一次行动中他偷了一块神秘球体，便成为了赏金猎人火箭浣熊（布莱德利·库珀BradleyCooper配音）、树人格鲁特（范·迪塞尔VinDiesel配音）的绑架目标，而神秘的卡魔拉（佐伊·索尔达娜ZoeSaldana饰）也对神秘球体势在必得。经过笑料百出的坎坷遭遇，星爵被迫和这三人，以及复仇心切的“毁灭者”德拉克斯（戴夫·巴蒂斯塔DaveBatista饰）组成小分队逃避“指控者”罗南（李·佩斯LeePace饰）的追杀。然而这个神秘球体拥有无穷的力量，小分队必须团结一致对付罗南，才有可能解救整个银河系，银河护卫队由此诞生。', '/static/upload/movie/2020-3-10/p2198455702.jpg', ' 美国 / 英国', '2014-10-10(中国大陆);2014-07-21(洛杉矶首映);2014-08-01(美国)', 5, '2020-03-08 21:28:23.715852', '2020-03-08 21:28:23.715852');
